INSERT INTO episode (id, description, episode_title, is_series, language, name, number, picture, rating, season, wanted, series_id) VALUES ('EP019560590344','Eine Bankangestellte wird bei einem Überfall getötet, der Täter kann nicht identifiziert werden.','Der verlorene Tag',_binary '','DEU','Im Namen der Gerechtigkeit - Wir kämpfen für Sie!',NULL,NULL,4,NULL,NULL,NULL),('EP015402280661','Mit Gästen aus dem Metier wird die Fütterung von Wildtieren im Winter besprochen.','Winterfütterung von Wildtieren - Sinnvoll oder schädlich?',_binary '','DEU','Planet Wissen',NULL,NULL,4,NULL,NULL,NULL),('EP019560690191','Anwalt Bernd Römer möchte seinen Freund vor einem Unglück bewahren und gerät selbst in Gefahr.','Im Netz der schwarzen Witwe',_binary '','DEU','Anwälte im Einsatz',NULL,NULL,4,NULL,NULL,NULL),('EP020064170262','Gezeigt werden engagierte Frauen, die an einem selbstbewussten, unabhängigen Afrika mitwirken.','Wie Blumen und Salz',_binary '','DEU','Mein Ausland',NULL,NULL,4,NULL,NULL,NULL),('EP019743701800','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP019426980016','Die Gerichtsmediziner kommen einem grausamen Versicherungsbetrug auf die Schliche.','Der Arzt deines Vertrauens; Nächtlicher Überfall',_binary '','DEU','Autopsie - Mysteriöse Todesfälle',NULL,NULL,4,NULL,NULL,NULL),('EP019743701802','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP019743701801','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP019734540097','Ein Mafiaboss will sich an Jonathan und Jennifer rächen. Die Harts suchen Zuflucht in einem Kloster.','Jennifer geht ins Kloster',_binary '','DEU','Hart aber herzlich'