INSERT INTO series (id, description, is_series, language, name, picture, rating, watched) VALUES ('SH030708580000','Kristina Katzer ermittelt zusammen mit ihrem Ex, Kommissar Hundt im Weimarer Revier.',NULL,'DEU','Heiter bis tödlich - Akte Ex','https://json.schedulesdirect.org/20141201/image/assets/p10432518_i_h11_aa.jpg',4,NULL),('SH030707690000','Eine fiktive Mission im Jahr 2033 führt eine Crew von Wissenschaftlern und Raumfahrern auf den Mars. Das Ziel der Mission ist die Besiedelung des Planeten, eine Herausforderung, die seit Jahrzehnten schon von der Wissenschaft in Betracht gezogen wird. Eine der zentralen Fragen ist dabei, welche Generation es sein wird, die diesen Meilenstein errichtet. Die Crew des Raumschiffs Daedalus begibt sich auf die Suche nach Leben auf dem roten Planeten und stellt sich den Problemen, die die Strahlung der Marsoberfläche bereitet.',NULL,'DEU','MARS:','https://s3.amazonaws.com/schedulesdirect/assets/p13303672_i_h11_aa.jpg',4,NULL),('SH030202350000','Gezeigt werden alle Tore und die besten Szenen der dritthöchsten deutschen Fußball-Spielklasse.',NULL,'DEU','3. Liga Pur','https://json.schedulesdirect.org/20141201/image/assets/p15783343_st_h11_ac.jpg',4,NULL),('SH028367140000','Die Sendung wirft einen Blick zurück auf die Probleme und Ängste der 1980er Jahre. Das Wettrüsten im Kalten Krieg und Zukunfsvisionen à la George Orwell werden unter anderem ins Visier gefasst.',NULL,'DEU','Die 80er - Das explosive Jahrzehnt','https://s3.amazonaws.com/schedulesdirect/assets/p14898905_st_h11_aa.jpg',4,NULL),('SH019461840000','Das Ländermagazin setzt auf Informationen aus Sachsen, Sachsen-Anhalt und Thüringen.',NULL,'DEU','MDR um 11','https://json.schedulesdirect.org/20141201/image/assets/p10869348_i_h11_aa.jpg',4,NULL),('SH002061390000','Die Sendung zeigt deutsche Landschaftsbilder begleitet von abwechslungsreicher Musik.',NULL,'DEU','Deutschlandbilder','https://json.schedulesdirect.org/20141201/image/assets/p650017_b_h6_aa.jpg',4,NULL),('SH020119840000','In 163 Folgen dokumentiert die Serie die friedliche Revolution in der DDR. Vom 40. Jahrestag der DDR am 7. Oktober 1989 bis zu den ersten freien Wahlen am 18. März 1990.',NULL,'DEU','Chronik der Wende','https://json.schedulesdirect.org/20141201/image/assets/p11110265_b_h11_aa.jpg',4,NULL),('SH023839440000','Die Dokumentarserie untersucht die Hintergründe von verschiedenen Kapitalverbrechen in den USA. Es werden verschiedene Aspekte des US-amerikanischen Justizsystems infrage gestellt, so zum Beispiel die Todesstrafe.',NULL,'DEU','Verurteilt: Todesstrafe - Wettlauf gegen die Zeit','https://json.schedulesdirect.org/20141201/image/assets/p10474987_b_v4_af.jpg',4,NULL),('SH018580080000','Der kleine Caillou geht zusammen mit seiner Schwester Rosi jeden Tag auf Entdeckungstour, um Neues zu lernen und zu erleben. Seine Neugier hilft ihm, die Antworten auf seine Fragen zu bekommen.',NULL,'DEU','Caillou','https://json.schedulesdirect.org/20141201/image/assets/p186052_i_h11_aa.jpg',4,NULL),('SH029942050000','Shaun das Schaf lebt gemeinsam mit seiner Herde auf der Weide eines idyllischen Bauernhofs. Er ist jung, unerfahren und noch etwas naiv - aber sehr neugierig und verschmitzt. Er verfügt über einen ganz besonderen `Schaf-Sinn\' und findet auch für die vertracktesten Situationen eine Lösung. Auf dem Hof leben außerdem noch der Hütehund Bitzer, der Bauer und die drei fiesen Schweine, sowie einige andere Tiere. Der Bauer bekommt von dem turbulenten Leben seiner Tiere nichts mit, die sich zwar manchmal in die Wolle kriegen, aber im Großen und Ganzen wie eine glückliche Familie zusammenleben und zusammenhalten.',NULL,'DEU','Zambo - Guetnachtgschichtli','https://json.schedulesdirect.org/20141201/image/assets/p9187264_i_h11_aa.jpg',4,NULL),('SH017375250000','Die Diskussionssendung bereitet aktuelle politische, wirtschaftliche und gesellschaftliche Themen auf. Filme und Reportagen liefern dabei Hintergründe, bereichern die Diskussion mit harten Fakten und beleuchten das Thema aus unterschiedlichen Perspektiven. Die Zuschauer können sich mit ihren Meinungen, Fragen, Ängsten und Sorgen per Telefon, Internet, Fax oder E-Mail in die Sendung einmischen. Gäste aus Politik, Kultur, Wissenschaft und Wirtschaft werden anschließend mit den Meinungen der Zuschauer konfrontiert und zur Diskussion geladen.',NULL,'DEU','Hart aber fair','https://json.schedulesdirect.org/20141201/image/assets/p716187_b_h6_ad.jpg',4,NULL),('SH019560060000','Die Sendung berichtet über Themen aus den Bereichen Wissenschaft, Technik und Mensch. Auf unterschiedliche Fragen wird versucht, Antworten zu finden und diese auf unkomplizierte und leicht verständliche Weise zu vermitteln.',NULL,'DEU','Abenteuer Leben täglich','https://s3.amazonaws.com/schedulesdirect/assets/p10903651_st_h11_ab.jpg',4,NULL),('SH019579340000','Dokumentationen über Menschen und Geschichten im Sendegebiet des NDR.',NULL,'DEU','die nordstory','https://json.schedulesdirect.org/20141201/image/assets/p10911270_i_h11_aa.jpg',4,NULL),('SH025082130000','Die Sendung präsentiert zeitloses Design der Schmuck- und Modedesignerin Jette Joop.',NULL,'DEU','Jette - Zeitloses Design','https://json.schedulesdirect.org/20141201/image/assets/p13266687_st_h11_aa.jpg',4,NULL),('SH019432910000','Die 13-köpfige Familie Wollny wird bei ihrem Alltag von der Kamera begleitet. Dabei geben sie einen ganz privaten Einblick in sämtliche Situationen, die in einer Großfamilie entstehen. Ob Probleme oder besonders schöne Momente - sie teilen alles.',NULL,'DEU','Die Wollnys - Eine schrecklich große Familie!','https://s3.amazonaws.com/schedulesdirect/assets/p10858681_st_h11_aa.jpg',4,NULL),('SH019855910000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Dortmund.',NULL,'DEU','Lokalzeit aus Dortmund','https://json.schedulesdirect.org/20141201/image/assets/p11024455_b_h6_ag.jpg',4,NULL),('SH019655640000','Kochsendung im hr-fernsehen.',NULL,'DEU','Hessen à la carte','https://json.schedulesdirect.org/20141201/image/assets/p10943917_b_h6_aa.jpg',4,NULL),('SH018556690000','Die aktuellen Nachrichten und Servicebeiträge zu Themen wie Finanzen, Reisen und Einkaufen werden präsentiert. Außerdem beschäftigt man sich mit Sportbeiträgen und weiteren informativen Tipps.',NULL,'DEU','RTL Aktuell','https://s3.amazonaws.com/schedulesdirect/assets/p472488_st_h11_aa.jpg',4,NULL),('SH019646190000','Les Gold ist Inhaber von `American Jewelry and Loan\', des größten Pfandhauses von Detroit. Das Geschäft ist bereits in dritter Generation in der Hand der Familie. Die Serie gibt Einblicke in den Alltag des amerikanischen Pfandleihgeschäfts.',NULL,'DEU','Hardcore Pawn - Das härteste Pfandhaus Detroits','https://s3.amazonaws.com/schedulesdirect/assets/p7959226_i_v4_aa.jpg',4,NULL),('SH032268380000','Die Strohhüte landen auf der Insel Dressrosa. Nachdem sie von Doflamingos Eroberung des Königreichs erfahren haben, schließen sich die Strohhüte mit den Revolutionären und Prinzessin Viola zusammen, um Doflamingo zu stürzen und die Insel zu retten.',NULL,'DEU','One Piece','https://json.schedulesdirect.org/20141201/image/assets/p12201877_st_h11_aa.jpg',4,NULL),('SH029251830000','Es werden unter anderem über Fakten und Fragen zu unterschiedlichen Themen diskutiert.',NULL,'DEU','alpha-Thema Gespräch','https://json.schedulesdirect.org/20141201/image/assets/p15293238_st_h11_aa.jpg',4,NULL),('SH023692520000','Charlie, Bailey, Claudia, Julia und Owen haben ihre Eltern bei einem Unfall verloren. Charlie hat das Restaurant des Vaters übernommen und versucht es nun mithilfe seiner Geschwister weiterzuführen. Die fünf haben jedoch jede Menge Probleme.',NULL,'DEU','Party of Five','https://json.schedulesdirect.org/20141201/image/assets/p183988_l_h6_aa.jpg',4,NULL),('SH034253870000','In der Rateshow müssen Kandidatenpaar den Wert verschiedener Gegenstände richtig schätzen. Es geht ganz schön zur Sache, und wem es gelingt, am Ende den wertvollsten Gegenstand ausgewählt zu haben, räumt den Gegenwert in Cash ab.',NULL,'DEU','Kitsch oder Kasse','https://s3.amazonaws.com/schedulesdirect/assets/p17860386_st_h11_aa.jpg',4,NULL),('SH019826900000','Die wichtigsten Ereignisse aus Bayern, aus Deutschland und aus aller Welt.',NULL,'DEU','Rundschau-Magazin','https://json.schedulesdirect.org/20141201/image/assets/p11012728_b_h6_aa.jpg',4,NULL),('SH018573670000','Ein Team von forensischen Spezialisten der Polizei in Las Vegas untersucht Tatorte und arbeitet daran, grausame Verbrechen in der Stadt der Sünden aufzulösen.',NULL,'DEU','CSI: Vegas','https://s3.amazonaws.com/schedulesdirect/assets/p184657_st_h11_aa.jpg',4,NULL),('SH019631260000','Die Zusammenfassung von Magazinbeiträgen aus der Servicezeit oder kürzere exklusive Reportagen.',NULL,'DEU','Erlebnisreisen-Tipp','https://json.schedulesdirect.org/20141201/image/assets/p10934140_b_h11_aa.jpg',4,NULL),('SH020143070000','ZIB 2 - das ist das tägliche Nachrichten-Magazin des ORF-Fernsehens. Die Sendung setzt Schwerpunkte und liefert Hintergründe.',NULL,'DEU','ZIB 2','https://json.schedulesdirect.org/20141201/image/assets/p11119175_i_h11_aa.jpg',4,NULL),('SH017098660000','Um Rechtslagen darzustellen, wird in jeder Folge ein Streitfall vorgestellt, der durch einen Rechtsanwalt kommentiert wird. Die vorgeblichen Alltagssituationen werden von Laiendarstellern nach einem genauen Drehbuch gespielt.',NULL,'DEU','Verklag mich doch!','https://s3.amazonaws.com/schedulesdirect/assets/p9835738_st_h11_aa.jpg',4,NULL),('SH019902960000','Opern- und Konzertmitschnitte, Musiker-Porträts, Musik der Gegenwart oder Jazzproduktionen.',NULL,'DEU','BR-Klassik','https://json.schedulesdirect.org/20141201/image/assets/p10903949_i_h11_aa.jpg',4,NULL),('SH026502260000','Das Magazin geht der Frage nach, wie sich ein Leben mit Behinderung gestaltet.',NULL,'DEU','selbstbestimmt! Das Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p13961943_st_h11_aa.jpg',4,NULL),('SH019970370000','Es war eines der gigantischsten Bauvorhaben der Menschheitsgeschichte. Überall im Dritten Reich und in den von Deutschland besetzten Gebieten wurden 1944 ganze Fabrikanlagen in unterirdische Stollensysteme verlegt, um sie dem Bombenhagel der Alliierten zu entziehen.',NULL,'DEU','Das unterirdische Reich - Die geheimen Welten der Nazis','https://json.schedulesdirect.org/20141201/image/assets/p11065758_i_h6_aa.jpg',4,NULL),('SH019585250000','Nordrhein-westfälische Tierschutzvereine stellen ausgesetzte oder in Tierheimen abgegebene Tiere vor, um sie an tierliebe Zuschauer zu vermitteln. Im Mittelpunkt stehen Hunde und Katzen, aber auch Vögel, Kleintiere, Pferde und Hausschweine.',NULL,'DEU','Tiere suchen ein Zuhause','https://json.schedulesdirect.org/20141201/image/assets/p10914062_b_h11_aa.jpg',4,NULL),('SH029228150000','Die ehemaligen Hauptdarsteller der Originalserie verbringen gemeinsam ihren Urlaub.',NULL,'DEU','Jersey Shore: Family Vacation','https://json.schedulesdirect.org/20141201/image/assets/p15207885_b_h11_aa.jpg',4,NULL),('SH020868640000','Drei Mediziner wollen allein mit gezielten Ernährungsstrategien Symptome deutlich verbessern und Krankheiten sogar heilen. Die Reihe zeigt, wie mit speziellem Essen schon innerhalb weniger Monate oft mehr erreicht werden kann als mit Tabletten.',NULL,'DEU','Die Ernährungs-Docs','https://json.schedulesdirect.org/20141201/image/assets/p11358042_b_h6_aa.jpg',4,NULL),('SH023220780000','Das Kinomagazin präsentiert kurz und kompakt die aktuellsten Kinofilme aus aller Welt. Dazu gibt es zu jedem Film wissenswerte Hintergrundinformationen und Einblicke.',NULL,'DEU','Watch Me - das Kinomagazin','https://json.schedulesdirect.org/20141201/image/assets/p12396287_b_h11_ab.jpg',4,NULL),('SH030542350000','Übertragungen von aktuellen Partien der deutschen Basketball-Bundesliga.',NULL,'DEU','BBL','https://json.schedulesdirect.org/20141201/image/assets/p13324137_i_h6_aa.jpg',4,NULL),('SH026290490000','Dana Newman präsentiert verschiedene Themen, um vorhandene Englischkenntnisse aufzufrischen. In kleinen Häppchen werden Grammatikregeln wiederholt oder Unterhaltungsthemen wie englischsprachige Musik präsentiert, um den Wortschatz zu erweitern.',NULL,'DEU','English bite-size','https://json.schedulesdirect.org/20141201/image/assets/p13854651_st_h11_aa.jpg',4,NULL),('SH019560930000','Die siebenköpfige, hochspezialisierte FBI-Eliteeinheit aus erfahrenen Psychologen und Special Agents erstellt Serientäterprofile, um damit Gewaltverbrechern zuvorzukommen. Jeder der Ermittler trägt mit seinem Spezialwissen zur Analyse und Aufklärung der Verbrechen bei und gemeinsam riskieren sie Kopf und Kragen, denn Criminal Minds ist wie ein Spiel gegen einen unberechenbaren Gegner: Jeder Zug ist ungewiss und kann ein schnelles Schachmatt bedeuten.',NULL,'DEU','Criminal Minds','https://s3.amazonaws.com/schedulesdirect/assets/p185123_l_h6_aa.jpg',4,NULL),('SH020154370000','Mit Dieter Nuhr hat einer der profiliertesten deutschen Kabarettisten die Satiresendung übernommen und begrüßt in jeder Episoden bekannte Comedians und Unterhalter.',NULL,'DEU','Nuhr im Ersten','https://s3.amazonaws.com/schedulesdirect/assets/p9428555_i_v4_aa.jpg',4,NULL),('SH026752150000','Die Sendung informiert über Bauernhöfe und die Menschen, die sie bewirtschaften. Es wird gezeigt, welche Ziele die Bauern verfolgen, wie sie in einer globalisierten Welt konkurrenzfähig bleiben und was sie in ihrem Alltag bewegt.',NULL,'DEU','Land - Liebe - Luft','https://json.schedulesdirect.org/20141201/image/assets/p14062273_st_h11_aa.jpg',4,NULL),('SH018580010000','Chris und Martin Kratt sind Brüder. Der Biologe und der Zoologe widmen ihre Zeit und ihr Leben dem Tierschutz und sind immer zur Stelle, wenn Tiere in Not geraten. Und so reisen sie um die ganze Welt, erleben ein spannendes Abenteuer nach dem anderen und lernen die exotischsten Tiere kennen.',NULL,'DEU','Go Wild! - Mission Wildnis','https://s3.amazonaws.com/schedulesdirect/assets/p8369911_i_v4_aa.jpg',4,NULL),('SH016398250000','In der Sendung müssen zwei Teams aus vorgegebenen Zutaten ein komplettes Menü zaubern. In mehreren Quizrunden können sie sich weitere Zutaten erspielen, mit denen sich vielleicht der kleine, aber feine Unterschied erkochen lässt.',NULL,'DEU','Topfgeldjäger','https://json.schedulesdirect.org/20141201/image/assets/p9563656_b_h6_aa.jpg',4,NULL),('SH023266820000','Jeweils zwei Kandidatenpaare treten gegeneinander und gegen ein Expertenteam aus dem Sendegebiet an. In drei Runden mit verschiedenen Spielformen müssen die Kandidaten unter anderem Fragen über Baden-Württemberg und Rheinland-Pfalz beantworten.',NULL,'DEU','Die Quiz-Helden - Wer kennt den Südwesten','https://json.schedulesdirect.org/20141201/image/assets/p12416357_i_h11_aa.jpg',4,NULL),('SH020260030000','Die Dokumentation hinterfragt, ob außerirdische Zivilisationen nach einem Planeten wie der Erde suchen und was passieren würde, wenn sie die Erde entdecken. Szenarien, wie Besuche von Aliens aussehen könnten, werden durchgespielt.',NULL,'DEU','Aliens: Besuch aus dem All','https://json.schedulesdirect.org/20141201/image/assets/p8615909_i_h11_aa.jpg',4,NULL),('SH003165340000','Das Magazin befasst sich vor allem mit den Themen Wirtschaft, Politik, Finanzen und Verbraucherschutz, erklärt neue Gesetze und aktuelle Wirtschaftsereignisse und deckt auf, wann und wo der Normalbürger ausgetrickst oder betrogen wurde.',NULL,'DEU','WISO','https://json.schedulesdirect.org/20141201/image/assets/p526802_b_h6_ab.jpg',4,NULL),('SH018438310000','Das Wissensmagazin mit Anja Reschke, das zukunftsweisende Technologien und Erfindungen erkundet.',NULL,'DEU','Wissen vor acht - Zukunft','https://json.schedulesdirect.org/20141201/image/assets/p10415635_b_h11_ab.jpg',4,NULL),('SH022432270000','Mit Odysso kann die Wissenschaftsredaktion des SWR aktueller auf das Zeitgeschehen eingehen. Das Wissensmagazin gibt die Antworten, zu denen die Zuschauer Fragen haben.',NULL,'DEU','Frag Odysso mit Axel Wagner','https://s3.amazonaws.com/schedulesdirect/assets/p9987880_i_h11_aa.jpg',4,NULL),('SH034254140000','Der Moderator lädt drei Hobbyköche zum Improvisations-Kochduell ein. In 25 Minuten müssen sie ein vorgegebenes Gericht zubereiten, wobei Steffen Henssler einige Gemeinheiten in der Hinterhand hat, um den Kandidaten das Leben schwer zu machen.',NULL,'DEU','Hensslers Countdown - Kochen am Limit','https://s3.amazonaws.com/schedulesdirect/assets/p17860617_st_h11_aa.jpg',4,NULL),('SH031480140000',NULL,NULL,'DEU','Unsere Fasnacht-Stars','https://json.schedulesdirect.org/20141201/image/assets/p16497462_b_s3_aa.jpg',4,NULL),('SH020644780000','Der kleine Hase springt, immer zum Spielen, Entdecken und Lachen aufgelegt, über seine Wiese und durchs Leben. Liebevoll unterstützt wird er von seinem Vater, dem großen Hasen.',NULL,'DEU','Weißt du eigentlich wie lieb ich dich hab?','https://json.schedulesdirect.org/20141201/image/assets/p8793955_i_h11_aa.jpg',4,NULL),('SH029547070000','Die Sendung zeigt die aktuellsten Neuigkeiten aus dem Alltag aus allen Regionen Deutschlands mit spannenden Geschichten. Meteorologen vertiefen sachkundig die Wetterlage und Windbewegungen bis hin zum Bio- und Pflanzwetter.',NULL,'DEU','Live nach Neun','https://s3.amazonaws.com/schedulesdirect/assets/p15445469_st_h11_aa.jpg',4,NULL),('SH019162480000','Die TV-Adaption der populären Smartphone-App, moderiert von Jörg Pilawa. Pro Ausgabe spielen vier Kandidaten im Studio gegen die Online-Nutzer, die als Team Deutschland antreten. Die Zuschauer werden aktive Gegner der Studio-Kandidaten.',NULL,'DEU','Quizduell','https://json.schedulesdirect.org/20141201/image/assets/p10752040_b_h11_aa.jpg',4,NULL),('SH021322180000','Die Frankenschau zeigt regelmäßig verschiedene Ausschnitte aus dem Lande. Es werden Hintergrundinformationen zu verschiedenen Themen gezeigt.',NULL,'DEU','Frankenschau','https://json.schedulesdirect.org/20141201/image/assets/p11532937_b_h6_aa.jpg',4,NULL),('SH034270310000',NULL,NULL,'DEU','Rituale der Welt','https://json.schedulesdirect.org/20141201/image/assets/p17869364_st_h11_aa.jpg',4,NULL),('SH019560690000','Anwälte befassen sich in authentisch nachgestellten Rechtsfällen mit Streitigkeiten aller Art und klären verschiedene Fälle auf. Die Juristen sind spezialisiert in Fällen wie unter anderem Baupfusch, Mobbing oder Scheidung.',NULL,'DEU','Anwälte im Einsatz','https://json.schedulesdirect.org/20141201/image/assets/p10904313_b_h6_aa.jpg',4,NULL),('SH019469500000','Touristische Attraktionen und traditionelle Bräuche aus Sachsen-Anhalt werden vorgestellt.',NULL,'DEU','Unterwegs in Sachsen-Anhalt','https://json.schedulesdirect.org/20141201/image/assets/p10872299_i_h11_aa.jpg',4,NULL),('SH023575020000','Der junge Monkey D. Ruffy stellt eine Mannschaft zusammen, um nach dem legendären Schatz One Piece zu suchen, den der Piratenkönig Gold Roger einst versteckte. Doch auch zahlreiche andere Mannschaften begeben sich auf die Suche.',NULL,'DEU','One Piece','https://json.schedulesdirect.org/20141201/image/assets/p12177253_i_h11_aa.jpg',4,NULL),('SH019466750000','Der schnelle Überblick über die wichtigsten Ereignisse in Sachsen, Sachsen-Anhalt und Thüringen.',NULL,'DEU','Länder kompakt','https://json.schedulesdirect.org/20141201/image/assets/p10871127_b_h11_ab.jpg',4,NULL),('SH029111220000','Die musikalischen Trolle Branch und Poppy erleben weitere spannende Abenteuer mit ihren Freunden.',NULL,'DEU','Trolls - Die Party geht weiter!','https://json.schedulesdirect.org/20141201/image/assets/p14940594_i_h11_aa.jpg',4,NULL),('SH020060470000','Die Sendung bietet ein Forum für die aktuelle politische Debatte in Deutschland. Regelmäßig diskutieren kompetente Gäste Fragen zum politischen, wirtschaftlichen und sozialen Leben in Deutschland und Ereignisse aus dem Ausland.',NULL,'DEU','phoenix Runde','https://json.schedulesdirect.org/20141201/image/assets/p11091787_b_h11_aa.jpg',4,NULL),('SH033836890000','Die Serie dokumentiert das Leben und Treiben an unterschiedlichen Plätzen Europas. Die gezeigten Orte sind allesamt Wahrzeichen ihres Landes und reich an Geschichte. Sie sind sowohl für den Tourismus, als auch für die einheimische Wirtschaft wichtig.',NULL,'DEU','Meine Story','https://json.schedulesdirect.org/20141201/image/assets/p17691197_st_h11_aa.jpg',4,NULL),('SH018956040000','Das Münchener Trio Ludwig Schaller, Harald Neuhauser und Angelika Flierl genießt bei den Polizeikollegen nicht den besten Ruf: Dass sie trotzdem erfolgreich sind, hat mit ihren unorthodoxen Ermittlungsmethoden zu tun.',NULL,'DEU','München Mord','https://json.schedulesdirect.org/20141201/image/assets/p10650301_b_h11_aa.jpg',4,NULL),('SH020014790000','Das Magazin beschäftigt sich Themen rund um das Automobil und zeigt in verschiedenen Beiträgen, was Automobilisten bewegt. Dabei werden sowohl aktuelle Entwicklungen als Höhepunkte der Geschichte des Automobils betrachtet.',NULL,'DEU','WELT Drive','https://json.schedulesdirect.org/20141201/image/assets/p11076876_st_h11_aa.jpg',4,NULL),('SH025939220000','Der immer fröhliche Jett ist das beste und schnellste Düsenflugzeug der Welt. Jeden Tag liefert Jett Kindern in aller Welt Pakete aus. Gemeinsam mit seinen Freunden hilft er den Kindern, besondere Herausforderungen zu meistern.',NULL,'DEU','Super Wings','https://s3.amazonaws.com/schedulesdirect/assets/p11545356_l_h6_aa.jpg',4,NULL),('SH020248280000','Eitel, verächtlich oder hemmungslos anbiedernd tritt das Fernsehen heute gerne auf ein Medium im Vollgefühl seines Größenwahns. Umso lieber sieht man dem Münchner Dokumentarfilmer Franz Xaver Gernstl mit seiner Sendereihe `Gernstl unterwegs\' zu.',NULL,'DEU','Gernstl unterwegs','https://json.schedulesdirect.org/20141201/image/assets/p11155287_b_h11_aa.jpg',4,NULL),('SH019374000000','Deutsches Boulevardmagazin mit den aktuellen Ereignissen des Tages, Klatsch und Tratsch aus der Welt der Stars und Sternchen, Kino-News und Internetneuheiten sowie Expertentalks.',NULL,'DEU','taff','https://json.schedulesdirect.org/20141201/image/assets/p10838079_i_h11_ab.jpg',4,NULL),('SH031401200000','Die Dokumentation wirft einen Blick auf die täglichen Aktivitäten engagierter Feuerwehrleute. Sie kämpfen vor allem gegen die unberechenbare Feinde: das Buschfeuer, das in Australien in den heißen Sommermonaten auftaucht.',NULL,'DEU','Outback Inferno - Feueralarm in Australien','https://json.schedulesdirect.org/20141201/image/assets/p16331785_i_h11_aa.jpg',4,NULL),('SH019692430000','Nachdem er mit seinem Raumschiff eine Bruchlandung durchs Garagendach hingelegt hat, nimmt Familie Tanner den Außerirdischen ALF bei sich zu Hause auf. Fortan gilt es, das Witze erzählende und Chaos stiftende Zottelvieh vor den Nachbarn und dem Militär zu verstecken und die Hauskatze vor seinem ungewöhnlichen Appetit zu beschützen. Allerdings wünscht sich der liebenswert-durchgeknallte ALF doch immer wieder ein Wiedersehen mit den anderen Überlebenden seines explodierten Heimatplaneten.',NULL,'DEU','ALF','https://s3.amazonaws.com/schedulesdirect/assets/p183925_b_v7_aa.jpg',4,NULL),('SH033014330000','Die Ärzte und Sanitäter der Yorkshire Air Ambulance bergen Menschen unter extremen Bedingungen aus dramatischen Notlagen. Dann versorgen die Rettungskräfte sie noch während des Helikopterflugs auf dem Weg zum Krankenhaus.',NULL,'DEU','Helicopter ER - Rettung im Anflug','https://json.schedulesdirect.org/20141201/image/assets/p14472305_i_h6_aa.jpg',4,NULL),('SH019379550000','Als Fry aufwacht, findet er sich im tausend Jahre älteren New York wieder. Er wurde versehentlich eingefroren und muss sich mit der neuen Situation zurechtfinden. Doch schon bald findet er eine chaotische Truppe, die ihm versucht zu helfen.',NULL,'DEU','Futurama','https://s3.amazonaws.com/schedulesdirect/assets/p184499_b_v4_aa.jpg',4,NULL),('SH021543380000','Durch Zufall wird Astronaut Tony Nelson Meister eines Flaschengeistes, der ihm in Gestalt der attraktiven Blondine Jeannie jeden Wunsch erfüllt. Da Jeannie aber etwas ungeschickt zu Werke geht, muss Nelson manch verunglückten Wunsch wieder hinbiegen.',NULL,'DEU','Bezaubernde Jeannie','ht