erden hier portraitiert.',NULL,'DEU','Mega Brands','https://json.schedulesdirect.org/20141201/image/assets/p10972450_st_h11_aa.jpg',4,NULL),('SH016937100000','Die Sendung rückt Bayerns junge Musikszene ins Rampenlicht. Drei ausgewählte Bands treffen ihre Idole, treten auf großen Bühnen auf und produzieren ihr eigenes Musikvideo.',NULL,'DEU','Startrampe','https://json.schedulesdirect.org/20141201/image/assets/p9764820_b_h11_aa.jpg',4,NULL),('SH031032640000','Die Dokumentationsreihe zeigt unter anderem, was Politiker mit ihrer Körpersprache bezwecken wollen. Eine wirkungsvolle Körpersprache ist gerade im Zeitalter digitaler Mediennetzwerke ein entscheidender Erfolgsfaktor in der Politik.',NULL,'DEU','Die Gesten der Mächtigen','https://json.schedulesdirect.org/20141201/image/assets/p16277707_st_h11_aa.jpg',4,NULL),('SH019055640000','Marco Polo reist mit seinen Freunden nach China, um seinen Vater zu retten.',NULL,'DEU','Die Abenteuer des jungen Marco Polo','https://s3.amazonaws.com/schedulesdirect/assets/p10699279_i_h11_aa.jpg',4,NULL),('SH031906530000','Silvia und ihr Bruder nahmen als Team `Noobees\' an professionellen Gaming-Wettkämpfen teil.',NULL,'DEU','NOOBees','https://json.schedulesdirect.org/20141201/image/assets/p15932042_b_h11_aa.jpg',4,NULL),('SH033424480000',NULL,NULL,'DEU','Esme & Roy','https://json.schedulesdirect.org/20141201/image/assets/p15679969_b_h6_ad.jpg',4,NULL),('SH026323010000','Zusammen mit ihrer 15-jährigen Tochter kehrt die Anwältin Jane Kennedy nach Jahren der Abwesenheit in ihre an der See gelegene Heimatstadt Lighthaven zurück. Dort arbeitet sie als Untersuchungsbeamtin bei mysteriösen Todesfällen.',NULL,'DEU','The Coroner','https://json.schedulesdirect.org/20141201/image/assets/p12299299_i_h11_aa.jpg',4,NULL),('SH022595580000','Einer der größten Flüsse unseres Planeten ist immer noch geheimnisvoll. Auf seiner Strecke trennt der Amur Russland von China und verbindet völlig verschiedene Welten: das größte Grasland der Erde, ihre größten Ur