H031851030000','Bei dem Festival spielen einige der aktuell bekanntesten Bands in den Orchesterstudios in München. Um ein eigenständiges Line-up präsentieren zu können, hat die Musikredaktion bei Showcase-Festivals, in Clubs und Blogs gesucht.',NULL,'DEU','PULS Festival 2018','https://s3.amazonaws.com/schedulesdirect/assets/p16702785_st_h11_ae.jpg',4,NULL),('SH022518890000','Die Dokumentationsreihe zeigt Berichte über die Natur- und Kultursehenswürdigkeiten Hessens.',NULL,'DEU','Erlebnis Hessen','https://s3.amazonaws.com/schedulesdirect/assets/p12057821_i_v7_aa.jpg',4,NULL),('SH023720810000','Der Sprössling von Simba und Nala, Kion, übernimmt das Kommando der `Löwengarde\'. Die Gruppe besteht aus klugen und mutigen Tieren der Steppe, die das Königreich beschützen sollen. Kion verstößt gegen die Tradition, weil er keine Löwen aufnimmt.',NULL,'DEU','Die Garde der Löwen','https://json.schedulesdirect.org/20141201/image/assets/p12371444_i_h6_aa.jpg',4,NULL),('SH019577880000','Die Sendung informiert über das politische und kulturelle Leben in Hamburg und liefert Hintergrundinformationen zu besonderen Ereignissen. Auch der Sport in Hamburg sowie Heimatgeschichten aus dem Land sind Themen der Sendung.',NULL,'DEU','Hamburg Journal','https://json.schedulesdirect.org/20141201/image/assets/p10910696_i_h11_aa.jpg',4,NULL),('SH019897220000','Vier Freunde, ein Ziel: Sie wollen ihren eigenen Style finden und wagen ein spannendes Experiment.',NULL,'DEU','Du bist STYLE!','https://json.schedulesdirect.org/20141201/image/assets/p11040055_b_h11_aa.jpg',4,NULL),('SH021397950000','Hund Gustav und seine Freunde wohnen in einem idyllischen Blaubeerwald. Dort erleben sie gemeinsam spannende Abenteuer.',NULL,'DEU','Gustavs Welt',NULL,4,NULL),('SH033227900000','Ein Single und fünf Menü-Vorschläge, hinter denen sich Blind Dates verbergen.',NULL,'DEU','Dinner Date','https://json.schedulesdirect.org/20141201/image/assets/p17408304_b_v4_aa.jpg',4,NULL),('SH019369690000','Der erfolgreiche Werbejingle-Komponist Charlie Harper genießt sein Junggesellen-Leben in seinem Haus am Strand von Malibu. Doch dann zieht sein Bruder, der schüchterne, frisch geschiedene Chiropraktiker Alan gemeinsam mit seinem Sohn Jake bei ihm ein. Den beiden gegensätzlichen Brüdern fällt das Zusammenleben nicht immer leicht, doch irgendwie müssen sie sich arrangieren. Als Charlie plötzlich stirbt, kauft der etwas weltfremde Internet-Milliardär Walden Schmidt das Strandhaus und zieht bei Alan und Jake ein. Nun ist es Alan, der seinem neuen, unerfahrenen Mitbewohner in allen Lebenslagen mit Rat und Tat zur Seite steht.',NULL,'DEU','Two and a Half Men','https://s3.amazonaws.com/schedulesdirect/assets/p8218909_b_v4_aa.jpg',4,NULL),('SH019578700000','Alle zwei Wochen werden interessante Gäste zur Talkrunde aus Hamburg eingeladen.',NULL,'DEU','NDR Talk Show','https://json.schedulesdirect.org/20141201/image/assets/p10911024_i_h11_aa.jpg',4,NULL),('SH032900030000','Vier Sportarten, sechs Ligen, ein Magazin: In dem wöchentlichen Format Magenta Sport: Arena berichtet SPORT1 über die Highlights aus Fußball-Bundesliga, UEFA Champions League, 3. Liga, FLYERALARM Frauen-Bundesliga, Deutscher Eishockey Liga, easyCredit Basketball-Bundesliga und der eSports-Szene. Neben Spielberichten bietet das einstündige Magazin in dieser Saison auch aktuelle News, Analysen und Vorberichte zu den einzelnen Ligen und Wettbewerben.',NULL,'DEU','Magenta Sport: Arena',NULL,4,NULL),('SH018442680000','Die am längsten laufende Krimiserie Deutschlands mit verschiedenen Ermittlerteams, die in unterschiedlichen deutschsprachigen Regionen tätig sind.',NULL,'DEU','Tatort','https://json.schedulesdirect.org/20141201/image/assets/p10416816_b_h6_aa.jpg',4,NULL),('SH019426980000','Spannende Kriminalfälle werden erneut beleuchtet, um die Methoden der Aufklärung zu zeigen. Mithilfe von moderner Technik und erfahrenem Personal in der Gerichtsmedizin können selbst die schwierigsten Fälle geknackt werden.',NULL,'DEU','Autopsie - Mysteriöse Todesfälle','https://json.schedulesdirect.org/20141201/image/assets/p10856625_b_h11_aa.jpg',4,NULL),('SH006921640000','Der Antiquar Georg Wilsberg ist permanent knapp bei Kasse. Oft muss er seine Freunde finanziell um Hilfe bitten. Um noch etwas dazuzuverdienen, nimmt er Aufträge als Privatdetektiv an. Bald spannt er auch seine Freunde in die Ermittlungen ein.',NULL,'DEU','Wilsberg','https://json.schedulesdirect.org/20141201/image/assets/p530512_b_h6_aa.jpg',4,NULL),('SH019871220000','Mit Ironie und Absurdität skizziert jede Folge einen Zeitgeist, der Schlagzeilen macht.',NULL,'DEU','(Fast) Die ganze Wahrheit',NULL,4,NULL),('SH021901730000','Die Sendung bringt Fakten, Tipps, Gesichter und Geschichten zu aktuellen Themen.',NULL,'DEU','alpha-Campus TALKS','https://json.schedulesdirect.org/20141201/image/assets/p11801984_b_h11_aa.jpg',4,NULL),('SH019403980000','Das Kulturmagazin berichtet über das künstlerische Leben in Europa.',NULL,'DEU','Metropolis','https://json.schedulesdirect.org/20141201/image/assets/p10850162_b_h6_aa.jpg',4,NULL),('SH019568280000','Der Auto-Experte Mike Brewer und der Designer Ant Anstead wollen die Gebrauchtwagenwelt neu ordnen. Mike geht mit einem zuvor festgesetzten Budget auf die Suche nach Angeboten; Ant richtet dann die so gefundenen `Schnäppchen\' für den profitablen Wiederverkauf her. Denn für die beiden gibt es nichts Schöneres, als aus scheinbar minderwertigen Kisten ordentlich Profit zu schlagen.',NULL,'DEU','Die Gebrauchtwagen-Profis - Neuer Glanz für alte Kisten','https://json.schedulesdirect.org/20141201/image/assets/p529146_i_h11_ab.jpg',4,NULL),('SH018558720000','Das Magazin berichtet von aktuellen Ereignissen in der Welt der Prominenten.',NULL,'DEU','Exclusiv - Das Starmagazin','https://s3.amazonaws.com/schedulesdirect/assets/p10458817_b_h6_aa.jpg',4,NULL),('SH019656280000','Kriminal-Experten untersuchen, warum einige Pärchen gemeinsame Mordeslust entwickeln. Sie möchten darauf eingehen, welchen Ursprung die Mordgedanken haben und wie die Ausführung verläuft. Anhand tatsächlicher Fälle wird dies gezeigt.',NULL,'DEU','Killer-Paare - Tödliches Verlangen','https://json.schedulesdirect.org/20141201/image/assets/p314337_i_h11_aa.jpg',4,NULL),('SH019971100000','Zwei völlig unterschiedliche Brüder - der Naturbursche Robbie und der `City Slicker\' Stephen - führen gemeinsam eine Reptilien-Farm in den Everglades in Florida. Stephen wäre lieber in New York geblieben, Robbie fühlt sich auf der Familienfarm wohl.',NULL,'DEU','Swamp Brothers - Zwei Brüder aus\'m Sumpf','https://s3.amazonaws.com/schedulesdirect/assets/p8609859_i_v4_aa.jpg',4,NULL),('SH034303190000',NULL,NULL,'DEU','Big Brother - Die Late Night Show','https://json.schedulesdirect.org/20141201/image/assets/p17887619_st_h11_aa.jpg',4,NULL),('SH019370140000','Dr. Leonard Leakey Hofstadter und Dr. Sheldon Cooper sind geniale Physiker, arbeiten im selben Institut und teilen sich eine Wohnung. Im Umgang mit der sozialen Umwelt hingegen hat vor allem Sheldon seine Schwierigkeiten. Zu ihrem Freundeskreis gehören Dr. Rajesh Ramayan Koothrappali und der Ingenieur Howard Wolowitz. Als die hübsche Penny in die Wohnung nebenan einzieht, kann sie zunächst nicht viel mit den merkwürdigen Wissenschaftlern, die ihre Freizeit am liebsten im Comicbuchladen und Halo oder World of Warcraft spielend verbringen, anfangen. Nach einer Weile wächst ihr die Gruppe aber ans Herz.',NULL,'DEU','The Big Bang Theory','https://s3.amazonaws.com/schedulesdirect/assets/p185554_l_h6_aa.jpg',4,NULL),('SH030360600000','Die Dokumentationsreihe bietet Einblicke in ungewöhnliche Lebenswege.',NULL,'DEU','Lebenslinien Nostalgie','https://json.schedulesdirect.org/20141201/image/assets/p7988590_i_h11_aa.jpg',4,NULL),('SH031939960000','Im Rampenlicht zu stehen hat nicht nur glamouröse Seiten: Da sich das eigene Leben in der Öffentlichkeit abspielt, stehen die Chancen hoch, einem Stalker zum Opfer zu fallen. Die Sendung zeigt solche Fälle und geht auf die Geschichte der Täter ein.',NULL,'DEU','The Stalker Files - Der Schatten des Erfolgs','https://json.schedulesdirect.org/20141201/image/assets/p14916815_i_s3_aa.jpg',4,NULL),('SH019734540000','Der Millionär Jonathan Hart und seine Frau Jennifer, eine abenteuerlustige Journalistin, reisen um die Welt und werden immer wieder unfreiwillig in Kriminalfälle verwickelt. Gemeinsam machen sie es sich zur Aufgabe, diese zu lösen.',NULL,'DEU','Hart aber herzlich','https://s3.amazonaws.com/schedulesdirect/assets/p184377_i_v7_aa.jpg',4,NULL),('SH016889010000','Die Sendung `ZDFzeit\' zeigt Dokumentationen mit einem breiten Spektrum an zeitgeschichtlichen sowie historischen, wirtschaftlichen und politischen Themen.',NULL,'DEU','ZDFzeit','https://json.schedulesdirect.org/20141201/image/assets/p9745829_b_h6_aa.jpg',4,NULL),('SH020614500000','Highlights und Zusammenfassungen vom Fechten.',NULL,'DEU','Fechten','https://json.schedulesdirect.org/20141201/image/assets/p8366432_b_h11_ab.jpg',4,NULL),('SH029647210000','Die Bundesautobahn 2 zählt zu wichtigsten Verkehrsadern Deutschlands. Die Route verbindet große Industriestandorte im Ruhrgebiet und den Beneluxstaaten mit Osteuropa. Gezeigt werden Menschen, die in der Nähe leben und arbeiten.',NULL,'DEU','A2 - Abenteuer Autobahn','https://json.schedulesdirect.org/20141201/image/assets/p15494227_b_h6_aa.jpg',4,NULL),('SH025872060000','Kommissarin Nele Fehrenbach ist aus Hamburg in ihre alte Heimat am Bodensee gezogen, um dort die Leitung der Wasserschutzpolizei zu übernehmen. Während ihrer Ermittlungen ist sie den Eifersüchteleien ihres Kollegen Andreas Rambach ausgesetzt.',NULL,'DEU','WaPo Bodensee','https://json.schedulesdirect.org/20141201/image/assets/p13636154_i_h11_aa.jpg',4,NULL),('SH031545990000','Zehn Kindergartenkinder verbringen über sechs Wochen Zeit mit zehn Senioren aus einem Altenheim. Dabei spielen sie gemeinsam Spiele und unterhalten sich miteinander. Dies soll den älteren Generationen helfen, gesund zu bleiben.',NULL,'DEU','Wir sind klein und ihr seid alt','https://s3.amazonaws.com/schedulesdirect/assets/p16532622_st_h11_ac.jpg',4,NULL),('SH016456600000','Die Sendereihe berichtet aus außergewöhnlicher Perspektive über für unsere Gesellschaft typische Lebenssituationen: Die Kamera begleitet eine Gruppe oder einzelne Menschen in meist besonders exponierter sozialer Situation.',NULL,'DEU','37 °','https://json.schedulesdirect.org/20141201/image/assets/p9586293_b_h11_ab.jpg',4,NULL),('SH020494920000','Die Sendung steht für regionale und überregionale Information - kompakt. Ein Themenmix aus internationaler Politik bis hin zu den Ereignissen des Tages in der Region. Vielschichtig, modern, aber nicht zeitgeistig, so präsentiert sich aktuell.',NULL,'DEU','aktuell','https://json.schedulesdirect.org/20141201/image/assets/p11245317_b_h6_aa.jpg',4,NULL),('SH033811390000','Sarah Lombardi zählt heute zu den erfolgreichsten Medienstars im deutschen Fernsehen. In diesem exklusivem Interview erzählt sie über ihre Kindheit, den Beginn ihrer Karriere, die Teilnahme bei DSDS sowie das Leben nach dem Finale.',NULL,'DEU','Absolut Sarah Lombardi','https://s3.amazonaws.com/schedulesdirect/assets/p17682111_st_h11_aa.jpg',4,NULL),('SH020128250000','Mike Baxter ist der Marketing-Chef einer bekannten Sportartikelfirma und ist geschäftlich viel und gern auf Reisen. Anders als in seinem beruflichem Umfeld, wo er als echter Kerl gilt, ist die Situation für den männlichen Mike allerdings zu Hause. Dort haben nämlich vier Frauen das Sagen.',NULL,'DEU','Last Man Standing','https://s3.amazonaws.com/schedulesdirect/assets/p8679132_l_h6_ab.jpg',4,NULL),('SH019403270000','Die Nachrichtensendung ist speziell für Acht- bis Zwölfjährige ausgelegt, und berichtet über relevante Themen aus Europa und der ganzen Welt. In jeder Sendung stellen deutsche oder französische Schüler Fragen zu einem aktuellen Thema.',NULL,'DEU','Arte Journal Junior','https://json.schedulesdirect.org/20141201/image/assets/p10850057_b_h6_aa.jpg',4,NULL),('SH020305440000','Der Lehrgang Mathematik im Telekolleg umfasst drei Trimester à 13 Lehrsendungen. Im Internet bieten wir zu jeder Folge eine Zusammenfassung der Lerninhalte.',NULL,'DEU','TELEKOLLEG Mathematik',NULL,4,NULL),('SH023160580000','Die Dokumentation beleuchtet den Hundertjährigen Krieg zwischen Großbritannien und Frankreich. Dabei werden geschichtliche Fakten ausgewertet und Situationen nachgestellt.',NULL,'DEU','Der Hundertjährige Krieg','https://json.schedulesdirect.org/20141201/image/assets/p9744574_st_h11_ab.jpg',4,NULL),('SH019978590000','Das Sportmagazin setzt sich mit aktuellen Sportereignissen aus der Region auseinander.',NULL,'DEU','heimspiel!','https://json.schedulesdirect.org/20141201/image/assets/p11067784_b_h11_aa.jpg',4,NULL),('SH023568700000','Man sagt, Menschen aus dem Ruhrgebiet tragen das `Herz auf der Zunge\'. Die Sozialdokumentation begleitet vier Monate lang den teilweise beklemmenden Alltag von Menschen aus dem Ruhrgebiet, die aber immer das Herz am richtigen Fleck tragen.',NULL,'DEU','Hartz und herzlich','https://s3.amazonaws.com/schedulesdirect/assets/p12553832_st_h11_aa.jpg',4,NULL),('SH018450610000','Magazin mit Themen zu der heimischen Tier- und Pflanzenwelt. Mit Musiker Thomas D.',NULL,'DEU','Wissen vor acht - Natur','https://json.schedulesdirect.org/20141201/image/assets/p10420085_i_h6_aa.jpg',4,NULL),('SH018580150000','Timmy Turner lebt mit seinen Eltern zusammen und hat es nicht immer leicht mir ihnen. Darum wurden ihm die Elfen Cosmo und Wanda zur Seite gestellt, denn jedes Kind, das es besonders schwer hat, bekommt solche helfenden Elfen, von denen es sich jederzeit etwas wünschen kann. Doch die Wünsche gehen meistens nach Hinten los und verursachen große Schäden.',NULL,'DEU','Cosmo & Wanda - Wenn Elfen helfen','https://s3.amazonaws.com/schedulesdirect/assets/p186130_i_v7_aa.jpg',4,NULL),('SH019690030000','Gemeinsam mit dem Fuchs bereist der kleine Prinz in der Serie insgesamt 24 Planeten. Auf dem Weg in ferne Galaxien folgt er der hinterlistigen Schlange, die überall Unheil sät. Der Prinz hilft den Bewohnern, die Gefahren abzuwenden.',NULL,'DEU','Der kleine Prinz','https://json.schedulesdirect.org/20141201/image/assets/p9036350_i_h6_aa.jpg',4,NULL),('SH019383520000','Fünf Kandidatinnen treten an, um die Frau mit dem besten Stil zu werden. Am Anfang der jeweiligen Woche werden die Aufgabe und das Budget bekanntgegeben. Jede der Teilnehmerinnen hat vier Stunden Zeit. Dieses Mal ist Svetlana an der Reihe.',NULL,'DEU','Shopping Queen','https://s3.amazonaws.com/schedulesdirect/assets/p10842180_st_h11_aa.jpg',4,NULL),('SH023864910000','Der deutsche Kommissar Micha Oberländer und seine österreichische Kollegin Hannah Zeiler müssen bei allerlei mysteriösen Fällen rund um den Bodensee über die Landesgrenzen hinweg zusammenarbeiten.',NULL,'DEU','Die Toten vom Bodensee','https://json.schedulesdirect.org/20141201/image/assets/p12688382_i_h6_aa.jpg',4,NULL),('SH027485190000','Die Dokumentarreihe begleitet die Grenzschützer Spaniens bei ihrer täglichen Verbrechensbekämpfung. Rund um die Uhr sind die Männer und Frauen im Einsatz, um Drogenhändlern, Schlepperbanden und Schmugglern zuvorzukommen.',NULL,'DEU','Border Control - Spaniens Grenzschützer','https://json.schedulesdirect.org/20141201/image/assets/p13272827_i_h11_aa.jpg',4,NULL),('SH019969210000','In der mittäglichen Service-Sendung wird gekocht, gegärtnert und gebastelt. Im wöchentlichen Wechsel geben die Moderatoren Tipps für ein schöneres Zuhause, lassen Starköche leckere Menüs zubereiten und beantworten mit Experten Zuschauerfragen.',NULL,'DEU','ARD-Buffet','https://s3.amazonaws.com/schedulesdirect/assets/p10414039_i_v4_aa.jpg',4,NULL),('SH023416450000','Eine fundierte Ausbildung ist als Basis für ein erfülltes Berufsleben wichtig. Diese Reihe bietet die Möglichkeit, geschichtliches Grundwissen aufzufrischen.',NULL,'DEU','TELEKOLLEG Geschichte','https://json.schedulesdirect.org/20141201/image/assets/p12474821_st_h11_aa.jpg',4,NULL),('SH024603180000','Der elfjährige Lincoln lebt ein chaotisches Leben. Grund dafür sind seine zehn Schwestern.',NULL,'DEU','Willkommen bei den Louds','https://json.schedulesdirect.org/20141201/image/assets/p12753730_i_h11_aa.jpg',4,NULL),('SH026904260000','Die zwei Gastgeber Charlotte und Bear stellen Beziehungen auf die Probe, indem sie Paare und Freunde Tattoos füreinander entwerfen lassen. Sie sehen die Ergebnisse jedoch erst, wenn sie bereits auf der Haut verewigt wurden.',NULL,'DEU','Just Tattoo Of Us','https://json.schedulesdirect.org/20141201/image/assets/p13823506_i_h6_aa.jpg',4,NULL),('SH033831270000','Das Boss Baby braucht Hilfe von Tim, seinem Bruder und Verbündeten. Er tut sich schwer die richtige Work-Life-Balance zu finden, und das Familienleben mit seinem Job beim Baby Corp. Hauptquartier unter einen Hut zu bekommen.',NULL,'DEU','The Boss Baby: wieder im Geschäft','https://json.schedulesdirect.org/20141201/image/assets/p15289801_i_h11_ac.jpg',4,NULL),('SH020657010000','Frank Reagan ist Chef der Polizei von New York. Der Witwer folgt damit seinem Vater, der diese Behörde früher ebenfalls leitete und mit seinem Wissen und seinen Kontakten immer wieder hilfreich zur Seite steht. Der Kampf gegen das Verbrechen ist für die Reagans also kein bloßer Job sondern eine regelrechte Familienangelegenheit. Denn auch Franks Tochter Erin und seine Söhne Daniel und Jamison sind schon Träger der typischen blauen Polizeiuniformen.',NULL,'DEU','Blue Bloods - Crime Scene New York','https://json.schedulesdirect.org/20141201/image/assets/p8130493_i_h11_ab.jpg',4,NULL),('SH015401980000','Bei Tele-Gym werden verschiedene Gymnastikübungen vor der Kamera präsentiert. Die Athleten fordern die Zuschauer vor dem Bildschirm auf die Übungen mitzumachen. Es gibt Sendungen mit verschiedenen Schwerpunkten, wie beispielsweise Rückentraining.',NULL,'DEU','Tele-Gym','https://json.schedulesdirect.org/20141201/image/assets/p9125740_b_h11_aa.jpg',4,NULL),('SH020390600000','In der deutschen Eigenproduktion stellt Moderator Steven Gätjen die Top 15 magischen Momente der beliebtesten Disney-Filme in sechs Kategorien vor.',NULL,'DEU','Disney Magic Moments','https://json.schedulesdirect.org/20141201/image/assets/p11208534_b_h11_aa.jpg',4,NULL),('SH026720770000','Die Sendung informiert über aktuelle Ratgeber- und Wirtschaftsthemen aus der Region Berlin und Brandenburg. Im Mittelpunkt des Reportage-Magazins steht der hohe Nutzwert für die Verbraucher und ihre Sparmöglichkeiten im Allgemeinen.',NULL,'DEU','Super.Markt','https://json.schedulesdirect.org/20141201/image/assets/p14050639_st_h11_aa.jpg',4,NULL),('SH006921700000','Die Kommissare des Polizeirufs 110 haben immer Fälle, die einer Aufklärung bedürfen. Dabei ermitteln die Polizisten eine ganze Bandbreite an Verbrechen mit den unterscheidlichsten Motiven: von Beziehungstat, Verzweiflungsakt oder Racheakt. Die Ermittler finden immer heraus, was sich hinter den Fassaden und Gartenzäunen abspielt.',NULL,'DEU','Polizeiruf 110','https://json.schedulesdirect.org/20141201/image/assets/p466463_b_h6_aa.jpg',4,NULL),('SH032666900000',NULL,NULL,'DEU','DMAX News','https://json.schedulesdirect.org/20141201/image/assets/p17121862_st_h11_aa.jpg',4,NULL),('SH030263450000','In der Serie bekommen Besitzer von potenziell wertvollen Gegenständen die Chance, diese an professionelle Händler und Sammler zu veräußern. Unter diesen Sachen befindet sich alles, was ein Zuhause inklusive Garage hergibt.',NULL,'DEU','Die Superhändler - 4 Räume, 1 Deal','https://s3.amazonaws.com/schedulesdirect/assets/p15813130_st_h11_ac.jpg',4,NULL),('SH021288230000','Die Vierlinge Nicky, Ricky, Dicky und Dawn haben außer ihrem Geburtsdatum und ihren Eltern nicht viel gemeinsam. Da lässt der Streit unter Geschwistern nicht lange auf sich warten. Doch wenn es sein muss, halten die vier Geschwister zusammen.',NULL,'DEU','Nicky, Ricky, Dicky & Dawn','https://s3.amazonaws.com/schedulesdirect/assets/p10916406_i_v7_aa.jpg',4,NULL),('SH031375400000','Doctor Who reist durch Raum und Zeit in seinem Raumschiff, das von außen einer Telefonzelle ähnelt, aber von innen ein sehr modernes Raumschiff ist. Immer wieder erlebt er mit seinen irdischen Gefährten Abenteuer und muss gegen das Böse kämpfen.',NULL,'DEU','Doctor Who','https://json.schedulesdirect.org/20141201/image/assets/p183891_i_v7_aa.jpg',4,NULL),('SH019734590000','Patrick Jane ist ein TV-Star und vermeintlicher Zauberer. Er gibt vor, mit Geistern kommunizieren zu können. Doch nachdem der Verbrecher Red John seine Frau und seine Tochter ermordert, hängt er die Karriere als Mentalist an den Nagel. Nach einigen Jahren in der geschlossenen Anstalt beschließt Jane, den Mörder seiner Familie zur Strecke zu bringen. Dafür arbeitet er als Berater des California Bureau of Investigation. Mit seiner bemerkenswerten Menschenkenntnis und Auffassungsgabe schafft er es, knifflige Fälle spielerisch zu lösen. Dabei helfen ihm Teresa Lisbon, Kimball Cho, Wayne Rigsby und Grace Van Pelt. Sein wahres Ziel, Red John zu finden, verliert er nie aus den Augen.',NULL,'DEU','The Mentalist','https://s3.amazonaws.com/schedulesdirect/assets/p186597_l_h6_aa.jpg',4,NULL),('SH031397610000','Der launische Kommissar Rocco Schiavone macht nicht gerne Dienst nach Vorschrift und nimmt es auch mit dem Gesetz nicht so genau. Das hat zur Folge, dass er von Rom in die Provinz versetzt wird. Im Aostatal bleibt ihm nichts, als Mordfälle zu lösen.',NULL,'DEU','Der Kommissar und die Alpen','https://s3.amazonaws.com/schedulesdirect/assets/p13469373_i_h11_aa.jpg',4,NULL),('SH019374330000','Unterhaltsam und informativ geht das Magazin aktuellen, skurrilen und alltäglichen Phänomenen auf den Grund. Menschen mit besonderen Fähigkeiten, Orte mit besonderen beziehungsweise mysteriösen Bedeutungen werden vorgestellt. Die Sendung erklärt außerdem in kurzen Filmbeiträgen nützliche Erfindungen, interessante Redewendungen, stellt neue Trends aus dem Internet vor und prüft den Wahrheitsgehalt allgemein bekannter Tatsachen. Weitere Elemente sind unter anderem waghalsigen Elemente, das `Wort der Woche\', die `Zahl des Tages\' sowie viele praktische Tipps und Anleitungen zum Nachmachen, Nacherleben und Nachbauen.',NULL,'DEU','Galileo','https://json.schedulesdirect.org/20141201/image/assets/p10838152_b_h6_aa.jpg',4,NULL),('SH026983580000','Die Serie zeigt die spektakulärsten und tödlichsten Kämpfe des Zweiten Weltkriegs unter Wasser.',NULL,'DEU','Kriegshölle unter Wasser','https://json.schedulesdirect.org/20141201/image/assets/p12747367_i_h11_aa.jpg',4,NULL),('SH019980690000','Wissenschaftler stellen dar, warum mancherlei Experimente anders ausgehen als geplant. Dazu zeigen verrückte und waghalsige Videos, auf welche Art und Weise man sich blamieren, verletzen, erniedrigen und auch komplett lächerlich machen kann.',NULL,'DEU','Science of Stupid: Wissenschaft der Missgeschicke','https://json.schedulesdirect.org/20141201/image/assets/p11068138_i_h11_aa.jpg',4,NULL),('SH015933460000','Die Kommissare, ein alteingesessener oberbayerischer Ermittler und sein Kollege aus der Großstadt, könnten unterschiedlicher nicht sein. Dennoch ergänzen sie sich, wenn es darum geht, besonders knifflige Fälle in der Umgebung von Rosenheim zu lösen.',NULL,'DEU','Die Rosenheim-Cops','https://s3.amazonaws.com/schedulesdirect/assets/p9370385_b_v7_aa.jpg',4,NULL),('SH015499870000','Musikreihe mit Live-Konzerten bekannter und weniger bekannter Gruppen vor großem Publikum.',NULL,'DEU','Rockpalast','https://json.schedulesdirect.org/20141201/image/assets/p9172042_b_h11_aa.jpg',4,NULL),('SH019700700000','Eine kurze, moderierte Zusammenfassung der spannendsten Duelle und besten Treffer aus der italienischen Serie A, der französischen Ligue 1, der Scottish Premiership und der belgischen Jupiler League.',NULL,'DEU','Goooal! - Das internationale Fußball Magazin','https://json.schedulesdirect.org/20141201/image/assets/p10961356_st_h11_ab.jpg',4,NULL),('SH022003840000','Diese Sendung zeigt die Abenteuer von Alvin und den Chipmunks. Simon, Theodore und Alvin verbreiten ständig Chaos und ganz viel Spaß. Selbst Ziehvater Dave kann den Wahnsinn nicht stoppen. Für die weibliche Note sorgen die drei Chipettes.',NULL,'DEU','Alvinnn!!! und die Chipmunks','https://json.schedulesdirect.org/20141201/image/assets/p11563362_i_h11_ab.jpg',4,NULL),('SH027794260000','Florian Weber probiert verschiedene, schweißtreibende, unangenehme und auch gefährliche Berufe aus, die es inzwischen so nicht mehr gibt. Dabei verzichtet er auf moderne Hilfsmittel. Unter anderem versucht er sich als Abtrittanbieter und Köhler.',NULL,'DEU','Die härtesten Jobs von damals: Florian Weber schuftet sich durch die Geschichte','https://json.schedulesdirect.org/20141201/image/assets/p14557499_st_h11_aa.jpg',4,NULL),('SH026279310000','Die Reihe zeigt europäische Orte, die Künstler und ihre Werke maßgeblich beeinflusst haben.',NULL,'DEU','Stadt Land Kunst','https://s3.amazonaws.com/schedulesdirect/assets/p13847903_st_h11_aa.jpg',4,NULL),('SH006939640000','Wettervorhersage.',NULL,'DEU','Wetter','https://json.schedulesdirect.org/20141201/image/assets/p528834_b_h6_aa.jpg',4,NULL),('SH019578310000','Die Sendung lädt Zuschauerinnen und Zuschauer ein, ihre Familien- und Sammlerstücke ausgewählten Kunstexperten vorzustellen. Diese begutachten und bewerten die Objekte. Dabei können sich unscheinbare Dinge als wahrer Schatz entpuppen.',NULL,'DEU','Lieb & Teuer','https://json.schedulesdirect.org/20141201/image/assets/p10910892_i_h11_aa.jpg',4,NULL),('SH018654570000','Harald Lesch findet überraschende Antworten auf naturwissenschaftliche Fragen.',NULL,'DEU','Leschs Kosmos','https://json.schedulesdirect.org/20141201/image/assets/p10497073_b_h11_ab.jpg',4,NULL),('SH027374950000','Die Sendung bilanziert den zurückliegenden Spieltag der Bundesliga und 2. Bundesliga. Die namhaften Experten analysieren die Begegnungen und unterschiedliche Reporter führen Interviews aus diversen Stadien und Umkleidekabinen.',NULL,'DEU','100 Bundesliga: Fußball bei NITRO','https://json.schedulesdirect.org/20141201/image/assets/p14351412_st_h11_aa.jpg',4,NULL),('SH019805420000','Die Sendung mit Dirk Stermann und Christoph Grissemann präsentiert mit dem sprühenden Charme der Abgeklärtheit provokante Themen und schwarzen Humor - fernab von Political Correctness.',NULL,'DEU','Willkommen Österreich','https://json.schedulesdirect.org/20141201/image/assets/p11004891_i_h11_aa.jpg',4,NULL),('SH019808480000','Die beiden Moderatoren Joko und Klaas treten gegeneinander an. Die Wettreise kann beginnen.',NULL,'DEU','Joko gegen Klaas: Das Duell um die Welt','https://s3.amazonaws.com/schedulesdirect/assets/p11006017_st_h11_aa.jpg',4,NULL),('SH019585320000','Regionales Infotainmentmagazin mit den aktuellsten Neuigkeiten aus Nordrhein-Westfalen, Deutschland und der Welt. Die Aktuelle Stunde bringt Themen und Geschichten, die die Menschen zwischen Rhein und Weser interessieren, bewegen und berühren.',NULL,'DEU','Aktuelle Stunde','https://json.schedulesdirect.org/20141201/image/assets/p10914188_b_h11_aa.jpg',4,NULL),('SH019962300000','Ob es sich um ein U-Boot handelt, um einen Helikopter oder einen Geländewagen - Michael Manousakis und die Jungs von `Morlock Motors\' können bei allem aushelfen und alles beschaffen. Die Experten werden bei ihrer Arbeit begleitet.',NULL,'DEU','Steel Buddies - Stahlharte Geschäfte','https://json.schedulesdirect.org/20141201/image/assets/p11063739_b_h11_aa.jpg',4,NULL),('SH019658800000','Die Sendung berichtet aktuell über Politik, Wirtschaft, Kultur und Unterhaltendes aus Hessen.',NULL,'DEU','hessenschau kompakt','https://json.schedulesdirect.org/20141201/image/assets/p10944946_b_h11_aa.jpg',4,NULL),('SH026964060000','Schon zu Highschool-Zeiten ist Flint Lockwood begeistert von der Wissenschaft und träumt davon, ein großer und genialer Erfinder zu werden. Doch wirklich erfolgreich ist der Nachwuchserfinder noch nicht, seine Experimente gehen meist schief.',NULL,'DEU','Wolkig mit Aussicht auf Fleischbällchen','https://json.schedulesdirect.org/20141201/image/assets/p13542280_i_h6_ab.jpg',4,NULL),('SH022736230000','Magazin mit Schlagzeilen aus der Region, interessanten Gästen im Studio und Verbrauchertipps. Die Moderatoren berichten über alles, was in Sachsen, Sachsen-Anhalt und Thüringen für Schlagzeilen sorgt und informieren über Aktuelles.',NULL,'DEU','MDR um 4: Neues von hier & Leichter leben','https://json.schedulesdirect.org/20141201/image/assets/p12155955_b_h11_aa.jpg',4,NULL),('SH020064170000','Die Dokumentationen zeigen die Vielfalt der Kulturen und Ländern der Welt.',NULL,'DEU','Mein Ausland','https://json.schedulesdirect.org/20141201/image/assets/p11092457_i_h11_ab.jpg',4,NULL),('SH015976490000','Viele Naturphänomene und menschliche Kulturleistungen sind einzigartig und schützenswert. Die UNESCO schützt sie als Erbe der Menschheit. Die Sendereihe stellt die verschiedenen Welterbe-Stätten vor.',NULL,'DEU','Schätze der Welt - Erbe der Menschheit','https://s3.amazonaws.com/schedulesdirect/assets/p9056446_b_v4_aa.jpg',4,NULL),('SH020101840000','Die Experten dieser Sendung empfehlen ihre Lieblingsrezepte und die dafür notwendigen Küchenartikel.',NULL,'DEU','Kochen & Genießen TV','https://json.schedulesdirect.org/20141201/image/assets/p9509533_st_h11_ab.jpg',4,NULL),('SH029973250000','Im Spin-Off der Serie `Genial daneben\' erspielen Boning und von Sinnen immer noch Geld, aber nicht für einen ganzen Zuschauerblock, sondern für Fragensteller, die ebenfalls vor Ort sind. Am Ende entscheidet die Championsfrage, wer das Geld bekommt.',NULL,'DEU','Genial daneben - Das Quiz','https://s3.amazonaws.com/schedulesdirect/assets/p15667255_i_h11_ab.jpg',4,NULL),('SH019658290000','Gesellschaftskritisches Magazin mit Themen aus den Bereichen Wirtschaft, Soziales und Politik.',NULL,'DEU','Umschau','https://json.schedulesdirect.org/20141201/image/assets/p10944709_b_h11_aa.jpg',4,NULL),('SH018442530000','Abenteuer der Tierarzt-Familie Hansen und der Familie Grieshaber.',NULL,'DEU','Tiere bis unters Dach','https://json.schedulesdirect.org/20141201/image/assets/p10416787_i_h11_aa.jpg',4,NULL),('SH015445920000','Das Filmmagazin stellt die wichtigsten Neustarts und Themen aus der Filmwelt vor. Das Magazin zeigt Porträts und Interviews mit Schauspielern und Regisseuren. Es werden die Tops und Flops kritisiert und von den spannendsten Festivals berichtet.',NULL,'DEU','kinokino','https://json.schedulesdirect.org/20141201/image/assets/p9146320_b_h6_aa.jpg',4,NULL),('SH016436340000','Jede Folge beschäftigt sich intensiv mit einem Thema, das Kinder interessiert. Reportage/Doku, Reporterstück, Service, Test und Comedy kreisen auf abwechslungsreiche Weise das Thema ein und beleuchten es aus verschiedenen Blickwinkeln.',NULL,'DEU','Pur','https://json.schedulesdirect.org/20141201/image/assets/p9578271_b_h11_aa.jpg',4,NULL),('SH018201690000','Wegen eines tragischen Todesfalls in der Familie kehrt Katharina Lenz in ihre Heimat zurück und übernimmt die Leitung des sanierungsbedürftigen Gestüts.',NULL,'DEU','Das Glück dieser Erde','https://json.schedulesdirect.org/20141201/image/assets/p10319266_b_v4_aa.jpg',4,NULL),('SH021754930000','Spektakuläre Tieraufnahmen und faszinierende Landschaften: Die Doku-Reihe nimmt den Zuschauer mit auf eine Reise durch die vielfältigen Nationalparks Nordamerikas. In Gebirgen, Schluchten und Flüssen bis hin zu den arktischen Gletschern zeigt die Serie die beeindruckende Flora und Fauna der amerikansichen Naturschutzgebiete, vom Grand Canyon über die Everglades bis hin zum arktischen Polarkreis.',NULL,'DEU','Amerikas Naturwunder','https://json.schedulesdirect.org/20141201/image/assets/p11733546_st_h11_aa.jpg',4,NULL),('SH019375120000','Die Moderatoren präsentieren die aktuellsten Nachrichten und Themen, die die Welt bewegen.',NULL,'DEU','Prosieben Spätnachrichten','https://json.schedulesdirect.org/20141201/image/assets/p10838387_b_h11_aa.jpg',4,NULL),('SH033956960000','Eine neue Generation Shinobis betritt die Bühne - angeführt von Narutos und Hinatas Sohn, Boruto.',NULL,'DEU','Boruto','https://json.schedulesdirect.org/20141201/image/assets/p14008893_i_h11_aa.jpg',4,NULL),('SH026861390000','Seit 1955 informiert das österreichische Nachrichtenjournal am Vorabend über die aktuellen Geschehnisse und Ereignisse auf der ganzen Welt. Außerdem werden Expertenanalysen und Entwicklungen auf den Finanzmärkten vorgestellt.',NULL,'DEU','ZIB','https://s3.amazonaws.com/schedulesdirect/assets/p14109433_st_h11_aa.jpg',4,NULL),('SH024229090000','Die Sendung zeigt aktuelle Berichte aus Bayern, Hintergründe zu brisanten Themen und Geschichten, die unter die Haut gehen. Außerdem werden aktuelle Ratgeber zu Kultur- und Musikveranstaltungen gezeigt sowie Gäste in das Studio eingeladen.',NULL,'DEU','Abendschau','https://s3.amazonaws.com/schedulesdirect/assets/p12853352_b_h11_aa.jpg',4,NULL),('SH019973300000','Die interaktive Fernsehsendung, bei der die Zuschauer via Chat während der Live-Sendung Fragen an die Gäste im Studio gestellt werden können.',NULL,'DEU','heute+','https://json.schedulesdirect.org/20141201/image/assets/p11066742_i_h11_aa.jpg',4,NULL),('SH019571620000','Micky Maus und seine Freunde helfen Kindern, Rechnen und Kombinieren zu verstehen. Im `Micky Maus Wunderhaus\' steht ein Computer, der für Micky und seine Freunde eine Aufgabe stellt, die es zu lösen gilt.',NULL,'DEU','Disneys Micky Maus Wunderhaus','https://json.schedulesdirect.org/20141201/image/assets/p186176_i_h6_aa.jpg',4,NULL),('SH019586670000','Die Nachrichtensendung mit den aktuellsten Neuigkeiten aus Politik, Gesellschaft und Kultur aus und für Brandenburg. Moderiert wird die Sendung von Tatjana Jury.',NULL,'DEU','Brandenburg aktuell','https://json.schedulesdirect.org/20141201/image/assets/p10914762_i_h11_aa.jpg',4,NULL),('SH026578850000','Zusammen mit Musiker und Poetry Slammer Julius Fischer präsentiert Pullunderträger Olaf Schubert eine Comedyshow mit Gästen, Musik, Einspielfilmchen und Wortgefechten, stets mit dem Fokus, die Welt zu einem klein wenig besseren Ort zu machen.',NULL,'DEU','Olaf macht Mut','https://s3.amazonaws.com/schedulesdirect/assets/p13998523_st_h11_aa.jpg',4,NULL),('SH018456820000','Klara Degen, die Sekretärin von Kommissar Paul Kleinert löst die schwierigsten Fälle der Polizei.',NULL,'DEU','Alles Klara','https://json.schedulesdirect.org/20141201/image/assets/p10422581_i_h11_ab.jpg',4,NULL),('SH028447100000','Die Dokumentation taucht in die Naturgeschichte Europas ein und zeigt die Entwicklung der Tierwelt.',NULL,'DEU','Eine Welt aus Wäldern','https://json.schedulesdirect.org/20141201/image/assets/p13724153_i_h6_aa.jpg',4,NULL),('SH019767470000','Quizmaster Jens Hübschen testet, wer sich besser in der Region auskennt.',NULL,'DEU','Stadt - Land - Quiz','https://json.schedulesdirect.org/20141201/image/assets/p10987728_b_h11_aa.jpg',4,NULL),('SH022416050000','Sammy und Ray sind zwei Wasserschildkröten, die glücklich mit ihren Freunden und Verwandten unter Wasser leben. Um stets vor Feinden geschützt zu sein, bewohnen sie ein Korallenriff. Als Leittier und Mentor der Gemeinschaft gibt Sammy sein Wissen an seine Enkelin Ella weiter. Ella ist aber viel zu abenteuerlustig, um auf den Rat ihres Opas zu hören und sich nur im sicheren Riff aufzuhalten. Gemeinsam mit ihrem besten Freund Ricky, dem quirligen Krakenmädchen Annabel, dem stets miesgelaunten Pipo und dem redseligen Teufelsfisch Harald erkunden die jungen Meeresbewohner den Ozean und erleben dabei jede Menge Abenteuer.',NULL,'DEU','Sammy: Kleine Flossen, große Abenteuer','https://json.schedulesdirect.org/20141201/image/assets/p11005558_b_h11_ad.jpg',4,NULL),('SH028577480000','Die Reihe zeigt Reportagen zu Themen des gesellschaftlichen und religiösen Lebens.',NULL,'DEU','Echtes Leben','https://s3.amazonaws.com/schedulesdirect/assets/p14990098_st_h11_aa.jpg',4,NULL),('SH024546270000','Die Region Südtirol beginnt am Brennerpass an der Grenze zu Österreich. Die Reise führt durch den Gebirgszug der Dolomiten, durch den Vinschgau, macht Station in der Metropole Bozen und der Kurstadt Meran und endet am Kalterer See.',NULL,'DEU','Südtirol','https://json.schedulesdirect.org/20141201/image/assets/p13006043_b_h11_aa.jpg',4,NULL),('SH019640170000','Nach einem Überfall strandet eine Gruppe von Wissenschaftlern, Zivilisten und Soldaten an Bord des außerirdischen Forschungsschiffes Destiny. Unter der Leitung von Dr. Nicholas Rush und Colonel Everett Young stellen sie fest, dass sich das Schiff auf einem offenbar vorprogrammierten Kurs durch das Weltall befindet und ein Verlassen nur während der eingeplanten Zwischenstopps möglich ist, die sie zu immer neuen Planeten und Spezies führen.',NULL,'DEU','Stargate Universe','https://json.schedulesdirect.org/20141201/image/assets/p7829886_i_h6_ab.jpg',4,NULL),('SH033425940000','Prominente Rategäste treten gegen die drei besten deutschen `Quizduell\'-Spieler an.',NULL,'DEU','Quizduell - Olymp','https://json.schedulesdirect.org/20141201/image/assets/p13014615_i_h11_aa.jpg',4,NULL),('SH019713820000','Axel Bulthaupt präsentiert Perlen der MDR-Unterhaltung und greift tief ins Archiv.',NULL,'DEU','Wiedersehen macht Freude','https://json.schedulesdirect.org/20141201/image/assets/p10966773_i_h11_aa.jpg',4,NULL),('SH032951670000','Typische Mädchendinge wie Regenbögen und insbesondere Einhörner haben Alice noch nie interessiert. Doch dann wird ein echtes Einhorn zu ihrem allerbesten Freund. Dieses stellt sicher, dass Alice ein bisschen Spaß in ihrem Leben hat.',NULL,'DEU','Immer dieses Einhorn','https://json.schedulesdirect.org/20141201/image/assets/p15842701_i_h11_ab.jpg',4,NULL),('SH003332620000','Das Wochenmagazin zeigt Reportagen, Testberichte und ausführliche Hintergrundberichte über verschiedene aktuelle Themen. Die Moderatorin präsentiert gesellschaftlich relevante Themen und sorgt mit investigativen Berichten, informativen Verbrauchertipps und aufwendigen Lebensmitteltests sowie Sicherheitschecks für Gesprächsstoff. Das Magazin ist stets am Puls der Zeit und deckt MIssstände auf, die von Behörden übersehen werden. Die Reporter gehen dabei häufig an ihre Grenzen und beweisen immer wieder Mut, Ausdauer und Geduld.',NULL,'DEU','Extra: Das RTL-Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p382720_st_h11_aa.jpg',4,NULL),('SH020705430000','Der Kater mit Hut erlebt jede Menge Abenteuer mit seien Nachbarn und Sally, dem Fisch.',NULL,'DEU','Der Kater mit Hut','https://json.schedulesdirect.org/20141201/image/assets/p8192813_i_h6_aa.jpg',4,NULL),('SH019827760000','Die Sendung begibt sich auf Spurensuche ungeklärter Mordfälle der Vergangenheit.',NULL,'DEU','Maintower Kriminalreport','https://json.schedulesdirect.org/20141201/image/assets/p11013031_b_h11_aa.jpg',4,NULL),('SH032930780000','Der Komiker Kurt Krömer trifft auf einige Gäste, die nichts Besseres verdient haben.',NULL,'DEU','Chez Krömer','https://json.schedulesdirect.org/20141201/image/assets/p17261706_st_h11_aa.jpg',4,NULL),('SH019961850000','Ein mysteriöser Außerirdischer in menschlicher Gestalt namens `Doktor\' reist in seinem Raumschiff durch Zeit und Raum. Dabei erforscht er unterschiedliche Lebensformen, kann Ereignisse in der Vergangenheit beeinflussen und trifft auf kuriose Gestalten. Damit er sich im Universum nicht zu einsam fühlt, lädt er regelmäßig verschiedene Begleiter auf sein Raumschiff ein, die mit ihm weiterreisen. Doch er hat auch Feinde, die gelegentlich seinen Weg kreuzen, ihm jedoch nichts anhaben können. Denn der `Doktor\' besitzt die Fähigkeit, sich komplett zu regenerieren.',NULL,'DEU','Doctor Who','https://s3.amazonaws.com/schedulesdirect/assets/p185271_b_h11_ai.jpg',4,NULL),('SH015402960000','Zoogeschichten aus München: Alltag, Sorgen und Erfolge der Zoobewohner und ihrer Pfleger. Die Zuschauer bekommen einen Einblick in den Alltag der Tierpfleger, ihre Beziehung zu ihren Schützlingen und erfahren mehr über die verschiedenen Tierarten.',NULL,'DEU','Nashorn, Zebra & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p9126166_b_v7_aa.jpg',4,NULL),('SH027546560000','Pat der Hund würde alles dafür tun, um seine Besitzerin Lola glücklich zu machen. Mit seinem überragenden Hundeintellekt gelingt es ihm immer wieder, Spannung in ihrer beider Alltag zu bringen.',NULL,'DEU','Pat der Hund','https://json.schedulesdirect.org/20141201/image/assets/p14056615_i_v4_aa.jpg',4,NULL),('SH019883970000','Peppa, das kleine Schweinemädchen im roten Kleid, ist neugierig und klug und stürzt sich in fast jedes neue Abenteuer. Sie liebt Schokoladenkuchen, Geburtstag feiern, Kostümfeste, Geheimnisse jeder Art, Fahrrad fahren und picknicken.',NULL,'DEU','Peppa Pig','https://s3.amazonaws.com/schedulesdirect/assets/p274928_l_h6_aa.jpg',4,NULL),('SH019585710000','Das Nachrichtenmagazin für Nordrhein-Westfalen.',NULL,'DEU','WDR aktuell','https://json.schedulesdirect.org/20141201/image/assets/p10914395_b_h11_aa.jpg',4,NULL),('SH025497030000','Ein Kandidatenpaar hat die Aufgabe, das Alter von sieben Unbekannten richtig zu erraten. Schaffen sie es, können sie im Bestfall 100.000 Euro gewinnen. Je weiter sie mit ihren Tipps danebenliegen, umso weniger bleibt vom Gewinn übrig.',NULL,'DEU','Rate mal, wie alt ich bin','https://json.schedulesdirect.org/20141201/image/assets/p13473823_i_h11_aa.jpg',4,NULL),('SH018118040000','Reportagen des Auslandsjournals.',NULL,'DEU','auslandsjournal - die doku','https://json.schedulesdirect.org/20141201/image/assets/p10280418_b_h11_aa.jpg',4,NULL),('SH019683710000','Garfield, der faulste Kater der Welt ist zurück und erlebt noch mehr witzige Abenteuer. Dabei fallen Garfields schrullige Missgeschicke hier in der Regel derber und bizarrer aus als in der Vergangenheit.',NULL,'DEU','Garfield','https://s3.amazonaws.com/schedulesdirect/assets/p7889800_i_v7_aa.jpg',4,NULL),('SH015402100000','Täglich werden in Deutschland etwa 130 Erfindungen patentiert. Darunter sind viele Ideen, die im Haushalt helfen und der Gesundheit dienen sollen. Das Magazin stellt die genialen Erfindungen vor, die das Licht der Öffentlichkeit nicht scheuen müssen.',NULL,'DEU','Einfach genial!','https://s3.amazonaws.com/schedulesdirect/assets/p9125767_i_v7_aa.jpg',4,NULL),('SH033733800000','Jahrzehntelang hielten die Supermächte USA und UdSSR die Welt mit ihren Atomtests in Atem. Die Forschungsprojekte der Militärs waren streng geheim, auch die Folgen ihrer Versuche wurden unter Verschluss gehalten. Erst heute kann sich die.',NULL,'DEU','Expedition ins Atomzeitalter','https://json.schedulesdirect.org/20141201/image/assets/p17649636_st_h11_aa.jpg',4,NULL),('SH018580260000','Käpt\'n Barnius, Professor Tintling und der Arzt Peso Pinguin leben gemeinsam mit ihren fünf Teamkollegen in einer Forschungsstation. Von dort aus erkunden sie den Ozean und retten Meeresbewohner, die sich in Gefahr befinden. Die Oktonauten erforschen auch das Verhalten der Tiere. Bei ihren Expeditionen begegnen ihnen viele außergewöhnliche Geschöpfe.',NULL,'DEU','Die Oktonauten','https://json.schedulesdirect.org/20141201/image/assets/p8287494_i_v4_aa.jpg',4,NULL),('SH019749960000','Wissensquiz, das die Alltagstauglichkeit prominenter Kandidaten auf die Probe stellt.',NULL,'DEU','Meister des Alltags','https://json.schedulesdirect.org/20141201/image/assets/p10980346_b_h11_aa.jpg',4,NULL),('SH034298700000',NULL,NULL,'DEU','BOSCH - Technik fürs Leben','https://json.schedulesdirect.org/20141201/image/assets/p17884965_st_h11_aa.jpg',4,NULL),('SH019704300000','Das Magazin berichtet über aktuelle Ereignisse in der Stadt Berlin und im Land Brandenburg. Außerdem stellt es informative Themen vor, präsentiert Trends, Tipps und lädt Prominente ein.',NULL,'DEU','zibb','https://json.schedulesdirect.org/20141201/image/assets/p10962621_b_h11_ab.jpg',4,NULL),('SH019580630000','Kochen ist (k)eine Kunst, und kein Meister ist je vom Himmel gefallen. Oft sind es die einfachen Tricks, die aus einem Essen eine mittlere Weltsensation machen. Sternekoch Alfons Schuhbeck zeigt Ihnen, wie\'s geht!',NULL,'DEU','Schuhbecks','https://json.schedulesdirect.org/20141201/image/assets/p10911717_i_h11_aa.jpg',4,NULL),('SH022829460000','Die Frankenschau aktuell berichtet werktags aus der Region. Jeden Tag sind wir in Ober-, Mittel- und Unterfranken unterwegs, um über die neuesten Ereignisse zu bereichten. Zudem werden Hintergrundinformationen zu verschiedenen Themen gezeigt.',NULL,'DEU','Frankenschau aktuell','https://json.schedulesdirect.org/20141201/image/assets/p12202111_b_h11_aa.jpg',4,NULL),('SH020624480000','Übertragung vom Tischtennis.',NULL,'DEU','Tischtennis','https://s3.amazonaws.com/schedulesdirect/assets/p929673_i_v4_aa.jpg',4,NULL),('SH028920400000','Im 25. Jahrhundert ist das Forschungsraumschiff Orville in den Weiten des Weltalls unterwegs. Die bunt gemischte Crew aus Menschen und Aliens steht unter dem Kommando von Kapitän Ed Mercer und steht auch im All den Problemen des Alltags gegenüber.',NULL,'DEU','The Orville','https://json.schedulesdirect.org/20141201/image/assets/p14154433_i_h11_aa.jpg',4,NULL),('SH018438240000','Die aktuellen finanziellen Nachrichten von der Frankfurter Börse.',NULL,'DEU','Börse vor acht','https://json.schedulesdirect.org/20141201/image/assets/p10415619_b_h6_aa.jpg',4,NULL),('SH021765130000','Tarek und Christina El Moussa wollen mit dem Kauf, der Renovierung und dem Verkauf von Immobilien das große Geld machen. Doch jedes Projekt birgt das Risiko, sich zum großen Flop zu entwickeln.',NULL,'DEU','Die Super-Makler - Top oder Flop?','https://json.schedulesdirect.org/20141201/image/assets/p9806566_i_h11_ab.jpg',4,NULL),('SH021696180000','Dr. Jan Garavaglia ist eine treue Ehefrau und fürsorgliche Mutter zweier Jungen. Tagsüber ist sie jedoch eine der führenden Pathologen in Amerika und geht medizinischen Mysterien auf den Grund.',NULL,'DEU','Dr. G - Beruf: Gerichtsmedizinerin','https://json.schedulesdirect.org/20141201/image/assets/p185929_i_v7_aa.jpg',4,NULL),('SH022712700000','Dokumentarfilmreihe, die historisch interessante Todesfälle zu rekonstruieren und erklären versucht.',NULL,'DEU','Rätselhafte Tote','https://json.schedulesdirect.org/20141201/image/assets/p12145492_b_h11_aa.jpg',4,NULL),('SH019740580000','Bayern erleben - Magazin zu Bayerns Kultur, Brauchtum und Geschichte.',NULL,'DEU','Zwischen Spessart und Karwendel','https://json.schedulesdirect.org/20141201/image/assets/p10976830_b_h11_aa.jpg',4,NULL),('SH019579440000','Reportagen über ungewöhnliche Menschen und ungewöhnliche Orte in Norddeutschland.',NULL,'DEU','die nordreportage','https://json.schedulesdirect.org/20141201/image/assets/p10911280_b_h11_aa.jpg',4,NULL),('SH019560630000','Die Moderatoren berichten über topaktuelle Themen aus den Bereichen Politik, Wirtschaft, Gesellschaft sowie Kultur. Außerdem werden zahlreiche nützliche Verbrauchertipps für den Alltag und die Chance auf einen Gewinn geboten.',NULL,'DEU','SAT.1-Frühstücksfernsehen','https://s3.amazonaws.com/schedulesdirect/assets/p10904244_st_h11_aa.jpg',4,NULL),('SH027485490000','Die Dokumentation spürt den Geheimnissen der größten archäologischen Schätze der Welt nach.',NULL,'DEU','Aufgedeckt - Rätsel der Geschichte','https://s3.amazonaws.com/schedulesdirect/assets/p9897587_i_h11_ac.jpg',4,NULL),('SH019467710000','Der Polit-Talk: Als `Bürgermoderatorin\' vertritt Ines Klein die Interessen der Zuschauer, die sich über Briefe, E-Mail sowie Straßenumfragen zum Thema der Woche äußern und den prominenten Talk-Gästen Fragen stellen können.',NULL,'DEU','Fakt ist','https://json.schedulesdirect.org/20141201/image/assets/p10871447_b_h11_aa.jpg',4,NULL),('SH032240740000','Am Flughafen von Melbourne kontrollieren die Beamten der `Border Security\' auf Verstöße gegen Quarantäne- und Einreisebstimmungen, Schmuggel von Geld oder Drogen oder illegale Einfuhr von Waren. Die Serie sieht ihnen dabei über die Schulter.',NULL,'DEU','Border Patrol USA - Einsatz an der Grenze','https://json.schedulesdirect.org/20141201/image/assets/p213949_i_s3_aa.jpg',4,NULL),('SH009541760000','Anne Will diskutiert mit ihren Gästen über politische Prozesse, wirtschaftliche Zusammenhänge und gesellschaftliche Trends. Sie bietet ihnen und den Zuschauern die Plattform für eine gesellschaftspolitische Meinungsbildung.',NULL,'DEU','Anne Will','https://s3.amazonaws.com/schedulesdirect/assets/p571700_b_v4_aa.jpg',4,NULL),('SH034254190000','Der Moderator Marco Schreyl diskutiert über gesellschaftlich relevante, aktuelle Themen. Um die Themen zu beleuchten, plaudert er mit wechselnden Gästen und konsultiert ein vierköpfiges Panel aus Fachexperten und Prominenten.',NULL,'DEU','Marco Schreyl','https://s3.amazonaws.com/schedulesdirect/assets/p17860659_st_h11_aa.jpg',4,NULL),('SH019451610000','Einblicke in den Alltag fremder Kulturen, die Arbeit außergewöhnlicher Menschen aus aller Welt und vieles mehr erwartet die Zuschauer in der Dokumentarreihe, die auf spannende Art und Weise die verschiedensten Themen beleuchtet.',NULL,'DEU','360° - Geo Reportage','https://json.schedulesdirect.org/20141201/image/assets/p200805_b_h6_aa.jpg',4,NULL),('SH015443450000','Das Kulturmagazin im Ersten, im wöchentlichen Wechsel von sechs Redaktionen der ARD Funkanstalten.',NULL,'DEU','ttt - titel thesen temperamente','https://json.schedulesdirect.org/20141201/image/assets/p9145375_b_h6_aa.jpg',4,NULL),('SH030629550000','Max, ein 11-jähriger Rapper, entdeckt dank Dirigent Daniel Barenboim klassische Musik.',NULL,'DEU','Max & Maestro','https://json.schedulesdirect.org/20141201/image/assets/p14998461_st_h11_ab.jpg',4,NULL),('SH020373850000','Der 13-jährige Henry Hart aus der Kleinstadt Smellview hat ein Geheimnis vor seinen Freunden und seiner Familie. Er erlebt als `Kid Danger\' gemeinsam mit dem Superhelden Captain Man viele aufregende Abenteuer.',NULL,'DEU','Henry Danger','https://json.schedulesdirect.org/20141201/image/assets/p10891879_i_h6_aa.jpg',4,NULL),('SH019743790000','Die Detektive McGarret und Danno, Teil einer Elitepolizei in Hawaii, bekämpfen die Kriminalität auf der tropischen Insel. Bei ihrer Mission werden sie von dem erfahrenen Polizisten Chin Ho Kelly und seiner schönen Nichte Kono unterstützt.',NULL,'DEU','Hawaii Five-0','https://s3.amazonaws.com/schedulesdirect/assets/p8130405_l_h6_aa.jpg',4,NULL),('SH026515980000','Micky, Donald, Goofy, Donald und Pluto veranstalten mit ihren transformierbaren Vehikeln ein Wettrenennen rund um die Welt. Währenddessen eröffnen Minnie und Daisy ein neues Geschäft und lösen die Probleme anderer Menschen.',NULL,'DEU','Micky und die flinken Flitzer','https://s3.amazonaws.com/schedulesdirect/assets/p13569321_i_h11_aa.jpg',4,NULL),('SH030162510000','Die Moderatoren präsentieren die schönen Bilder und Basteleien, die die Zuschauer geschickt haben.',NULL,'DEU','Baumhaus','https://json.schedulesdirect.org/20141201/image/assets/p15762448_b_h11_aa.jpg',4,NULL),('SH021958510000','Die Serie handelt von weibliche Straftäterinnenn, die durch ihre Tat einen Menschen getötet haben. Sie kommen selbst zu Wort und erzählen, warum sie gemordet haben.',NULL,'DEU','Snapped: Wenn Frauen töten','https://json.schedulesdirect.org/20141201/image/assets/p189681_i_h11_ab.jpg',4,NULL),('SH019227910000','Shaun das Schaf lebt gemeinsam mit seiner Herde auf der Weide eines idyllischen Bauernhofs. Er ist jung, unerfahren und noch etwas naiv - aber sehr neugierig und verschmitzt. Er verfügt über einen ganz besonderen `Schaf-Sinn\' und findet auch für die vertracktesten Situationen eine Lösung. Auf dem Hof leben außerdem noch der Hütehund Bitzer, der Bauer und die drei fiesen Schweine, sowie einige andere Tiere. Der Bauer bekommt von dem turbulenten Leben seiner Tiere nichts mit, die sich zwar manchmal in die Wolle kriegen, aber im Großen und Ganzen wie eine glückliche Familie zusammenleben und zusammenhalten.',NULL,'DEU','Shaun, das Schaf','https://json.schedulesdirect.org/20141201/image/assets/p186454_i_h6_aa.jpg',4,NULL),('SH019577860000','30 Minuten regionale Information und Unterhaltung aus dem Land.',NULL,'DEU','Nordmagazin','https://json.schedulesdirect.org/20141201/image/assets/p10910686_i_h11_aa.jpg',4,NULL),('SH019559640000','Die Schwestern Prue, Piper und Phoebe entfesseln, ohne es zu ahnen, Zauberkräfte, die sie zu den mächtigsten Hexen aller Zeiten machen. Mit den neuerrungenen Kräften bekämpfen sie das Böse und beschützen Unschuldige.',NULL,'DEU','Charmed - Zauberhafte Hexen','https://json.schedulesdirect.org/20141201/image/assets/p184399_i_h6_aa.jpg',4,NULL),('SH016394760000','Jede Woche treten Hobbyköche gegeneinander an. Dabei steht ihnen jede Woche ein prominenter Kochprofi von Johannes B. Kerners Köchen zur Seite. Sechs Kandidaten sind es am Anfang und zum Schluss sind es nur noch zwei Kandidaten.',NULL,'DEU','Die Küchenschlacht','https://json.schedulesdirect.org/20141201/image/assets/p9562465_b_h11_aa.jpg',4,NULL),('SH019577940000','Hallo Niedersachsen ist das Regionalmagazin des Norddeutschen Rundfunks für das Land Niedersachsen. Die Fernsehsendung informiert über das politische und kulturelle Leben sowie besondere Ereignisse in Niedersachsen.',NULL,'DEU','Hallo Niedersachsen','https://json.schedulesdirect.org/20141201/image/assets/p10910723_b_h11_aa.jpg',4,NULL),('SH025015380000','Die Sendung beschäftigt sich mit geheimnisvollen Funden, die die Geschichte der Menschheit erzählen.',NULL,'DEU','Aufgedeckt - Rätsel der Geschichte','https://json.schedulesdirect.org/20141201/image/assets/p13234638_i_h6_aa.jpg',4,NULL),('SH026578380000','Acht junge Deutsche werden Bürger und Bürgerinnen einer fiktiven Diktatur. Eine Woche lang leben sie nach strengem Reglement, ohne die Privilegien einer Demokratie. Uniform ist Pflicht. Ausgangssperre und feste Arbeitsschichten prägen den Alltag in der Diktatur. Während André, Cihan und Mirco versuchen, mit den Vorschriften zurechtzukommen, wachsen bei Bürgerin Nana Zweifel, ob sie dem Diktator folgen will.',NULL,'DEU','Diktator','https://json.schedulesdirect.org/20141201/image/assets/p13998335_st_h11_aa.jpg',4,NULL),('SH027942580000','Der neunjährige Sheldon Cooper hat vier Klassen übersprungen und beginnt gleichzeitig mit seinem älteren Bruder an der Highschool. Die Tatsache, dass er hochbegabt ist, stößt bei seinem Vater, seinen Geschwistern und seinen Schulkameraden häufig auf Unverständnis, doch Sheldons Mutter unterstützt ihn umso mehr. Wegen seiner eigenwilligen Art treibt er seinen Bruder und seine Schwester oft zur Weißglut und auch die Lehrerschaft ist nicht gerade begeistert von dem neunmalklugen Jungen mit dem besonderen Talent für die Wissenschaft.',NULL,'DEU','Young Sheldon','https://json.schedulesdirect.org/20141201/image/assets/p13923679_b_h11_ab.jpg',4,NULL),('SH025247490000','Die Sendung informiert über Baufinanzierung, Immobilien und außergewöhnliche Architektur. Aktuelle Entwicklungen sowie nützliche Hinweise werden zu den verschiedenen Themen rund um das Eigenheim vorgestellt.',NULL,'DEU','Ratgeber - Bauen und Wohnen','https://json.schedulesdirect.org/20141201/image/assets/p13349318_st_h11_aa.jpg',4,NULL),('SH020149790000','Der `Late Movie\', das sind sinnliche Geschichten über Liebe, Verführung und Leidenschaft mit wechselnden Darstellern und Themen.',NULL,'DEU','SPORT1 Late-Movie','https://json.schedulesdirect.org/20141201/image/assets/p11121612_st_h11_aa.jpg',4,NULL),('SH034198320000','Nicole Pütz ist eine taffe junge Frau aus dem Plattenbau in Köln. Sie kämpft sich mit ihren eigenen Mitteln durch das Leben; um ihren Traum vom eigenen Nagelstudio zu verwirklichen schreckt sie nicht davor zurück, mit gekauftem Abitur zu studieren.',NULL,'DEU','Think Big!','https://json.schedulesdirect.org/20141201/image/assets/p17835686_st_h11_aa.jpg',4,NULL),('SH033004170000','Im Oktober 2015 sinkt das Contur der Schiffsdatenschreiber geben. Die US-Küstenwache und die.',NULL,'DEU','In Seenot','https://json.schedulesdirect.org/20141201/image/assets/p15930957_i_h11_ab.jpg',4,NULL),('SH029922860000','Die Serie zeigt die unterschiedlichen Lebensrealitäten von Menschen aus drei verschiedenen Milieus.',NULL,'DEU','Ohne Filter - So sieht mein Leben aus!','https://s3.amazonaws.com/schedulesdirect/assets/p15640040_st_h11_ab.jpg',4,NULL),('SH018439100000','Kriminalgeschichten rund um das Polizeirevier im Hamburger Kiez.',NULL,'DEU','Großstadtrevier','https://json.schedulesdirect.org/20141201/image/assets/p10415876_b_h11_ac.jpg',4,NULL),('SH022521320000','Die Dokumentarserie porträtiert Marseille, Hongkong, Hamburg, Sankt Petersburg und Melbourne - Städte, die von ihrer maritimen Lage geprägt und seit jeher eng mit Entdeckergeist verbunden sind.',NULL,'DEU','Städte am Meer','https://json.schedulesdirect.org/20141201/image/assets/p12059278_b_h6_ad.jpg',4,NULL),('SH024553550000','Ein Agumon flieht aus der Digi-Welt und begegnet Marcus, mit dem es sich anfreundet. Die Polizei sucht nach Agumon und will es zurück in die Digi-Welt bringen. Marcus verteidigt seinen neuen Freund und bekommt das Angebot, für die `DATS\' zu arbeiten.',NULL,'DEU','Digimon: Data Squad','https://json.schedulesdirect.org/20141201/image/assets/p8576791_st_h11_aa.jpg',4,NULL),('SH019576450000','Die schüchterne Anna arbeitet als Werbetexterin in einer Werbeagentur und verliebt sich in den Juniorchef der Agentur, Jonas. Doch dieser ist bereits mit ihrer verfeindeten Halbschwester verlobt, die ihr das Leben zur Hölle macht.',NULL,'DEU','Anna und die Liebe','https://json.schedulesdirect.org/20141201/image/assets/p7910953_st_h11_aa.jpg',4,NULL),('SH031196370000','Nach einer Scheidung und einem Banküberfall wird John Nolan klar, dass er mehr mit seinem Leben machen will als bisher. Er will Cop werden und Menschen beschützen. Deshalb zieht er nach Los Angeles und beginnt dort eine Ausbildung zum Polizisten.',NULL,'DEU','The Rookie','https://s3.amazonaws.com/schedulesdirect/assets/p15523389_i_h11_aa.jpg',4,NULL),('SH031503480000','Andi Kaiser kehrt nach 15 Jahren auf Weltreise in seine Heimatstadt Schexing zurück. Dort wird derzeit ein neuer Bürgermeister gesucht. Der Stadtkämmerer und die Geschäftsleiterin wollen Andi ins Amt setzen, um ihn als Marionette zu nutzen.',NULL,'DEU','Der Kaiser von Schexing','https://json.schedulesdirect.org/20141201/image/assets/p16508796_st_h11_aa.jpg',4,NULL),('SH021463510000','Die Dokumentation wirft einen Blick hinter die Kulissen der aufwendigsten Bauprojekte aller Zeiten. Sie begleitet Ingenieure, Architekten, Handwerker und Techniker bei ihrer Arbeit an den modernen Technikwundern.',NULL,'DEU','Geniale Technik','https://s3.amazonaws.com/schedulesdirect/assets/p11584693_i_h11_aa.jpg',4,NULL),('SH027581960000','Aus dem Nachrichtenstudio wird über aktuelle Ereignisse aus Deutschland und der Welt informiert.',NULL,'DEU','Nachrichten','https://json.schedulesdirect.org/20141201/image/assets/p14454310_st_h11_aa.jpg',4,NULL),('SH019798650000','Eine Kombination aus Verbrauchermagazin und Spielshow.',NULL,'DEU','Mach dich ran','https://json.schedulesdirect.org/20141201/image/assets/p11001743_b_h11_aa.jpg',4,NULL),('SH019570090000','M*A*S*H ist ein Feldlazarett der US Army. Dort leistet ein bunt zusammengewürfelter Haufen seinen Dienst im Korea-Krieg 1950. Unter diesen Umständen erlebt Captain Pierce und sein Team einen wahnsinnigen Alltag.',NULL,'DEU','M*A*S*H','https://s3.amazonaws.com/schedulesdirect/assets/p183880_l_h6_aa.jpg',4,NULL),('SH030682620000','Jeden Nachmittag, wenn der Zoo schließt, machen auch Zacki, das australische Frischwasserkrokodil, und seine Freunde Feierabend. Sie öffnen heimlich ihre Käfige und nehmen das Zoo-Mobil in Richtung Heimat, wo sie viele Abenteuer erleben.',NULL,'DEU','Zacki und die Zoobande','https://s3.amazonaws.com/schedulesdirect/assets/p14471392_i_h11_aa.jpg',4,NULL),('SH017875850000','Die rbb Reporter berichten aus Berlin und dem Land Brandenburg.',NULL,'DEU','Die rbb Reporter','https://json.schedulesdirect.org/20141201/image/assets/p10172520_b_h11_aa.jpg',4,NULL),('SH019585890000','Wissenschaftsjournalistin Bernice Notenboom unternimmt eine Forschungsreise rund um den Globus.',NULL,'DEU','Wo das Klima auf der Kippe steht - Eine Reise zu den Wendepunkten des Klimawandels',NULL,4,NULL),('SH034078580000','In dieser Sendung geht es um das Haarstyling- und Beautytool von `DYSON\'.',NULL,'DEU','DYSON Innovatives Haarstyling','https://json.schedulesdirect.org/20141201/image/assets/p17783658_st_h11_aa.jpg',4,NULL),('SH029945560000','Der ehemalige Eishockeyprofi Matt `Shadow\' Shade unternimmt einen drastischen Karrierewechsel, als er sich der resoluten Privatdetektivin Angie Everett anschließt. Gemeinsam nimmt sich das ungleiche Team großer Fälle an.',NULL,'DEU','Private Eyes','https://json.schedulesdirect.org/20141201/image/assets/p12830469_i_v4_aa.jpg',4,NULL),('SH034258880000',NULL,NULL,'DEU','Gulag - Die sowjetische Hauptverwaltung der Lager','https://json.schedulesdirect.org/20141201/image/assets/p17645754_i_v4_aa.jpg',4,NULL),('SH019369320000','Mike und Molly sind ein übergewichtiges Pärchen, das sich bei den anonymen `Overeaters\'-Treffen, einer Selbsthilfegruppe für Menschen mit Essstörungen, kennenlernt und ineinander verliebt. Mike ist ein herzensguter Polizist, der ernsthaft versucht, seine Pfunde loszuwerden. Molly ist Lehrerin und eine wahre Power-Frau, findet es aber nicht so leicht, sich auf das Abnehmen zu konzentrieren. Sie lebt mit ihrer jüngeren Schwester und Mutter zusammen, die beide trotz eines guten Appetits gemeinerweise keine Probleme mit ihrer Figur haben. Gemeinsam wollen Mike und Molly ihrem Gewicht den Kampf ansagen und sich gegenseitig unterstützen - nicht nur beim Abnehmen.',NULL,'DEU','Mike & Molly','https://json.schedulesdirect.org/20141201/image/assets/p8130329_i_h6_aa.jpg',4,NULL),('SH026022910000','Einige Tiere leben auf einer Schmusedecke und müssen gemeinsam ihre Probleme bewältigen. So braucht der Fisch unbedingt Wasser, das Ei des Huhns steckt fest und der böse Fuchs will alle anderen Tiere fressen.',NULL,'DEU','Meine Schmusedecke','https://json.schedulesdirect.org/20141201/image/assets/p13705532_i_h11_aa.jpg',4,NULL),('SH028305690000','Die Dokumentationsreihe begleitet Feuerwehrmänner bei brenzligen Einsätzen. Ihre Aufgaben sind vielfältig - vom Wohnungsbrand, Autounfall bishin zur Vermisstensuche unter Wasser.',NULL,'DEU','112: Feuerwehr im Einsatz','https://json.schedulesdirect.org/20141201/image/assets/p14861915_st_h11_aa.jpg',4,NULL),('SH019712540000','Das politische Fernsehmagazin für Nordrhein-Westfalen, aktuell, kritisch und hintergründig.',NULL,'DEU','WESTPOL','https://json.schedulesdirect.org/20141201/image/assets/p10965854_b_h11_aa.jpg',4,NULL),('SH034185720000','Die Sendung dokumentiert, wie verzweifelte Menschen Klarheit in ihre Vergangenheit bringen wollen. Sie konfrontieren ihre ehemaligen Liebhaber, Freunde oder Familienmitglieder und fragen sie nach der ungeschminkten Wahrheit.',NULL,'DEU','Ghosted: Verliebt und verschwunden','https://json.schedulesdirect.org/20141201/image/assets/p17259248_i_h11_aa.jpg',4,NULL),('SH031010990000','Zwei Mal am Tag begrüßen Sie die Moderatorinnen und Moderatoren aus dem Bonner Studio - um 17.30 Uhr mit einer 30-minütigen Zusammenfassung und um 23.00 Uhr mit einer umfassenden 60-minütigen Rückschau auf den Tag.',NULL,'DEU','phoenix der tag','https://json.schedulesdirect.org/20141201/image/assets/p16266031_b_h11_aa.jpg',4,NULL),('SH017060090000','Das faszinierende und facettenreiche Europa für ein weltweites Publikum.',NULL,'DEU','Euromaxx - Leben und Kultur in Europa','https://json.schedulesdirect.org/20141201/image/assets/p381294_i_h11_aa.jpg',4,NULL),('SH021209980000','Geopolitisches Magazin von Jean-Christophe Victor, das versucht, anhand von Karten komplexe historische, geopolitische oder wirtschaftliche Sachverhalte allgemein verständlich darzustellen.',NULL,'DEU','Mit offenen Karten','https://json.schedulesdirect.org/20141201/image/assets/p772346_i_h6_aa.jpg',4,NULL),('SH014726380000','Starke Frauen stehen vor den Trümmern ihres Lebens und wollen sich beruflich sowie privat selbstverwirklichen. Dabei zentrieren sich unterschiedliche Beziehungsgeschichten, Intrigen, Karrieren und Familienchaos um das Hotel Drei Könige, das zugehörige Restaurant Carlas sowie das Mietshaus Rosenhaus. Inmitten des Geschehens steht immer eine Frau mit einer Vision und dem aufrichtigen Wunsch nach einem glücklichen Leben.',NULL,'DEU','Rote Rosen','https://json.schedulesdirect.org/20141201/image/assets/p8832396_b_h11_aa.jpg',4,NULL),('SH032043540000','Der FC Bayern München ist der erfolgreichste deutsche Fußballklub, zuletzt eroberten die Münchner zwischen 2013 und 2018 sechsmal die Deutsche Meisterschaft, 2013 stand das Team um Manuel Neuer, Thomas Müller und Jerome Boateng in der Champions League ganz oben. Das Format FC Bayern Inside wird sowohl auf SPORT1 als auch auf FC Bayern.tv live ausgestrahlt. Hier stehen mal Personen rund um die Profimannschaft im Fokus.',NULL,'DEU','FC Bayern Inside','https://json.schedulesdirect.org/20141201/image/assets/p16804902_st_h11_aa.jpg',4,NULL),('SH020034900000','Diese Top-Piloten sind mit verschiedensten Flugzeugtypen vertraut. Ihr Job ist es, Flugzeuge sicherzustellen, wenn ein Käufer nicht bezahlt. In Detektivarbeit machen sie die Flugzeuge ausfindig und bringen sie ihrem Eigentümer zurück.',NULL,'DEU','Inkasso Air - Die Flugzeug-Eintreiber','https://json.schedulesdirect.org/20141201/image/assets/p8399068_i_h11_ah.jpg',4,NULL),('SH019379490000','Die Familie Griffin lebt in der Kleinstadt Quahog auf Rhode Island. Angeführt wird der ganz normale amerikanische Haushalt von Peter und Lois, den Eltern von drei Kindern: Chris, Meg und Stewie. Außerdem haben sie einen sprechenden Hund, Brian, der in Wahrheit das Oberhaupt der Familie ist. Mit derbem und politisch unkorrektem Humor, Musical-Einlagen und Parodien stolpern die Mitglieder der Familie von einem Missgeschick ins nächste. Louis versucht, ganz im Sinne einer fürsorglichen Mutter, die Fehler ihres Mannes auszubügeln. Meg steckt mitten in der Pubertät und Chris ist eine nicht allzu intelligente künstlerische Seele - ganz im Gegenteil zu Baby Stewie, der hochintelligent und böse zugleich ist. Nur der Hund Brian schafft es tatsächlich, das Chaos zu überblicken und einen kühlen Kopf zu bewahren.',NULL,'DEU','Family Guy','https://s3.amazonaws.com/schedulesdirect/assets/p184483_i_v4_ab.jpg',4,NULL),('SH019658810000','Thomas Ranft und Fridolin Frosch - das Maskottchen der Sendung - liefern Informationen, wie sich das Wetter in Hessen und der Welt entwickelt.',NULL,'DEU','alle wetter!','https://s3.amazonaws.com/schedulesdirect/assets/p10944959_b_h11_aa.jpg',4,NULL),('SH023496180000','Mehrteilige Dokumentation über verschiedene Künstler und Trends der Pop-Musikgeschichte. So werden zum Beispiel Bands wie `Boney M.\' porträtiert, aber auch musikalische Phänomene wie Girlgroups oder Technomusik der 90er Jahre kommen nicht zu kurz.',NULL,'DEU','Pop Giganten','https://s3.amazonaws.com/schedulesdirect/assets/p12513178_st_v4_aa.jpg',4,NULL),('SH027610270000','Das Wissensquiz stellt die Alltagstauglichkeit berühmter Kandidaten auf die Probe. In Zweierteams werden Fragen aus dem täglichen Leben beantwortet. Dabei sind Kreativität und Ideenreichtum gefragt. Der Sieger spendet den Gewinn an einen guten Zweck.',NULL,'DEU','Meister des Alltags','https://s3.amazonaws.com/schedulesdirect/assets/p14467638_st_h11_aa.jpg',4,NULL),('SH030515820000','Während der Abwesenheit ihres Vaters Dracula möchte die jugendliche Mavis beweisen, dass sie alle Fähigkeiten besitzt, das Hotel zu leiten. Die drei Freunde Hank N Stein, Pedro und Wendy Blob stehen ihr dabei stets zur Seite. Während Mavis die Hotelführung eher liberal angeht und der Spaß im Vordergrund steht, ist ihre Tante Lydia deutlich strenger...',NULL,'DEU','Hotel Transsilvanien - Die Serie','https://json.schedulesdirect.org/20141201/image/assets/p14199341_i_h11_aa.jpg',4,NULL),('SH019664330000','Viele Millionen Menschen verreisen in jedem Jahr, da geht schon mal ein Koffer verloren. Die Gepäckstücke werden dann eingelagert. Wenn sie nicht reklamiert werden, kommen sie bei Auktionen unter den Hammer. In manchen sind auch wertvolle Dinge.',NULL,'DEU','Baggage Battles 