https://json.schedulesdirect.org/20141201/image/assets/p10949089_b_h11_aa.jpg',4,NULL),('SH024124430000','Die Dokumentationsreihe erzählt die dramatische Ursprungsgeschichte Deutschlands - vom Karbon bis in die Gegenwart. Die Reise führt von den höchsten Alpengipfeln bis zu den rauen Nordseeküsten, von den Kratern der Eifel bis in das Flusslabyrinth des Spreewaldes. Erzählt wird, wie das Land zu dem geworden ist, was heute Deutschland genannt wird. Zu Beginn seiner Geschichte lag Deutschland noch am Meer.',NULL,'DEU','Planet Deutschland - 300 Millionen Jahre','https://s3.amazonaws.com/schedulesdirect/assets/p12811485_b_v7_aa.jpg',4,NULL),('SH019666900000','In der Quizsendung tritt ein Team von vier Kandidaten gegen ein Superhirn, den `Jäger\', an. Keine leichte Aufgabe, denn die Jäger sind ausgewiesene Quizprofis aus der deutschen Quiznationalmannschaft, darunter sogar der Deutsche Quizmeister. In der ersten Runde bauen die Kandidaten einzeln eine Spielsumme auf, die sie in der zweiten Runde gemeinsam gegen den Jäger verteidigen müssen, um in das Finale einzuziehen. Im Finale treten die verbliebenen Kandidaten im Team gegen den Jäger an und verteidigen das bisher erspielte Geld. Sie müssen innerhalb von zwei Minuten so viele Fragen wie möglich beantworten. Beantworten die Kandidaten mehr Fragen als der Jäger richtig, haben sie gewonnen.',NULL,'DEU','Gefragt - Gejagt','https://json.schedulesdirect.org/20141201/image/assets/p10948433_b_h11_aa.jpg',4,NULL),('SH020333740000','Die Landesschau Rheinland-Pfalz schaut ins Land, berichtet übers Land, ist fürs Land. Rheinland-Pfalz den Rheinland-Pfälzern ganz nahe bringen - das ist die Philosophie. Und dieser Anspruch wird jeden Tag aufs Neue erfüllt.',NULL,'DEU','Landesschau Rheinland-Pfalz','https://json.schedulesdirect.org/20141201/image/assets/p11186685_b_h11_aa.jpg',4,NULL),('SH019560330000','Aktuelle Informationen werden live aus Berlin-Mitte übertragen. Das Nachrichtenmagazin berichtet über die wichtigsten und interessantesten Geschehnisse des Tages.',NULL,'DEU','SAT.1 Nachrichten','https://s3.amazonaws.com/schedulesdirect/assets/p10904035_st_h11_aa.jpg',4,NULL),('SH015442380000','Das Kunst- und Kulturmagazin des Bayerischen Fernsehens.',NULL,'DEU','Capriccio','https://json.schedulesdirect.org/20141201/image/assets/p9145014_i_h11_aa.jpg',4,NULL),('SH019953350000','Die Brüder Sam und Dean Winchester haben bereits als Kinder ihre Mutter verloren. Wie sich herausstellte, wurde sie von einem durch Dämonen verursachten Brand getötet. Ihr Vater begab sich seitdem auf die Mission, den Mörder zu finden und auszuschalten. Seine Kinder nahm er mit und lehrte sie den Kampf gegen das Übernatürliche. Sam wollte ein normales Leben führen und ging an die Stanford University studieren, während Dean bei seinem Vater blieb. Als allerdings der Vater der beiden auf mysteriöse Art und Weise verschwindet und Sams Freundin auf eine ähnliche Weise stirbt wie seine Mutter, beschließen die Brüder, sich gemeinsam auf die Suche nach ihrem Vater zu machen. Auf ihrer Reise bekämpfen sie jede übernatürliche Macht, die sich ihnen in den Weg stellt.',NULL,'DEU','Supernatural','https://s3.amazonaws.com/schedulesdirect/assets/p185113_l_h6_aa.jpg',4,NULL),('SH019851360000','Die Hecks, bestehend aus Mutter Frankie, Vater Mike und ihren drei Kindern, sind eine typische amerikanische Durchschnittsfamilie. Ihr oft chaotischer Alltag wird größtenteils von den Sorgen und Nöten der Kinder Axl, Sue und Brick bestimmt.',NULL,'DEU','The Middle','https://s3.amazonaws.com/schedulesdirect/assets/p3560344_l_h6_aa.jpg',4,NULL),('SH022288460000','Die Dokuserie begleitet Familien, die in der Natur von Alaska leben wollen, bei der Suche nach einem geeigneten Haus. Für ein Leben in fast unberührter Wildnis muss allerdings so mancher Abstrich an Komfort in Kauf genommen werden.',NULL,'DEU','Haus gesucht in Alaska','https://json.schedulesdirect.org/20141201/image/assets/p9441257_i_h11_aa.jpg',4,NULL),('SH027609630000','Die Sendung nimmt frech bis spöttisch Kurs auf die Themen der Metropole und berichtet satirisch und politisch über die Geschicke der Stadt.',NULL,'DEU','Abendshow - Live aus Berlin','https://json.schedulesdirect.org/20141201/image/assets/p14467324_st_h11_aa.jpg',4,NULL),('SH031604480000',NULL,NULL,'DEU','kochen & backen','https://json.schedulesdirect.org/20141201/image/assets/p16571707_st_h11_ac.jpg',4,NULL),('SH030343740000','Die neu aufgestellte Sendung wirft einen frischen Blick auf die Topthemen des Tages aus Berlin und Brandenburg und informiert kompakt in 15 Minuten über die Entwicklungen bis in den späten Abend.',NULL,'DEU','rbb24','https://json.schedulesdirect.org/20141201/image/assets/p15852581_b_h11_aa.jpg',4,NULL),('SH019576370000','Doktor Mark Sloan hilft seinem Sohn Detective Steve Sloan bei der Aufklärung von Mordfällen. Dabei greifen den beiden die Pathologin Amanda Bentley und Notfallchirurg Doktor Jesse Travis unter die Arme.',NULL,'DEU','Diagnose: Mord','https://s3.amazonaws.com/schedulesdirect/assets/p184251_i_v7_aa.jpg',4,NULL),('SH015402030000','Das Magazin informiert aktuell, regional und unterhaltsam über medizinische Themen, Gesundheitsvorsorge und neue Therapieformen.',NULL,'DEU','rbb Praxis','https://json.schedulesdirect.org/20141201/image/assets/p9125748_b_h11_ab.jpg',4,NULL),('SH019855870000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus dem Ruhrgebiet.',NULL,'DEU','Lokalzeit Ruhr','https://json.schedulesdirect.org/20141201/image/assets/p11024446_b_h11_aa.jpg',4,NULL),('SH019560340000','Der Naval Crime Investigative Service wird dann gerufen, wenn Verbrechen begangen werden, die gegen den Uniform Code of Military Justice verstoßen und innerhalb der Navy stattfinden. Das Hauptquartier befindet sich in Washington D.C. und steht unter der Leitung von Special Agent Leroy Jethro Gibbs. Er selbst ist ein Veteran aus dem Irak-Krieg und hat mit moderner Technik wenig zu tun. Aus diesem Grund ermittelt er gemeinsam mit einem Elite-Team, bestehend aus dem Ballistik-Experten Tony DiNozzo, dem Technikspezialisten Tim McGee, der Forensikspezialistin Abby Sciuto sowie dem Gerichtsmediziner Ducky Mallard.',NULL,'DEU','Navy CIS','https://json.schedulesdirect.org/20141201/image/assets/p184930_i_h11_ad.jpg',4,NULL),('SH024549410000','Das Sondereinsatzkommando in München muss täglich den verschiedensten Delikten auf den Grund gehen. Dabei steht die Zusammenarbeit im Team im Vordergrund, aber auch das private Leben der Ermittler sowie ihre Probleme, Wünsche und Ängste werden gezeigt. Das Spektrum der Fälle, die die Soko in München bearbeitet, wird stets ausgeweitet: die Kommissare konzentrieren sich zunächst auf organisierte Rauschgiftdelikte, klären aber später auch Kapitalverbrechen auf, die keinen Bezug zur Drogen- oder organisierten Kriminalität haben.',NULL,'DEU','SOKO München','https://s3.amazonaws.com/schedulesdirect/assets/p490381_st_h11_aa.jpg',4,NULL),('SH028397960000','Marlene Lufen lädt Gäste zum Abendessen ein, mit denen sie über aktuelle Themen diskutiert. Ihre Gäste sind oft Prominente, aber auch `gewöhnliche\' Menschen aus der Mitte der Gesellschaft, für das Essen sorgt ein Profikoch.',NULL,'DEU','Dinner Party - Der Late-Night-Talk','https://s3.amazonaws.com/schedulesdirect/assets/p14127248_st_h11_ab.jpg',4,NULL),('SH016398410000','Eine Servicesendung mit Tipps für die großen und kleinen Herausforderungen des Alltags sowie einem prominenten Studiogast, mit dem am Studiotisch zwischen Kaffee und Morgenbrötchen ein Interview geführt wird.',NULL,'DEU','Volle Kanne - Service täglich','https://json.schedulesdirect.org/20141201/image/assets/p9563697_b_h6_ab.jpg',4,NULL),('SH015402460000','Die Sendung blickt Woche für Woche bis zum Horizont und weiter. Julia-Niharika Sen zeigt zusammen mit anderen Korrespondenten weltweit den Alltag der Menschen im nahen und fernen Ausland.',NULL,'DEU','Weltbilder','https://json.schedulesdirect.org/20141201/image/assets/p9125901_b_h11_aa.jpg',4,NULL),('SH018556740000','Wettervorhersage.',NULL,'DEU','RTL Aktuell: Das Wetter','https://json.schedulesdirect.org/20141201/image/assets/p10457997_b_h11_ab.jpg',4,NULL),('SH020424860000','Mascha, ein überaus aktives kleines Mädchen, lernt eines Tages im Wald einen grummeligen, großen Bären kennen. Dieser lebt alleine und liebt seinen ruhigen und gemütlichen Alltag über alles. Masha stellt mit ihren Ideen seine Welt auf den Kopf.',NULL,'DEU','Mascha und der Bär','https://s3.amazonaws.com/schedulesdirect/assets/p794701_i_h11_ab.jpg',4,NULL),('SH016391760000','Kriminalhauptkommissar und SOKO-Leiter Jan Reuter, die beiden Kriminaloberkommissare Nils und Katrin sowie Polizeihauptmeister Lars werden bei ihrer Ganovenjagd unterstützt von Leena Virtanen, Konstabler der finnischen Staatspolizei.',NULL,'DEU','SOKO Wismar','https://json.schedulesdirect.org/20141201/image/assets/p9561690_b_h11_ac.jpg',4,NULL),('SH020078840000','Dr. Michelle Ward, Kriminalpsychologin und selbst früheres Stalking-Opfer, gibt Betroffenen in ihrer Sendung hilfreiche Ratschläge und zeigt Fälle, in denen Stalker erfolgreich gestellt werden konnten.',NULL,'DEU','Stalked - Leben in Angst','https://s3.amazonaws.com/schedulesdirect/assets/p289339_i_v7_ac.jpg',4,NULL),('SH019586730000','Das Wichtigste aus Politik, Kultur, Wirtschaft und Sport, die Szene-Trends und die Kiezgeschichten.',NULL,'DEU','Abendschau','https://json.schedulesdirect.org/20141201/image/assets/p10914775_b_h6_ac.jpg',4,NULL),('SH031503490000','Voller Hoffnung bricht die junge Eliza auf, um sich in Rio de Janeiro ein besseres Leben aufzubauen. Dort lebt sie zunächst auf der Straße. Schon bald macht ihr der Geschäftsführer einer renommierten Modeagentur jedoch ein überraschendes Angebot.',NULL,'DEU','Total Dreamer - Träume werden wahr','https://json.schedulesdirect.org/20141201/image/assets/p12309284_i_h11_aa.jpg',4,NULL),('SH019664270000','Zwei Fremde kämpfen völlig nackt gemeinsam ums Überleben auf einer einsamen Insel. Dabei müssen sie ihre Scham schnell überwinden, denn um 21 Tage ohne Ausrüstung und Proviant zu überleben, müssen sie schnell zu einem Team werden.',NULL,'DEU','Naked Survival - Ausgezogen in die Wildnis','https://json.schedulesdirect.org/20141201/image/assets/p9974211_i_h6_ac.jpg',4,NULL),('SH019700380000','Die Realityserie begleitet Familie Harrison, die seit 1988 in Las Vegas ein Pfandleihhaus betreibt. Sie geben einen Einblick, welche ungewöhnlichen und skurrilen Objekte abgegeben werden und wie der Wert einschätzt wird.',NULL,'DEU','Pawn Stars - Die drei vom Pfandhaus','https://s3.amazonaws.com/schedulesdirect/assets/p3565439_i_v4_aa.jpg',4,NULL),('SH032782500000','Die Dokumentation zeigt die Lichtblicke im Kampf gegen den Terror und Pläne, die rechtzeitig durchkreuzt wurden. In jeder Folge wird ein geplanter Terroranschlag dokumentiert, der unzählige Todesopfer fordern sollte, aber verhindert wurde.',NULL,'DEU','Dem Terror knapp entkommen','https://json.schedulesdirect.org/20141201/image/assets/p15514911_i_h11_aa.jpg',4,NULL),('SH016460840000','Die Dokumentationsreihe zeigt ein breites Spektrum an Themen, dazu zählen unter anderem Geschichtsdokumentationen, Natur- und Tier-Dokumentationen, Archäologie-Dokumentationen, Wissenschaftsdokumentationen und auch fiktionale Dokumentationen.',NULL,'DEU','Terra X','https://s3.amazonaws.com/schedulesdirect/assets/p9587122_b_h6_ad.jpg',4,NULL),('SH032423110000','Wer in dieser Show als Sieger hervorgehen will, muss auf ganzer Linie im großen Duell überzeugen.',NULL,'DEU','Schlag den Besten','https://s3.amazonaws.com/schedulesdirect/assets/p17005229_st_h11_aa.jpg',4,NULL),('SH019883330000','Sam lebt in Pontypandy, einem Dorf, in dem jeder jeden kennt. Der Feuerwehrmann braucht sich keine Sorgen zu machen, dass er irgendwann nichts zu tun hat, denn es passieren so viele Dinge. Meist verbirgt sich der Junge Norman hinter den Unglücken.',NULL,'DEU','Feuerwehrmann Sam','https://json.schedulesdirect.org/20141201/image/assets/p386604_i_h6_aa.jpg',4,NULL),('SH028057170000','Die Hobbydetektivin Mirette klärt verschiedene seltsame Geschehnisse in der ganzen Welt auf.',NULL,'DEU','Mirette ermittelt','https://json.schedulesdirect.org/20141201/image/assets/p13768620_st_h11_ad.jpg',4,NULL),('SH022717710000','Magazin mit Themen, die die Menschen in Hessen interessieren.',NULL,'DEU','defacto','https://json.schedulesdirect.org/20141201/image/assets/p10911752_b_h6_ab.jpg',4,NULL),('SH028248060000','Vorgestellt werden Elternpaare mit besonderen Erziehungsansätzen für ihre Kinder. Obwohl sie nur das Beste für ihre Kinder wollen, unterscheiden sich die Methoden deutlich und geben einen Einblick, wie verschieden eine gute Erziehung sein kann.',NULL,'DEU','Richtig (v)erzogen - Wir erziehen anders','https://json.schedulesdirect.org/20141201/image/assets/p14830113_st_h11_aa.jpg',4,NULL),('SH027640520000','Die Sendung berichtet über die sexuellen Vorlieben der Deutschen und wie sie mit ihren Sehnsüchten umgehen anhand dreier persönlicher Geschichten. Manche sprechen offen über ihre Wünsche, für andere wiederum ist das Thema tabu.',NULL,'DEU','Sex Secrets - Das macht Deutschland an!','https://json.schedulesdirect.org/20141201/image/assets/p14481572_st_h11_aa.jpg',4,NULL),('SH018583070000','Innenpolitisches Magazin des BR mit Hintergründen und Analysen.',NULL,'DEU','Report München','https://json.schedulesdirect.org/20141201/image/assets/p10468097_i_h6_aa.jpg',4,NULL),('SH019759960000','Rob Dyrnek und seine prominenten Gäste zeigen die lustigsten Videos aus dem Internet. Bei den Amateurvideos bleibt kein Auge trocken, erst recht nicht, wenn Rob Dyrnek seine spitzen Kommentare dazu abgibt.',NULL,'DEU','Ridiculousness','https://s3.amazonaws.com/schedulesdirect/assets/p8600308_l_h6_aa.jpg',4,NULL),('SH021247230000','Dresden 1933: Das Straßenbild der Stadt wird zunehmend bestimmt von Boykott-Aufrufen gegen jüdische Geschäfte. Dennoch verfolgen Victor und Eva Klemperer hartnäckig ihren Traum vom Haus im Grünen und lassen sich davon auch nicht abbringen, als Victor Klemperer zunehmend Repressalien an der Hochschule ausgesetzt wird. Außerdem wird der für den Hausbau dringend benötigte Kredit nicht bewilligt. In der Not helfen Freunde. Ellen und Heinrich Feller bieten den Klemperers ein privates Darlehen.',NULL,'DEU','Klemperer: Ein Leben in Deutschland','https://json.schedulesdirect.org/20141201/image/assets/p11495599_b_h11_aa.jpg',4,NULL),('SH019577930000','Das Regionalmagazin greift das auf, worüber die Menschen in der Region sprechen. Es gibt politische Diskussionen, Berichte über gesellschaftliche Ereignisse, Reportagen aus dem Leben, kritische Interviews, Kultur und Musik.',NULL,'DEU','buten un binnen','https://json.schedulesdirect.org/20141201/image/assets/p10910715_i_h11_aa.jpg',4,NULL),('SH015401890000','Die Reporter der Dokumentations- und Feature-Reihe sorgen mit ihren Filmen regelmäßig für Schlagzeilen. Sie decken Skandale auf, kümmern sich aber auch um all die Fragen des Alltags, die die Zuschauerinnen und Zuschauer beschäftigen und berühren.',NULL,'DEU','betrifft','https://json.schedulesdirect.org/20141201/image/assets/p9125718_b_h11_aa.jpg',4,NULL),('SH019658760000','Die Sendung bietet Service im Plauderton, kombiniert mit etwas Klatsch und Tratsch. Bei einer Tasse Kaffee oder Tee plaudern wir mit interessanten Menschen aus Hessen, die etwas Besonderes können, tun oder haben.',NULL,'DEU','hallo hessen','https://s3.amazonaws.com/schedulesdirect/assets/p10944904_b_h11_aa.jpg',4,NULL),('SH021810300000','Die vier Wolkenkinder Baba Pink, Baba Gelb, Baba Blau und Baba Grün leben in einem kleinen Haus in den Wolken. Ihre Aufgabe ist es dafür zu sorgen, dass die Himmelskörper immer rechtzeitig am Firmament stehen. Um zu reisen, nutzen sie den Wolkenzug.',NULL,'DEU','Wolkenkinder','https://json.schedulesdirect.org/20141201/image/assets/p9140351_i_h11_aa.jpg',4,NULL),('SH019855930000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Düsseldorf.',NULL,'DEU','Lokalzeit aus Düsseldorf','https://json.schedulesdirect.org/20141201/image/assets/p11024459_b_h11_ab.jpg',4,NULL),('SH016991810000','Zwei Männer der Autobahnpolizei kämpfen gegen Verbrechen in Berlin und Nordrhein-Westfalen. Ihre Gegner sind extrem schnell und gefährlich und deshalb sind auch die Ermittler immer mit voller Geschwindigkeit unterwegs.',NULL,'DEU','Alarm für Cobra 11 - Die Autobahnpolizei','https://json.schedulesdirect.org/20141201/image/assets/p8003912_b_h11_ai.jpg',4,NULL),('SH025154630000','Colonel Hogan und seine Truppe sind in einem Lager der Deutschen während des Zweiten Weltkriegs inhaftiert. Dabei schaffen sie es, eine erfolgreiche Spionagegruppe für die Alliierten zu sein und die Lagerleitung an der Nase herumzuführen.',NULL,'DEU','Ein Käfig voller Helden','https://s3.amazonaws.com/schedulesdirect/assets/p184204_i_v7_aa.jpg',4,NULL),('SH018574550000','Richter Ulrich Wetzel legt viel Wert auf ein faires Kreuzverhör in seinem Gerichtssaal. Mit im Saal die Angeklagten, der Staastanwalt und der Verteidiger. Die Zeugen werden geladen um die Wahrheit ans Licht zu bringen.',NULL,'DEU','Das Strafgericht','https://json.schedulesdirect.org/20141201/image/assets/p10464477_b_h11_aa.jpg',4,NULL),('SH016037940000','Kriminalhauptkommissarin Alexandra Gebhardt hat ein Team zusammengestellt, das es der Kölner Unterwelt schwer macht. Mit hartem körperlichem Einsatz und Witz ermitteln die Sonderkommissare in Köln.',NULL,'DEU','SOKO Köln','https://s3.amazonaws.com/schedulesdirect/assets/p9417608_i_v4_aa.jpg',4,NULL),('SH025933580000','Elena hat ihr Königreich Avalor vor einer bösen Zauberin gerettet. Doch nun muss die Sechzehnjährige lernen, wie man ein Königreich regiert. Sie erlebt viele Abenteuer, bei denen sie erfährt, dass ihre neue Rolle als Oberhaupt eine Menge fordert.',NULL,'DEU','Elena von Avalor','https://json.schedulesdirect.org/20141201/image/assets/p12975383_i_v4_aa.jpg',4,NULL),('SH003332690000','Das Nachrichten- und Unterhaltungsmagazin beschäftigt sich mit tagesaktuellen Themen, dem Wetter, bietet nützliche Verbrauchertipps und berichtet über das Geschehen rund um den Globus. Außerdem bietet die Sendung jede Menge VIP, Klatsch und Tratsch von Prominenten und lädt die Stars und Sternchen ins Studio ein, um die Themen der Woche zu besprechen. Das Informationsmagazin berichtet zudem über die aktuellen Errungenschaften in der Welt des Sports, hat Aktionen und Gewinnspiele und eine Wettervorschau für Deutschland.',NULL,'DEU','Guten Morgen Deutschland','https://s3.amazonaws.com/schedulesdirect/assets/p397377_st_h11_aa.jpg',4,NULL),('SH016397840000','Markus Lanz lädt prominente Gäste und Experten aus allen Bereichen des öffentlichen Lebens zu seiner bunten Talkrunde ein. In der Regel sind es vier Gäste, die einzeln vorgestellt werden und ihre persönlichen Erfahrungen zu den Themen einbringen.',NULL,'DEU','Markus Lanz','https://json.schedulesdirect.org/20141201/image/assets/p793628_b_h6_aa.jpg',4,NULL),('SH032966600000',NULL,NULL,'DEU','#phoenix_freistil','https://json.schedulesdirect.org/20141201/image/assets/p17286652_st_h11_aa.jpg',4,NULL),('SH016265910000','Die Produktlinie von Bärbel Drexel wird in der Sendung vorgestellt, getestet und empfohlen.',NULL,'DEU','BÄRBEL DREXEL Natürlich Natur','https://json.schedulesdirect.org/20141201/image/assets/p9509515_st_h11_aa.jpg',4,NULL),('SH021430130000','Zwei pensionierte Kommissare werden vom Polizeipräsidenten in den Dienst zurückbeordert.',NULL,'DEU','Rentnercops','https://json.schedulesdirect.org/20141201/image/assets/p11584128_b_h11_aa.jpg',4,NULL),('SH029783890000','Deutsche Ermittler stellen grausame Mordfälle vor, deren langwierige Aufklärung jahrelange Ermittlungsarbeit in Anspruch genommen hat. Trotz ihrer Routine stoßen auch diese Beamten auf Verbrechen, die nicht alltäglich sind.',NULL,'DEU','Ermittler!','https://s3.amazonaws.com/schedulesdirect/assets/p15562276_st_h11_aa.jpg',4,NULL),('SH022744040000','Die Beamten werden zu verschiedenen Verbrechensorten gerufen.',NULL,'DEU','Der Blaulicht Report','https://json.schedulesdirect.org/20141201/image/assets/p12159916_b_h11_aa.jpg',4,NULL),('SH031714390000','Die Moderatoren retten alten Krempel, der sich auf Deutschlands Dachböden, Kellern oder Garagen staut und stapelt. Diese bringen sie auf Burg Adendorf, wo Experten darüber beraten, was man aus ihnen machen könnte.',NULL,'DEU','Hallo Schatz: Vom Plunder zum Prachtstück','https://s3.amazonaws.com/schedulesdirect/assets/p16632880_st_h11_ab.jpg',4,NULL),('SH028611590000','Zahlreiche Feldzüge sollen Nazi-Deutschland dienen, doch einige davon führten in den Untergang.',NULL,'DEU','Feldzug in den Untergang - Hitlers verlorene Schlachten','https://s3.amazonaws.com/schedulesdirect/assets/p15003294_st_h11_aa.jpg',4,NULL),('SH019619470000','Der beste Freund der Maus verzaubert mit seiner ganz eigenen Sendung. Er erfreut seine Zuschauer mit vielen Lach- und Sachgeschichten und bringt sie damit zum Lachen und Staunen.',NULL,'DEU','Die Sendung mit dem Elefanten','https://json.schedulesdirect.org/20141201/image/assets/p10928108_i_h11_ab.jpg',4,NULL),('SH032039540000','Die vier kleinen Kätzchen Lampo, Milday, Pilou und Poppetta leben in der Garage der fürsorglichen Nonna Pina. Als `The Buffycats\' machen sie Musik und begeben sich auf verschiedene aufregende Abenteuer. Dabei stoßen sie auch auf weitere Artgenossen.',NULL,'DEU','44 Cats','https://json.schedulesdirect.org/20141201/image/assets/p16208083_i_h6_aa.jpg',4,NULL),('SH018432770000','Shary und Ralph zeigen in diesem Wissensmagazin außergewöhnliche Experimente oder kuriose Rezepte, die man zuhause ganz einfach nachmachen kann.',NULL,'DEU','Wissen macht Ah!','https://s3.amazonaws.com/schedulesdirect/assets/p10413905_i_v4_aa.jpg',4,NULL),('SH033509300000','Die Kanalisation ist verstopft, die Straßen sind nicht geteert und in den Wohnvierteln stapelt sich Unrat, weil niemand den Müll wegräumt. Dieses bedrückende Szenario ist in Deutschland zum Glück keine Realität, weil fleißige Helfer gewissenhaft.',NULL,'DEU','Deutschland 24/7 - Ohne uns läuft nichts!','https://json.schedulesdirect.org/20141201/image/assets/p17546592_st_h11_aa.jpg',4,NULL),('SH019646630000','Schatztaucher aus aller Welt begeben sich jedes Jahr auf Goldsuche in der Berginsee. Die Goldvorkommen wurden über Millionen Jahre vom Schmelzwasser der Gletscher angeschwemmt. Die Suche ist nur mit schwerem Gerät möglich, und nicht ungefährlich.',NULL,'DEU','Goldtaucher der Beringsee','https://json.schedulesdirect.org/20141201/image/assets/p8963906_i_h11_ab.jpg',4,NULL),('SH018654540000','Max Uthoff und Claus von Wagner stehen sind die Protagonisten der `Anstalt\' und stehen für gutes politisches Kabarett, das analytisch, bissig und unterhaltsam ist.',NULL,'DEU','Die Anstalt','https://json.schedulesdirect.org/20141201/image/assets/p10497049_b_h11_aa.jpg',4,NULL),('SH016397720000','Die aktuellsten und brisantesten Themen des Tages werden ausführlich dargestellt und mit sorgfältig recherchierten Hintergrundberichten abgerundet. Hinzu kommen Interviews mit Politikern und anderen maßgeblichen Persönlichkeiten.',NULL,'DEU','heute-journal','https://s3.amazonaws.com/schedulesdirect/assets/p400450_i_v4_aa.jpg',4,NULL),('SH018580670000','Oggy ist ein ruhiger Kater, der keiner Fliege etwas zuleide tut. Die drei Kakerlaken Joey, Deedee und Marky dagegen haben Spaß, wenn sie Oggy die Hölle auf Erde bereiten. Ständig fallen ihnen neue Streiche und Gemeinheiten ein.',NULL,'DEU','Oggy und die Kakerlaken','https://json.schedulesdirect.org/20141201/image/assets/p271385_i_h11_aa.jpg',4,NULL),('SH015402510000','Mehr als 300 Berufe im Dualen System, dazu kommen Lehrstellen bei Behörden und der Bahn, außerdem locken Fachschulen mit ihren Abschlüssen: Doch welche Ausbildung in Betrieb und Berufsschule ist für wen richtig?',NULL,'DEU','Ich mach\'s!','https://json.schedulesdirect.org/20141201/image/assets/p9125925_b_h11_aa.jpg',4,NULL),('SH018438260000','Diese Sendung präsentiert die tägliche Wettervorhersage im Ersten, mit aktuellen Prognosen.',NULL,'DEU','Wetter vor acht','https://json.schedulesdirect.org/20141201/image/assets/p10415622_b_h6_ab.jpg',4,NULL),('SH016999660000','Diana liebt Eiskunstlaufen, aber sie hat noch nie versucht, eine professionelle Laufbahn als Eiskunstläuferin einzuschlagen. Eines Abends trainiert sie heimlich auf einer Eisbahn und wird vom Marketing Manager der Steinkamp-Gruppe entdeckt.',NULL,'DEU','Alles was zählt','https://json.schedulesdirect.org/20141201/image/assets/p9790472_b_h11_ae.jpg',4,NULL),('SH026031750000','In der Wissenschaftssendung werden unterschiedliche wissenschaftliche Themen verständlich erklärt.',NULL,'DEU','Quarks','https://json.schedulesdirect.org/20141201/image/assets/p13710060_i_h6_aa.jpg',4,NULL),('SH029351530000','Der Freistaat Bayern feiert seinen 100. Geburtstag. Anlässlich dieses Ereignisses unternimmt die Moderatorin eine Reise durch Bayern, das größte und höchtsgelegendste Bundesland. Dort gibt es einige Superlative zu bewundern.',NULL,'DEU','Heimat der Rekorde','https://json.schedulesdirect.org/20141201/image/assets/p15345533_st_h11_aa.jpg',4,NULL),('SH021143520000','Jede Folge widmet sich einem speziellen Thema aus dem Alltag, Experten liefern nützliche Tipps.',NULL,'DEU','SAT.1 Reportage','https://s3.amazonaws.com/schedulesdirect/assets/p11449035_st_h11_ab.jpg',4,NULL),('SH022939520000','Das werktägliche Regionalmagazin mit aktuellen Informationen und Reportagen für Südbayern.',NULL,'DEU','Abendschau - Der Süden','https://json.schedulesdirect.org/20141201/image/assets/p12261673_st_h11_aa.jpg',4,NULL),('SH027373780000','Die Geheimorganisation SHADO wird nach mehrfachen Entführungen durch Außerirdische ins Leben gerufen. Sie kämpft von ihrem Versteck in einem getarnten Fernsehstudio aus gegen die außerirdische Bedrohung.',NULL,'DEU','UFO - Weltraumkommando S.H.A.D.O.','https://json.schedulesdirect.org/20141201/image/assets/p519501_b_v4_ab.jpg',4,NULL),('SH019441760000','Der 46-jährige Multimillionär Robert Geiss führt mit seiner Frau Carmen und den beiden Töchtern Davina Shakira und Shania Tyra ein luxuriöses Leben. Dabei wird die Jetset-Familie auf Schritt und Tritt mit der Kamera begleitet.',NULL,'DEU','Die Geissens - Eine schrecklich glamouröse Familie!','https://s3.amazonaws.com/schedulesdirect/assets/p10862001_st_h11_aa.jpg',4,NULL),('SH019585610000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Duisburg. Die regionalen Nachricht rund um Duisburg sprechen Themen in Bereichen Gesellschaft, Politik, Wirtschaft und Kultur an.',NULL,'DEU','Lokalzeit aus Duisburg','https://json.schedulesdirect.org/20141201/image/assets/p10914347_b_h11_aa.jpg',4,NULL),('SH023487740000','Diese Reihe stellt chemische Produkte und ihre Anwendungsmöglichkeiten im Alltag vor.',NULL,'DEU','Chemische Produkte im Alltag','https://json.schedulesdirect.org/20141201/image/assets/p12509191_st_h11_aa.jpg',4,NULL),('SH019713480000','Das Magazin beschäftigt sich mit dem Alltag in Deutschland und Polen. So unterschiedlich die Situation auf manchen Gebieten ist, so ähnlich können die Probleme sein, die sich nach der politischen Wende aus dem realsozialistischen Erbe ergeben haben.',NULL,'DEU','Kowalski & Schmidt','https://json.schedulesdirect.org/20141201/image/assets/p10966585_b_h11_aa.jpg',4,NULL),('SH029090950000','Journalistin Paula Zahn rollt geheimnisvolle und dramatische Kriminalfälle wieder neu auf. Mithilfe von nachgestellten Szenen und Interviews mit den Angehörigen der Opfer und den damaligen Ermittlern werden die Verbrechen geschildert.',NULL,'DEU','On the Case - Unter Mordverdacht','https://json.schedulesdirect.org/20141201/image/assets/p9302274_i_h11_aa.jpg',4,NULL),('SH021893360000','Doozers sind kleine grüne Männchen, die in kleinen Gemeinden auf der ganzen Welt leben.',NULL,'DEU','Jim Hensons: Doozers','https://s3.amazonaws.com/schedulesdirect/assets/p10239013_i_v7_aa.jpg',4,NULL),('SH024923020000','Joe Martin haucht ausgemusterten Autos, Motorrädern und Booten neues Leben ein. In seiner Werkstatt in der Nähe von Austin führt er gemeinsam mit seiner Frau und seinem Buddie Shaq Restaurationen durch, die die Erwartungen seiner Kunden übertreffen.',NULL,'DEU','Car Rescue - Ran an den Rost!','https://json.schedulesdirect.org/20141201/image/assets/p12661909_i_h11_aa.jpg',4,NULL),('SH029608920000','Die 17-jährige Lucy möchte Magierin werden. Zufällig trifft sie Natsu, der bereits einer Magiergilde mit den Namen Fairy Tail angehört. Mit Unterstützung von Gray und Erza sowie Natsus Katze Happy führen sie für die Gilde Aufträge aus.',NULL,'DEU','Fairy Tail','https://json.schedulesdirect.org/20141201/image/assets/p8949678_i_h6_aa.jpg',4,NULL),('SH030556050000','Unweit der Golden Gate Brücke steht das San Francisco Memorial Hospital. Chefarzt dort ist Dr. John McIntyre, von Kollegen und Freunden `Trapper John\' genannt. Täglich kämpfen er und seine Kollegen gegen Krankheiten und den Tod.',NULL,'DEU','Trapper John, M.D.',NULL,4,NULL),('SH018281160000','Eine sechsteilige Reihe, die das Leben von bedeutenden Frauen der Weltgeschichte vorstellt.',NULL,'DEU','Frauen, die Geschichte machten','https://json.schedulesdirect.org/20141201/image/assets/p10351083_b_h6_aa.jpg',4,NULL),('SH015442510000','Gute Zutaten, unkomplizierte Zubereitung und großer Geschmack - Sterneköchin Cornelia Poletto stellt einfache und gesunde Gerichte vor, die in den Alltag passen. Mit etwas Vorbereitung lassen sich die Mahlzeiten in 30 Minuten leicht zubereiten.',NULL,'DEU','Polettos Kochschule','https://json.schedulesdirect.org/20141201/image/assets/p9145103_b_h11_aa.jpg',4,NULL),('SH034110640000','In jeder Woche stellen sich fünf unterschiedliche Friseursalonbesitzer dem Urteil der Konkurrenz. Täglich versuchen die Beautyexperten ihre Konkurrenten von ihrem Salon zu überzeugen, während wöchentlich die Austragungsstädte wechseln.',NULL,'DEU','Salonfähig - Wer macht schöner?','https://json.schedulesdirect.org/20141201/image/assets/p17797419_st_h11_aa.jpg',4,NULL),('SH022583600000','Die Polizisten einer Spezialeinheit für Jugendkriminalität werden bei ihren Einsätzen begleitet und geben einen Einblick in ihren harten Arbeitsalltag. Dabei müssen sie in teils heiklen Situationen die Täter stellen und die Opfer schützen.',NULL,'DEU','Die Straßencops - Jugend im Visier','https://s3.amazonaws.com/schedulesdirect/assets/p12088300_st_h11_aa.jpg',4,NULL),('SH021043460000','Die Sendung spiegelt das Geschehen in Veitshöchheim wieder. Michl Müller, Kabarettist aus der Rhön, unternimmt in seinen Moderationen eine Zeitreise durch 25 Jahre Fastnacht in Franken.',NULL,'DEU','Frech & Frei','https://json.schedulesdirect.org/20141201/image/assets/p11409130_b_h11_aa.jpg',4,NULL),('SH019563160000','Die Kriminalroman-Autorin Jessica Fletcher feiert ihren Erfolg auf einer Kostümparty, als es zu einem echten Mordfall kommt. Sie nimmt die Ermittlungen auf und stößt auf weitere Fälle, bei der sie ihre Kombinationsgabe zum Einsatz bringen kann.',NULL,'DEU','Mord ist ihr Hobby','https://s3.amazonaws.com/schedulesdirect/assets/p184149_i_h11_aa.jpg',4,NULL),('SH020108260000','Mitte des 22. Jahrhunderts auf der Erde: Mit Hilfe der Vulkanier wird der erste Warp-Antrieb gebaut und damit ein Raumschiff, die Enterprise NX-01, mit dem Menschen den Weltraum erkunden können. Captain Archer hat nun drei Tage Zeit, um seine Crew zusammenzustellen und seine erste Mission vorzubereiten. Denn auf der Erde wurde ein Klingone gefunden, der schwer verletzt ist und schnellstmöglich in seine Heimat gebracht werden muss. Während ihrer Raumfahrt erforscht die Besatzung die unendlichen Weiten des Weltalls und ebnet den Weg für einen interstellaren Völkerbund. Dabei stehen dem Captain sein Hund Porthos, die vulkanische Wissenschaftsoffizierin T\'Pol, der Chefingenieur Trip sowie der medizinische Offizier Dr. Phlox zur Seite.',NULL,'DEU','Star Trek: Enterprise','https://s3.amazonaws.com/schedulesdirect/assets/p184749_i_v4_aa.jpg',4,NULL),('SH014789820000','Die Reportage berichtet aus der Alltagswirklichkeit der Zuschauer, greift Themen auf, die aktuell und brisant sind, setzt sie spannend und emotional um. Sie erzählt immer aus der Perspektive der Betroffenen, ihren Lebenswegen und Schicksalen.',NULL,'DEU','ZDF.reportage','https://json.schedulesdirect.org/20141201/image/assets/p8859044_b_h11_aa.jpg',4,NULL),('SH019722060000','Die faszinierenden Landschaften von Afrika.',NULL,'DEU','Afrikas Naturparadiese','https://s3.amazonaws.com/schedulesdirect/assets/p530295_i_v4_aa.jpg',4,NULL),('SH019580930000','Die -hessenschau- ist das Regionalmagazin im Fernsehen des Hessischen Rundfunks und ist die erfolgreichste und populärste Sendung im hr-fernsehen. Täglich wird aktuell über Politik, Kultur, Wirtschaft und Unterhaltendes aus Hessen berichtet.',NULL,'DEU','hessenschau','https://s3.amazonaws.com/schedulesdirect/assets/p10911776_i_v4_aa.jpg',4,NULL),('SH003333020000','RTL-Magazin mit Hintergrundinformationen zu aktuellen Eregnissen.',NULL,'DEU','Explosiv - Weekend','https://s3.amazonaws.com/schedulesdirect/assets/p382313_st_h11_ab.jpg',4,NULL),('SH029782290000','Cricket und seine Familie ziehen vom Land in die Großstadt, was zu erst einen großen Kulturschock auslöst. Doch Cricket ist optimistisch und naiv, was ihn schnell neue Freunde finden lässt. Zusammen erleben sie viele Abenteuer in der großen Stadt.',NULL,'DEU','Big City Greens','https://s3.amazonaws.com/schedulesdirect/assets/p14788469_b_h11_aa.jpg',4,NULL),('SH022917380000','Von Aschaffenburg bis Passau, von Kempten bis Hof - Bayern hat viele Facetten. Die Reihe zeigt diese Vielfalt an bezaubernden Reisezielen, fast vergessenem Handwerk und bis heute erhaltenen Traditionen.',NULL,'DEU','Wir in Bayern','https://json.schedulesdirect.org/20141201/image/assets/p11027370_i_h11_aa.jpg',4,NULL),('SH033929710000','Es wird mal wieder scharf geschossen: Ein Mann bedroht mit einer Handfeuerwaffe im US-Bundesstaat Florida seine Familienangehörigen. Der Straftäter ist geistig verwirrt und hat sich mit den Geiseln in einem Wohnhaus verbarrikadiert.',NULL,'DEU','Body Cam 911 - Polizeieinsatz hautnah','https://json.schedulesdirect.org/20141201/image/assets/p16204847_i_h6_aa.jpg',4,NULL),('SH020080630000','Der Kurs bietet die Möglichkeit, vorhandene Englischkenntnisse aufzufrischen und zu vertiefen. Die Sendungen des Kurses sind rein englischsprachig.',NULL,'DEU','Fast Track English','https://json.schedulesdirect.org/20141201/image/assets/p11096470_st_h11_aa.jpg',4,NULL),('SH032012090000','Die Nachrichtensendung berichtet von den aktuellsten regionalen und internationalen Ereignissen. Andreas Brückner stellt eine engagierte Redaktion vor, die tagtäglich Themen recherchiert und für informativen Inhalt sorgt.',NULL,'DEU','MDR aktuell','https://json.schedulesdirect.org/20141201/image/assets/p12219300_b_v4_aa.jpg',4,NULL),('SH019855860000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus dem Münsterland.',NULL,'DEU','Lokalzeit Münsterland','https://json.schedulesdirect.org/20141201/image/assets/p11024439_b_h11_aa.jpg',4,NULL),('SH030024180000','Shouyou Hinatas beobachtet zufällig ein Spiel der Karasuno Oberschule bei den nationalen Meisterschaften im Volleyball. Sofort ist er fasziniert von dem Sport und will selbst ein erfolgreicher Spieler werden. Er gründet eine Mannschaft.',NULL,'DEU','Haikyu!!','https://json.schedulesdirect.org/20141201/image/assets/p10986000_b_h11_ac.jpg',4,NULL),('SH022280060000','In der Welt der Savanne Kenias bringt jeder Tag wichtige Erfahrungen für Lolulu und Malalua. Die Serie erzählt die Erlebnisse der beiden Massai-Kinder, zeigt ihre Herausforderungen und wie sie und ihre Familien in der Savanna überleben können.',NULL,'DEU','Die Abenteuer von Lolulu und Malalua','https://s3.amazonaws.com/schedulesdirect/assets/p11950084_i_v4_aa.jpg',4,NULL),('SH019694710000','Deutschlands erste regelmäßige Nachrichtensendung für Kinder präsentiert Themen mit aktuellem Bezug und Hintergrundinformationen perfekt für Kinder und Jugendliche aufbereitet und garantiert verständlich.',NULL,'DEU','logo! Die Welt und ich','https://json.schedulesdirect.org/20141201/image/assets/p10959077_b_h11_aa.jpg',4,NULL),('SH029173940000','In dieser Dokumentationsreihe werden die Bodenschätze, die auf der Erde natürlich vorkommen, genauer unter die Lupe genommen. Außerdem wird ihre Verwertbarkeit und ihr Einfluss auf das Leben der Menschheit detailliert betrachtet.',NULL,'DEU','Die Schätze der Erde','https://s3.amazonaws.com/schedulesdirect/assets/p15252206_st_h11_aa.jpg',4,NULL),('SH014788370000','Die neuesten Produkte aus der Welt der Diamanten erfüllen den Raum mit einem luxuriös-edlen Flair.',NULL,'DEU','Welt der Diamanten','https://json.schedulesdirect.org/20141201/image/assets/p8858238_st_h11_aa.jpg',4,NULL),('SH023708800000','Connor, Amaya und Greg sind ganz normale Kinder. Doch als sie eines Tages ihre besonderen Pyjamas bekommen und Tieramulette aktivieren, werden sie zu drei Superhelden und erleben spannende Abenteuer, bei denen sie eine Menge lernen.',NULL,'DEU','PJ Masks - Pyjamahelden','https://json.schedulesdirect.org/20141201/image/assets/p12115698_i_h11_aa.jpg',4,NULL),('SH019434560000','Das Reportagemagazin berichtet über Themen, die im Alltag von Bedeutung sind. Außerdem wirft es einen Blick auf die aktuellsten Boulevard-Nachrichten und stellt interessante Fakten verständlich dar.',NULL,'DEU','EXKLUSIV - DIE REPORTAGE','https://s3.amazonaws.com/schedulesdirect/assets/p10859251_st_h11_aa.jpg',4,NULL),('SH019672500000','Das werktägliche Kulturmagazin mischt sich in kulturelle und gesellschaftspolitische Fragen ein. `Kulturzeit\' bietet ergänzende Hintergrundinformationen, Porträts und Gespräche zu aktuellen und brisanten Fragen.',NULL,'DEU','Kulturzeit','https://s3.amazonaws.com/schedulesdirect/assets/p10950682_i_h11_aa.jpg',4,NULL),('SH022826770000','Verbrechen werden anhand von Überwachungsvideos nachgestellt. Eventuelle Lücken werden durch Interviews mit Ermittlern und Freunden und Verwandten von Tätern und Opfern gefüllt. Unterstützt wird die Rekonstruktion durch nachgestellte Szenen.',NULL,'DEU','Das Böse im Blick - Augenzeuge Kamera','https://json.schedulesdirect.org/20141201/image/assets/p11092757_st_h11_ac.jpg',4,NULL),('SH025640400000','Die Dolomiten gehören zu den markantesten Berglandschaften der Welt. Ob die Drei Zinnen, Lang- und Plattkofel oder der Rosengarten - die berühmtesten Gipfel der Gebirgsgruppe liegen in Südtirol, der nördlichsten Provinz Italiens. Im Sommer sind die Dolomiten ein Kletter- und Wanderparadies, im Winter ein Traumziel zum Skifahren. Benannt wurden sie nach dem französischen Geologen Deodàt de Dolomieu, der ihr Gestein als Erster erforschte.',NULL,'DEU','Südtirol - Die Dolomiten','https://json.schedulesdirect.org/20141201/image/assets/p13544946_i_h6_aa.jpg',4,NULL),('SH019479410000','Weil er mit seinem Leben alles andere als zufrieden ist, möchte Ryan selbiges vorzeitig beenden. Der schüchterne Ryan schließt eine Freundschaft mit dem `menschlichen\' Nachbarshund Wilfred.',NULL,'DEU','Wilfred','https://json.schedulesdirect.org/20141201/image/assets/p8668180_b_v4_ac.jpg',4,NULL),('SH033089030000',NULL,NULL,'DEU','Mr. Magoo','https://json.schedulesdirect.org/20141201/image/assets/p16671396_i_h11_aa.jpg',4,NULL),('SH021756300000','Die spannende Entdeckungsreise führt in drei sehr unterschiedliche Dörfer - das Winzerdorf Sommerach in Unterfranken, Furth in Niederbayern und Unterammergau am Fuß der Alpen.',NULL,'DEU','Bayern erleben','https://json.schedulesdirect.org/20141201/image/assets/p11734064_i_h6_aa.jpg',4,NULL),('SH015403000000','Alle Verantwortlichen und Tierpfleger im Stuttgarter Zoo wollen ihren Tieren das Leben so angenehm wie möglich machen. `Eisbär, Affe & Co.\' erzählt die Zoogeschichten aus Stuttgart.',NULL,'DEU','Eisbär, Affe & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p9126187_b_v7_ab.jpg',4,NULL),('SH019743700000','Nachmittägliches Service- und Ratgebermagazin mit Themen aus den Bereichen Haushalt, Finanzen, Handwerk, Computer, Ernährung, Recht und Gesundheit. Zahlreiche Experten diskutieren diese Themen im Studio.',NULL,'DEU','Kaffee oder Tee?','https://json.schedulesdirect.org/20141201/image/assets/p10978247_b_h11_aa.jpg',4,NULL),('SH022513700000','Sie sind die Experten ihrer Fachbereiche und kommen zum Einsatz, wenn es für andere zu gefährlich wird: Mitarbeiter verschiedener Rettungskräfte werden im Einsatz begleitet, zum Beispiel die Wasserschutzpolizei oder Feuerwehrleute.',NULL,'DEU','Auf Streife - Die Spezialisten','https://s3.amazonaws.com/schedulesdirect/assets/p12055424_st_h11_aa.jpg',4,NULL),('SH019641710000','Die Sendung beschäftigt sich mit den Themen der Promis und der Reichen und Schönen. Annemarie Warnkross nimmt die verschiedensten Ereignisse genauer unter die Lupe und scheut auch nicht davor, den Promis persönliche Fragen zu stellen.',NULL,'DEU','red','https://s3.amazonaws.com/schedulesdirect/assets/p10938653_st_h11_aa.jpg',4,NULL),('SH034255530000','Sechs Obdachlose bekommen einen Schlüssel zu einer Wohnung und die Möglichkeit zum Neuanfang. Während des Versuchs, neu durchzustarten geben sie authentische Einblicke in ihre Geschichten und erzählen, was zu ihrem gesellschaftlichen Absturz führte.',NULL,'DEU','Obdachlos - Einzug in ein neues Leben','https://json.schedulesdirect.org/20141201/image/assets/p17861389_st_h11_aa.jpg',4,NULL),('SH022240140000','Die Macher von `Drachenzähmen leicht gemacht\' präsentieren eine Serie, in der sich Hicks und Ohnezahn in riesige neue Abenteuer stürzen.',NULL,'DEU','Dragons: Auf zu neuen Ufern','https://json.schedulesdirect.org/20141201/image/assets/p11845187_i_h11_aa.jpg',4,NULL),('SH019560090000','Donald Eppes ist ein Special Agent beim FBI, der seinen Bruder, den Mathematikprofessor Charlie, bittet, ihm bei der Aufklärung seiner komplizierteren Fälle zu helfen. Don hat für seine Karriere einen Großteil seines Privatlebens opfern müssen, das sich inzwischen fast völlig um seinen Beruf dreht. Nur seine Familie ist ihm wichtiger als seine Arbeit beim FBI, vor allem Charlie, obwohl er dessen Art und Weise, wie er die Welt sieht, wohl nie verstehen wird.',NULL,'DEU','Numb3rs - Die Logik des Verbrechens','https://json.schedulesdirect.org/20141201/image/assets/p185069_i_h11_aa.jpg',4,NULL),('SH027490340000','Die Sendung berichtet aktuell, unterhaltsam und blitzschnell über wichtige Sportereignisse.',NULL,'DEU','buten un binnen mit sportblitz','https://json.schedulesdirect.org/20141201/image/assets/p14403822_st_h11_aa.jpg',4,NULL),('SH019578090000','Reportagereihe mit Dokumentationen über Menschen, die sich der Natur besonders verbunden fühlen.',NULL,'DEU','NaturNah','https://s3.amazonaws.com/schedulesdirect/assets/p10910775_b_h11_aa.jpg',4,NULL),('SH018630230000','Hinter die Kulissen gucken, Einblicke in den Zoo bekommen, die dem normalen Besucher verborgen bleiben - `Giraffe, Erdmännchen & Co.\' erzählt täglich Geschichten aus dem Zoo Frankfurt und dem Opel-Zoo. Der Zooalltag steht dabei im Mittelpunkt.',NULL,'DEU','Giraffe, Erdmännchen & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p10491459_i_h11_aa.jpg',4,NULL),('SH016395160000','`Mensch: das Magazin\' beschäftigt sich mit dem Alltag behinderter Menschen und Jugendlichen. Die Sendereihe zeigt beispielhafte Projekte, die Probleme wie die Gewaltbereitschaft an Schulen oder Drogenmissbrauch angehen.',NULL,'DEU','Menschen - das Magazin','https://json.schedulesdirect.org/20141201/image/assets/p9562536_b_h11_aa.jpg',4,NULL),('SH017219000000','Der Kriminalinspektor Robert Lewis ermittlet in Oxford, Großbritannien, und hat es mit den kniffligsten Fällen zu tun. Er erhält dabei Unterstützung von DS James Hathaway, der ihn als seinen neuen Inspektor gewählt hat.',NULL,'DEU','Lewis','https://json.schedulesdirect.org/20141201/image/assets/p429181_l_h6_aa.jpg',4,NULL),('SH032450610000','Zwei Jahre nach dem God Blader\'s Cup macht sich das wilde Kind Aiga Akaba, das in der Natur aufgewachsen ist, auf den Weg, um Gegner zu bekämpfen, um stärker zu werden und Valt Aoi zu besiegen.',NULL,'DEU','Beyblade: Burst Turbo','https://s3.amazonaws.com/schedulesdirect/assets/p15992095_b_h11_aa.jpg',4,NULL),('SH032924290000','Ein hartnäckiges, zehnjähriges Mädchen gibt Antworten auf die wichtigen Fragen des Lebens. Beispielsweise was zu tun ist, wenn man eine Jacke geschenkt bekommt, die einem nicht gefällt oder warum Karpfenfischen eine Männerdomäne ist.',NULL,'DEU','Die Regeln von Floor','https://json.schedulesdirect.org/20141201/image/assets/p15322787_i_h11_aa.jpg',4,NULL),('SH022555390000','Das internationale Fußball-Magazin `Scooore!\' mit noch mehr internationalem Fußball im Free-TV.',NULL,'DEU','Scooore!','https://json.schedulesdirect.org/20141201/image/assets/p12076631_st_h11_aa.jpg',4,NULL),('SH019578260000','Die Thundermans scheinen auf den ersten Blick eine normale Familie zu sein. Doch der Schein trügt, denn jeder der Thundermans hat eine oder mehrere Superkräfte. Phoebe besitzt die selben Superkräfte wie Max. Sie wird zum Superheld, er zum Bösewicht.',NULL,'DEU','Die Thundermans','https://json.schedulesdirect.org/20141201/image/assets/p10259786_i_v7_aa.jpg',4,NULL),('SH018433120000','Die Sendung vertieft die Informationen über tagesaktuelle Ereignisse und zeigt Zusammenhänge sowie Hintergründe. Häufig gibt es mehrere Beiträge zu einem Thema, in denen unterschiedliche Aspekte beleuchtet werden. Oft ergänzt ein Interview mit einem Experten oder ein Schaltgespräch mit einem Reporter die Filmberichte. In der Regel gibt es zum wichtigsten Thema des Tages einen Kommentar. Das Spektrum der Themen umfasst neben den aktuellen Hintergrundberichten auch längere Reportagen, die nicht an den Tag gebunden sind. Kultur und Kino runden die Sendung ab. Beiträge aus der Politik überwiegen aber in der Berichterstattung, gefolgt vom Themenkomplex Wirtschaft.',NULL,'DEU','Tagesthemen','https://s3.amazonaws.com/schedulesdirect/assets/p10414050_b_h6_aa.jpg',4,NULL),('SH029284430000','Rae ist 16 Jahre alt, wiegt 105 Kilo und interessiert sich für Musik, Rumhängen und Jungs. Das wäre nichts Außergewöhnliches, hätte sie nicht gerade einen Selbstmordversuch und vier Monate Therapie in einer psychiatrischen Klinik hinter sich.',NULL,'DEU','My Mad Fat Diary','https://json.schedulesdirect.org/20141201/image/assets/p9666347_i_h11_aa.jpg',4,NULL),('SH019562270000','Jonathan Smith kehrt als Engel auf die Erde zurück. Er erhält von Gott den Auftrag, den Menschen Liebe, Verständnis, Rücksichtnahme und Achtung beizubringen. Obwohl er überirdische Kräfte besitzt, kommt er meistens ohne sie aus.',NULL,'DEU','Ein Engel auf Erden','https://json.schedulesdirect.org/20141201/image/assets/p400821_i_h6_ab.jpg',4,NULL),('SH029154870000','Die Ninja beschützen die königliche Familie und verhindern, dass Lord Garmadon wiederbelebt wird.',NULL,'DEU','Ninjago - Garmadons Motorrad-Gang','https://json.schedulesdirect.org/20141201/image/assets/p15219501_st_h11_aa.jpg',4,NULL),('SH026684280000','Hausfrau Katie erzählt aus dem Leben ihrer normalen Familie inmitten der scheinbar perfekten anderen Hausfrauen mit ihren perfekten Kindern und Ehemännern im schicken Westport. Katie zeigt den Alltag aus ihrer Sicht und ist gnadenlos ehrlich.',NULL,'DEU','American Housewife','https://s3.amazonaws.com/schedulesdirect/assets/p12906970_i_h11_aa.jpg',4,NULL),('SH015403240000','Das Magazin für Bergsteiger - nicht nur für Spezialisten, sondern auch für ein breites Publikum.',NULL,'DEU','Bergauf - Bergab','https://s3.amazonaws.com/schedulesdirect/assets/p9126268_b_h11_aa.jpg',4,NULL),('SH019667870000','Planet Schule schlägt ein neues Kapitel auf. Das Projekt bietet modernes, mediengestütztes Lernen und Unterrichten - für Lehrer, für Schüler und Bildungsinteressierte. Dafür erweitern und aktualisieren wir kontinuierlich unser Angebot.',NULL,'DEU','Planet Schule','https://s3.amazonaws.com/schedulesdirect/assets/p10948934_b_h11_ab.jpg',4,NULL),('SH020138390000','Der Panda Po erlebt als Drachenkrieger im Tal des Friedens ein Abenteuer nach dem anderen. Die Bewohner des Tals zählen auf ihren Helden, für sie ist er Beschützer und Trainer in einem. Außerdem ist er ein gern gesehener Gast in den Restaurants.',NULL,'DEU','Kung Fu Panda','https://s3.amazonaws.com/schedulesdirect/assets/p8847447_i_v7_aa.jpg',4,NULL),('SH019577750000','Der Meeresschwamm SpongeBob Schwammkopf lebt in einer umgebauten Ananas in der Unterwasserstadt Bikini Bottom. Er ist sehr freundlich, aber auch etwas naiv. Seine Freizeit verbringt er meist mit seinem besten Freund Patrick, einem Seestern.',NULL,'DEU','SpongeBob Schwammkopf','https://s3.amazonaws.com/schedulesdirect/assets/p184854_i_v7_aa.jpg',4,NULL),('SH015402260000','`nano\' ist das wochentäglich ausgestrahlte Wissenschaftsmagazin. Die Redaktion achtet auf eine hohe Aktualität und Wissenschaftlichkeit der Beiträge ebenso wie auf den praktischen Nutzen der vorgestellten Erkenntnisse.',NULL,'DEU','nano','https://s3.amazonaws.com/schedulesdirect/assets/p9125869_i_v4_aa.jpg',4,NULL),('SH018438190000','Das Boulevardmagazin berichtet über die Highlights der aktuelle Nachrichten und Promi Ereignisse. Kamila Senjo oder Mareile Höppner moderieren die wichtigsten Themen von Heute.',NULL,'DEU','Brisant','https://json.schedulesdirect.org/20141201/image/assets/p10415610_b_h6_aa.jpg',4,NULL),('SH019700570000','Thomas Lang präsentiert Streitigkeiten zwischen Nachbarn, die sich einfach richtig auf die Nerven gehen. Dabei kommt es auch vor, dass der Streit ausartet und die Parteien zu den skurrilsten Methoden der Rache zurückgreifen.',NULL,'DEU','Höllische Nachbarn','https://json.schedulesdirect.org/20141201/image/assets/p10961320_st_h11_aa.jpg',4,NULL),('SH019768190000','Traditionelle Bräuche und Figuren aus Baden-Württemberg.',NULL,'DEU','Treffpunkt','https://json.schedulesdirect.org/20141201/image/assets/p10988039_b_h11_aa.jpg',4,NULL),('SH019561530000','Der Rechtsanwalt Ingo Lenßen untersucht mit seinem Team aus Detektiven fiktive Kriminalfälle. Dabei wird er meist mit dem Aufklären von mittelschweren Straftaten und Verbrechen beauftragt. Und manchmal gerät auch er selbst ins Visier der Verbrecher.',NULL,'DEU','Lenßen & Partner','https://json.schedulesdirect.org/20141201/image/assets/p9019903_st_h11_aa.jpg',4,NULL),('SH030833490000','Die sechs heldenhaften Hunde Chase, Marshall, Rocky, Zuma, Rubble und Skye führen mit Hilfe ihres Trainers Ryder verschiedene Missionen in ihrem Wohnort durch. Von Katzen auf Bäumen bis zu Zügen, die feststecken, ist alles dabei.',NULL,'DEU','Paw Patrol - Helfer auf vier Pfoten','https://s3.amazonaws.com/schedulesdirect/assets/p12113918_i_h11_aa.jpg',4,NULL),('SH026888200000','Der Traum vom Haus mit Blick auf einen See bleibt für viele leider aus finanziellen Gründen unerfüllt. Die Sendung begleitet Familien auf der Suche nach ihrem Traumhaus am Wasser und zeigt, dass man auch mit einem kleinen Budget fündig werden kann.',NULL,'DEU','Lakefront - Haus am See gesucht','https://json.schedulesdirect.org/20141201/image/assets/p10975488_i_h11_ab.jpg',4,NULL),('SH019560640000','Die Serie begleitet Polizisten bei ihren alltäglichen Einsätzen, die auf realen Fällen basieren. Dabei sind sie rund um die Uhr im Einsatz. Gezeigt werden Fälle von gewalttätigen Auseinandersetzungen, häuslicher Gewalt sowie Drogenmissbrauch. Die Bandbreite an Polizeiarbeit ist enorm. Sie beschränkt sich nicht nur auf die Bekämpfung von Verbrechen. Die Beamten auf Streife helfen auch verwirrten Menschen wie etwa Rentnern, die ihre Adresse vergessen haben oder Jugendlichen, die in ihrem pubertären Leichtsinn Vorbilder brauchen.',NULL,'DEU','Auf Streife','https://s3.amazonaws.com/schedulesdirect/assets/p10904248_b_v4_ab.jpg',4,NULL),('SH019738290000','Die Sendung präsentiert wissenschaftliche Ergebnisse aus Österreich und der ganzen Welt.',NULL,'DEU','Newton','https://s3.amazonaws.com/schedulesdirect/assets/p10955781_b_h11_aa.jpg',4,NULL),('SH019836710000','Todd Hoffmann und seine sechs Mann starke Crew wollen in der Wildnis Alaskas, nahe der kanadischen Grenze, nach Gold schürfen. Sie hoffen auf Reichtümer. Der Alltag der Goldsucher in der verlassenen Gegend ist jedoch alles andere als leicht.',NULL,'DEU','Die Schatzsucher - Goldrausch in Alaska','https://json.schedulesdirect.org/20141201/image/assets/p8825082_i_v4_ab.jpg',4,NULL),('SH029922140000','Die Dokumentationsreihe beleuchtet den Alltag von Hartz IV-Empfängern und anderen. Mehr und mehr Deutsche sind auf mehrere Jobs angewiesen, benötigen Unterstützung vom Amt und können sich nicht jeden Tag eine warme Mahlzeit leisten.',NULL,'DEU','Die Alltagskämpfer - ÜberLeben in Deutschland','https://s3.amazonaws.com/schedulesdirect/assets/p15639764_i_h11_aa.jpg',4,NULL),('SH034298680000',NULL,NULL,'DEU','Fashion Lunch - Find your Style!','https://json.schedulesdirect.org/20141201/image/assets/p17884864_st_h11_aa.jpg',4,NULL),('SH023406000000','Usagi Tsukino erfährt von Katze Luna, dass sie in ihrem früheren Leben eine Kriegerin war und erneut mit ihren anderen Mitstreiterinnen gegen das Böse antreten muss. Magische Kräfte verwandeln die Freundinnen in starke Kriegerinnen.',NULL,'DEU','Sailor Moon Crystal','https://json.schedulesdirect.org/20141201/image/assets/p10850384_b_h11_aa.jpg',4,NULL),('SH019569840000','Phineas Flynn und sein Stiefbruder Ferb Fletcher überlegen jeden Tag ihrer Sommerferien aufs Neue, was sie gegen die Langeweile tun können. Meist stellen sie dann verrückte Sachen an, die nicht selten zum totalen Chaos führen. Ein gefundenes Fressen für Candace, die Schwester der beiden, die keine Gelegenheit auslässt, ihre Brüder bei Mama anzuschwärzen - was ihr allerdings meist misslingt.',NULL,'DEU','Phineas und Ferb','https://s3.amazonaws.com/schedulesdirect/assets/p186178_b_v7_aa.jpg',4,NULL),('SH019808820000','Christy Plunkett bekam ihre Tochter Violet mit 16 Jahren und hat einen Sohn namens Roscoe gemeinsam mit ihrem Ex-Mann. Seit einem Jahr ist Christy nun trocken und hat immer noch schwer mit ihrer Sucht zu kämpfen. Sie arbeitet als Kellnerin in einem Restaurant und hat eine Affäre mit ihrem verheirateten Chef. Eines Tages fasst sie den Entschluss, ihr Leben umzukrempeln und besucht sogar Treffen der Anonymen Alkoholiker. Hilfe bekommt sie ausgerechnet von ihrer Mutter Bonnie. Sie war selbst alkoholsüchtig und drogenabhängig und konnte sich daher nur wenig um Tochter Christy kümmern, als die ein Kind war. Nun will sie das wiedergutmachen und versucht, das Vertrauen ihrer Tochter wiederzugewinnen. Bonnie will endlich damit anfangen, eine gute Mutter für Christy zu sein, Chaos inklusive.',NULL,'DEU','Mom','https://s3.amazonaws.com/schedulesdirect/assets/p9978206_l_h6_aa.jpg',4,NULL),('SH019561630000','Eine auf den Romanen von Caroline Graham basierende Krimiserie.',NULL,'DEU','Inspector Barnaby','https://s3.amazonaws.com/schedulesdirect/assets/p196903_b_h11_ad.jpg',4,NULL),('SH017428710000','Die Serie bietet ihren Zuschauern Eindrücke vom Leben und den Arbeitsabläufen der Crew an Bord eines Kreuzfahrtschiffes, das die schönsten Urlaubsziele der Welt ansteuert. Kapitän Morten Hansen verbreitet dabei stets gute Laune.',NULL,'DEU','Verrückt nach Meer','https://s3.amazonaws.com/schedulesdirect/assets/p9987914_b_h11_aa.jpg',4,NULL),('SH027562280000','Auf der See werden seit Jahrhunderten Schlachten und Kriege ausgetragen. Die technologische Entwicklung spielt hierbei eine große Rolle. Die Dokumentation gibt nun einen Einblick in vergangene Schlachten, Desaster und Rettungen.',NULL,'DEU','Geheimwaffe auf See','https://json.schedulesdirect.org/20141201/image/assets/p13658854_i_h6_aa.jpg',4,NULL),('SH023045890000','Der Meteorologe Sven Plöger reist zu den Orten, die das Wettergeschehen bestimmen. Zunächst besucht Plöger die Geburtsstätten der wetterbestimmenden Hoch- und Tiefdrucklagen. Teil seiner Entdeckungsreise ist eine Exkursion in die Meteorologie.',NULL,'DEU','Wo unser Wetter entsteht','https://json.schedulesdirect.org/20141201/image/assets/p12317022_b_h6_aa.jpg',4,NULL),('SH021867870000','Die Dokumentation erforscht das All auf neue Art und Weise: Mit Hilfe von CGI-Animationen werden Planeten, Monde, Schwarze Löcher, Sterne und ganze Galaxien Schicht für Schicht enthüllt. Dadurch kann ihre Struktur und ihre Herkunft erklärt werden.',NULL,'DEU','Strip the Cosmos','https://s3.amazonaws.com/schedulesdirect/assets/p11170255_i_h11_aa.jpg',4,NULL),('SH022890250000','Mitch Buchannon ist ein erfahrener Rettungsschwimmer, der mit seinem Team den Strand von Malibu überwacht. An dem stark besuchten Badestrand müssen die Rettungsschwimmer spannende Einsätze und romantische Abenteuer bestehen.',NULL,'DEU','Baywatch - Die Rettungsschwimmer von Malibu','https://json.schedulesdirect.org/20141201/image/assets/p183964_b_h6_ad.jpg',4,NULL),('SH022690770000','Die viereinhalb Freunde: Das sind Kalle, Fred, Steffi, Radieschen und der eigenwillige Hund Dandy. Zusammen bilden sie das Detektivbüro `Kalle & Co\'. Und weil Kalle die Detektei gegründet hat, ist er auch der Chef. Er will immer wieder Fälle lösen.',NULL,'DEU','4 1/2 Freunde','https://s3.amazonaws.com/schedulesdirect/assets/p12135082_b_v4_aa.jpg',4,NULL),('SH019740650000','Tiergeschichten, Naturbeobachtungen und Expeditionsberichte in umfassenden Reihen.',NULL,'DEU','natur exclusiv','https://s3.amazonaws.com/schedulesdirect/assets/p10976842_b_h11_aa.jpg',4,NULL),('SH034186420000','In der Sendung werden Solarleuchten und Solarlampen für Garten, Außen und Balkon vorgestellt.',NULL,'DEU','SOLENOVA - dekorative Solarleuchten','https://json.schedulesdirect.org/20141201/image/assets/p17829328_st_h11_aa.jpg',4,NULL),('SH019932500000','Der Kriminelle Neal Caffrey versteht es meisterhaft, seine Verfolger immer wieder auszutricksen, bis er eines Tages von dem FBI-Agenten Peter Burke festgenommen wird. Doch statt im Gefängnis zu landen, wird er zum Partner des Agenten.',NULL,'DEU','White Collar','https://json.schedulesdirect.org/20141201/image/assets/p7806806_l_h6_aa.jpg',4,NULL),('SH018485680000','Geschichten aus dem Leipziger Zoo - Alltag, Sorgen, und Erfolge der Zoobewohner und ihrer Pfleger. In erster Linie geht es natürlich um die Tiere, aber auch um die Menschen, die sie besuchen kommen und um jene, die den Zoobetrieb in Gang halten.',NULL,'DEU','Elefant, Tiger & Co','https://json.schedulesdirect.org/20141201/image/assets/p10432305_b_h6_aa.jpg',4,NULL),('SH032008990000','Die vier neugierigen Dinosaurierfreunde Rocky, Bill, Tiny und Mazu erforschen das Geheimnis des Gigantosaurus, des größten und wildesten Dinosauriers überhaupt. Zudem stellen sie sich ihren Ängsten und erleben gemeinsam viele Abenteuer.',NULL,'DEU','Gigantosaurus','https://json.schedulesdirect.org/20141201/image/assets/p16345968_b_h11_ab.jpg',4,NULL),('SH019775860000','Mit der Unterstützung seines zehnköpfigen Teams löst der Privatdetektiv Carsten Stahl zahlreiche Kriminalfälle. Seine Kollegen bilden Teams, um die Verbrecher möglichst schnell zu überführen.',NULL,'DEU','Privatdetektive im Einsatz','https://json.schedulesdirect.org/20141201/image/assets/p10991610_b_h11_ac.jpg',4,NULL),('SH014726400000','Der Alltag der Ärzte und Schwestern in der Sachsenklinik wird hauptsächlich von den Schicksalen und Leiden ihrer Patienten bestimmt. Neben der Behandlung der Menschen entladen sich Konflikte des Klinikalltags auch mal im Privatleben des Personals.',NULL,'DEU','In aller Freundschaft','https://json.schedulesdirect.org/20141201/image/assets/p8832399_b_h11_aa.jpg',4,NULL),('SH019800840000','Neues vom Büchermarkt - Neuerscheinungen, Rezensionen, Autorenlesungen und Literatur-Festivals.',NULL,'DEU','Bücherjournal','https://json.schedulesdirect.org/20141201/image/assets/p11002641_i_h11_aa.jpg',4,NULL),('SH027393590000','Zusammen mit der Archäologin Dr. Sarah Parcak macht sich der Historiker Dan Snow auf die Suche nach Überresten längst vergessener Siedlungen der Wikinger. Sie versuchen, ein neues Licht auf das Wissen über das Leben der Wikinger werfen zu können.',NULL,'DEU','Legende und Wahrheit - Die Wikinger','https://s3.amazonaws.com/schedulesdirect/assets/p12735282_i_h11_aa.jpg',4,NULL),('SH019774950000','Servicemagazin des NDR, mit Tipps und Tricks zu alltäglichen Themen.',NULL,'DEU','Mein Nachmittag','https://json.schedulesdirect.org/20141201/image/assets/p10990972_i_h11_ab.jpg',4,NULL),('SH032565910000',NULL,NULL,'DEU','Wendepunkte des Zweiten Weltkriegs','https://json.schedulesdirect.org/20141201/image/assets/p17058345_i_h11_aa.jpg',4,NULL),('SH016396210000','Live-Magazin mit landespolitischem Charakter. Ein aktueller Blick durchs Land, das Regionale steht hier im Mittelpunkt. Menschen, Land und Leute kommen zu Wort, werden unter die Lupe genommen oder porträtiert.',NULL,'DEU','drehscheibe','https://json.schedulesdirect.org/20141201/image/assets/p9562824_b_h6_ab.jpg',4,NULL),('SH019619230000','Informationen aus Gesellschaft, Kultur, Familie, Arbeit, Freizeit, Sport und Technik werden mit visuellen Mitteln für diejenigen Zuschauer/Innen verständlich gemacht, die den Ton nicht (oder nicht gut) hören können.',NULL,'DEU','Sehen statt Hören','https://json.schedulesdirect.org/20141201/image/assets/p10928012_b_h6_ab.jpg',4,NULL),('SH034259390000','Ein junges Mädchen erkrankt an Leukämie und entwickelt eine beeindruckende Charakterstärke.',NULL,'DEU','Sterben ist nicht so mein Ding!','https://json.schedulesdirect.org/20141201/image/assets/p14449400_i_h11_aa.jpg',4,NULL),('SH034194920000','Seit in vielen Handwerksberufen die Meisterpflicht Vergangenheit ist, wird gepfuscht wie nie zuvor. Für die Kunden wird das meist teuer; die Sendung verfolgt die vermeintlichen `Bauprofis\' mit versteckter Kamera bei der Arbeit.',NULL,'DEU','Aufgepasst, der Profi kommt! - Handwerk zwischen Hit und Horror','https://json.schedulesdirect.org/20141201/image/assets/p17834040_st_h11_aa.jpg',4,NULL),('SH020904420000','`Conny\' Niedrig und `Bernie\' Kuhnt sind zwei Kriminalkommissare von der Kriminalpolizei Recklinghausen. Bei den authentisch nachgespielten Ermittlungen arbeiten die beiden im Team, um die Verbrechen rund um Duisburg zu bekämpfen.',NULL,'DEU','Niedrig und Kuhnt - Kommissare ermitteln','https://json.schedulesdirect.org/20141201/image/assets/p452307_st_h11_aa.jpg',4,NULL),('SH019576310000','Fünf angehende Ärzte und ihre Mentoren arbeiten, streiten und lieben sich im Seattle Grace Hospital. Als Assistenzärzte sind Meredith Grey, Cristina Yang, George O\'Malley, Izzie Stevens und Alex Karev zwar auf viel Drama im OP-Saal vorbereitet, doch auch außerhalb der Arbeit beginnt für die jungen Praktikanten eine wilde Achterbahnfahrt. Freundschaftsdramen und die große Liebe sind vorprogrammiert, ebenso wie schmerzvolle Verluste und krankhafter Neid. Zwar sollten Emotionen die Arbeit nicht beeinflussen, doch nur allzu oft bringt ein Patient Turbulenzen in ihr Krankenhausleben.',NULL,'DEU','Grey\'s Anatomy - Die jungen Ärzte','https://json.schedulesdirect.org/20141201/image/assets/p185019_b_h11_ag.jpg',4,NULL),('SH028309320000','Tick, Trick und Track werden von ihrem Onkel Donald bei ihrem Onkel Dagobert abgegeben, damit dieser zu einem Vorstellungsgespräch gehen kann. Die drei erleben mit ihrem Onkel Dagobert viele verschiedene und spannende Abenteuer.',NULL,'DEU','DuckTales','https://json.schedulesdirect.org/20141201/image/assets/p14263798_b_h11_aa.jpg',4,NULL),('SH019923920000','Der `Hanseblick\' reist mit Rucksack, Kamerateam und vielen Fragen bis an die Außengrenzen Europas.',NULL,'DEU','Hanseblick','https://json.schedulesdirect.org/20141201/image/assets/p11050237_b_h11_aa.jpg',4,NULL),('SH019374110000','Die Moderatoren berichten über aktuelle Nachrichten und interessante Ereignisse.',NULL,'DEU','Newstime','https://s3.amazonaws.com/schedulesdirect/assets/p10838099_i_h11_ab.jpg',4,NULL),('SH027711410000','In der vierteiligen Dokumentation nehmen führende Pioniere aus dem Science-Fiction-Bereich den Zuschauer mit auf eine Zeitreise durch die Historie der Science-Fiction.',NULL,'DEU','Die Sci-Fi-Story','https://s3.amazonaws.com/schedulesdirect/assets/p11246830_i_h11_aa.jpg',4,NULL),('SH015631620000','Der Sternekoch aus Dorsten nimmt die Lebensmittelindustrie unter die Lupe.',NULL,'DEU','Der Vorkoster','https://json.schedulesdirect.org/20141201/image/assets/p9232776_i_h11_aa.jpg',4,NULL),('SH019576250000','Der rothaarige Bombenexperte und ehemalige NYPD Agent Horatio Caine ist der Leiter der CSI-Abteilung in Miami. Dort ist er gemeinsam mit seinem Team für die Sicherheit der Stadt verantwortlich. Mittels Forensik, Gentechnik und Gerichtsmedizin lösen die Beamten des CSI knifflige Fälle. Horatio ist für sein fotografisches Gedächtnis und seinen trockenen Charme bekannt. An seiner Seite ermitteln die Ballistikerin Calleigh Duquesne, der belesene Tim Speedle, DNA-Spezialistin Alexx Woods und Eric Delko, Spezialist für die Auswertung von Fingerabdrücken sowie Experte im Drogenmillieu.',NULL,'DEU','CSI: Miami','https://s3.amazonaws.com/schedulesdirect/assets/p184820_l_h6_aa.jpg',4,NULL),('SH030639760000','Die Reihe präsentiert regionale Naturporträts und international produzierte Tier- und Naturfilme.',NULL,'DEU','Wildes Europa','https://json.schedulesdirect.org/20141201/image/assets/p9127609_i_h11_aa.jpg',4,NULL),('SH019979900000','Jimmie DeRamus betreibt mit seiner Familie seit über 25 Jahren das Pfandleihhaus `Silver Dollar Pawn & Jewelry Center\' in Louisiana. Sie finden ständig neue Kostbarkeiten und seltene Gegenstände. Es werden sogar Bustouren mit Führung angeboten.',NULL,'DEU','Cajun Pawn Stars','https://json.schedulesdirect.org/20141201/image/assets/p8984592_i_v4_aa.jpg',4,NULL),('SH019714520000','Aktuelles, was die Region bewegt, News vom Tag aus Berlin und Brandenburg, Tipps für den Abend in Mark und Metropole sowie Streiflichter aus den Nachbarländern.',NULL,'DEU','rbb um 6 - Das Ländermagazin','https://json.schedulesdirect.org/20141201/image/assets/p10967016_i_h11_aa.jpg',4,NULL),('SH029695470000','Jeden Tag werden weltweit 432.000 Stunden Videoclips auf Youtube eingestellt. Mit der Videoclip-Flut wachsen auch die Zweifel, ob das, was die User untereinander austauschen, auch wirklich echt ist oder nur ein cleverer Internettrick.',NULL,'DEU','Echt oder Fake?','https://json.schedulesdirect.org/20141201/image/assets/p14262354_i_h11_aa.jpg',4,NULL),('SH019868870000','Verbindet vermeintlich trockene Literatur der großen Philosophen mit brandaktuellem Zeitgeschehen.',NULL,'DEU','Philosophie','https://json.schedulesdirect.org/20141201/image/assets/p11005508_b_h11_ab.jpg',4,NULL),('SH018556820000','Verschiedene B-Prominente ziehen in den australischen Dschungel und buhlen um die Gunst des Zuschauers. 16 Tage lang müssen sie diverse Prüfungen bestehen und gehen dabei an ihre Grenzen. Der Zuschauer entscheidet, wer am Ende `Dschungelkönig\' wird.',NULL,'DEU','Ich bin ein Star, holt mich hier raus','https://json.schedulesdirect.org/20141201/image/assets/p10458046_b_h11_aa.jpg',4,NULL),('SH024296700000','Eddie Huang und seine Familie stammen ursprünglich aus Taiwan und leben den Großteil ihres Lebens in Chinatown in Washington D.C. 1995 zieht Eddie jedoch zusammen mit seinem Vater Louis, seiner Mutter Jessica und seinen zwei Geschwistern Emery und Evan nach Orlando, Florida. Dort will seine Familie ein Restaurant mit Cowboy-Flair eröffnen. Der darauffolgende Kulturschock ist unvermeidbar. Nicht zuletzt ist der chinesische Bevölkerungsanteil Floridas zu dieser Zeit ein äußerst überschaubarer und der Rest der Bevölkerung propagiert in erster Linie westliche Werte - vom amerikanischen Traum ganz zu schweigen. Auch in der Schule und in der Nachbarschaft machen die kulturellen Unterschiede den Anfang nicht gerade leicht.',NULL,'DEU','Fresh Off the Boat','https://s3.amazonaws.com/schedulesdirect/assets/p10777606_l_h6_aa.jpg',4,NULL),('SH019842690000','Fox Mulder arbeitet als Special Agent beim FBI, hat dort aber den Ruf als Verschwörungstheoretiker inne. Als kleiner Junge hat er miterlebt, wie seine Schwester von Außerirdischen entführt wurde. Seitdem glaubt er an deren Existenz und beschäftigt sich mit paranormalen Phänomenen. Er arbeitet in der Abteilung für X-Akten, Kriminalfälle, die nicht erklärbar sind. Eines Tages bekommt er Dana Scully als Partnerin gestellt. Sie ist das Gegenteil von Mulder, skeptisch und unterkühlt. Gemeinsam arbeiten die beiden an mysteriösen Fälle, von Killer-Insekten bis hin zu Mutanten. Zeitgleich verfolgen sie die Aufdeckung einer Regierungsverschwörung, die versucht, die Existenz außerirdischen Lebens zu verschleiern.',NULL,'DEU','Akte X - Die unheimlichen Fälle des FBI','https://json.schedulesdirect.org/20141201/image/assets/p183870_b_v7_aa.jpg',4,NULL),('SH019769290000','Übertragungen von aktuellen Wettbewerben aus der Welt des Radsports.',NULL,'DEU','Radsport','https://json.schedulesdirect.org/20141201/image/assets/p361948_i_h11_aa.jpg',4,NULL),('SH029820540000','Gezeigt werden Dokumentationen zu verschiedenen Themen.',NULL,'DEU','phoenix plus','https://json.schedulesdirect.org/20141201/image/assets/p15586965_st_h11_aa.jpg',4,NULL),('SH029035350000','TV-Koch Roland Trettl heißt Singles aus ganz Deutschland in seinem Restaurant willkommen. Die Kandidaten werden je nach Vorlieben und Abneigungen gepaart und lernen sich zum ersten Mal bei einem Dinner im Restaurant kennen.',NULL,'DEU','First Dates - Ein Tisch für zwei','https://s3.amazonaws.com/schedulesdirect/assets/p15179177_st_h11_aa.jpg',4,NULL),('SH018558610000','Das Magazin zeigt von Montag bis Freitag aktuelle Nachrichten zur Mittagszeit. Die Moderatorin präsentiert Informationen aus aller Welt, mit einem Schwerpunkt auf Deutschland, und spricht außerdem über Servicethemen, Lifestyle sowie das Neueste aus der Welt der Stars und Sternchen. Abgerundet wird das Sendungsprogramm mit spannenden Reportagen, die mitunter eine solche Brisanz haben, dass sie politische und wirtschaftliche Akteure zum Handeln veranlassen, und Mini-Dokumentationen, die verblüffende Einblicke in den Alltag der Deutschen geben.',NULL,'DEU','Punkt 12 - Das RTL-Mittagsjournal','https://s3.amazonaws.com/schedulesdirect/assets/p10458783_st_h11_ab.jpg',4,NULL),('SH019579470000','Verbrauchermagazin, das sich auf Produkttests und die kritische Berichterstattung konzentriert. `Markt\' gibt praktische Tipps in allen Alltagsfragen, deckt dubiose Geschäftspraktiken auf und mischt sich ein, wenn Zuschauer Ärger mit Firmen haben.',NULL,'DEU','Markt','https://json.schedulesdirect.org/20141201/image/assets/p10911289_b_h11_aa.jpg',4,NULL),('SH019855780000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Aachen.',NULL,'DEU','Lokalzeit aus Aachen','https://s3.amazonaws.com/schedulesdirect/assets/p11024416_b_v7_ab.jpg',4,NULL),('SH019740940000','Diese Sendung befasst sich mit unterschiedlichen Themen aus Bayern und den Nachbarländern.',NULL,'DEU','Unter unserem Himmel','https://s3.amazonaws.com/schedulesdirect/assets/p10976922_b_h11_aa.jpg',4,NULL),('SH030277930000','Acht attraktive Singles wollen sich auf einer Insel näherkommen und einen romantischen Urlaub im Paradies miteinander verbringen. Doch die Idylle wird gestört, als sämtliche Ex-Partner auftauchen und die Datingshow ordentlich aufmischen.',NULL,'DEU','Ex on the Beach US','https://json.schedulesdirect.org/20141201/image/assets/p15326276_i_h11_aa.jpg',4,NULL),('SH023583940000','Reporter Daniel Aßmann recherchiert Kosten des Alltags und befragt Fachleute. Er erfährt, wie hoch die Spannen zwischen Herstellerpreisen und den Preisen im Geschäft sein können. Er geht in Fabriken und Verkaufsräume, um sich zu informieren.',NULL,'DEU','Ausgerechnet','https://json.schedulesdirect.org/20141201/image/assets/p12560582_b_h6_aa.jpg',4,NULL),('SH019855850000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Ostwestfalen-Lippe.',NULL,'DEU','Lokalzeit OWL','https://json.schedulesdirect.org/20141201/image/assets/p11024436_b_h6_ab.jpg',4,NULL),('SH034152480000','In der Sendung treten wöchentlich fünf Restaurantchefs gegeneinander an. Es gilt zu beweisen, welches Lokal das beste ist. Kriterien sind unter anderem das Essen, die Atmosphäre und der Service. Dem Gewinner winken 5.000 Euro Preisgeld.',NULL,'DEU','Mein Lokal, Dein Lokal - Der Profi kommt','https://json.schedulesdirect.org/20141201/image/assets/p10451847_st_h11_ad.jpg',4,NULL),('SH025542980000','Der riesige Grizzlybär Grizzy wird von einer Horde nervtötender Lemminge geneckt.',NULL,'DEU','Grizzy und die Lemminge','https://s3.amazonaws.com/schedulesdirect/assets/p13330553_i_v7_aa.jpg',4,NULL),('SH026423900000','Der Golfstrom ist die mächtigste Strömung der Welt. Er transportiert fast hundertmal so viel Wasser wie alle Flüsse der Welt zusammen. Die Reihe begleitet den Kreislauf von Kuba an der Ostküste der USA entlang über Neufundland bis zum Polarkreis.',NULL,'DEU','Golfstrom','https://s3.amazonaws.com/schedulesdirect/assets/p13924473_st_h11_aa.jpg',4,NULL),('SH019468800000','Das Magazin informiert die Zuschauer etwa in Sachen Politik, Kultur und Alltagsleben.',NULL,'DEU','MDR Thüringen Journal','https://json.schedulesdirect.org/20141201/image/assets/p10871952_b_h6_ab.jpg',4,NULL),('SH019711930000','Autos sind ihre Leidenschaft: Mastermind Richard Rawlings und Profi-Mechaniker Aaron Kaufman suchen in Hinterhöfen und staubigen Garagen nach betagten Oldtimern, die sie in ihrer Werkstatt restaurieren können. Ihre Mission: Rost in Gold verwandeln!',NULL,'DEU','Fast N\' Loud','https://s3.amazonaws.com/schedulesdirect/assets/p9256222_l_h6_aa.jpg',4,NULL),('SH019671360000','In den USA mieten manche Privatpersonen Lagerräume für ihre Sachen an. Nach drei Monaten unbezahlter Miete kommt der Inhalt des Lagers zur Auktion. Allerdings dürfen die Interessenten den Lagerraum nur kurz von außen sehen, bevor sie bieten.',NULL,'DEU','Storage Wars - Die Geschäftemacher','https://json.schedulesdirect.org/20141201/image/assets/p8354064_i_h6_ab.jpg',4,NULL),('SH014788530000','Die Experten präsentieren ihnen die neuste Kollektion des Mode Labels `Men`s Touch\'.',NULL,'DEU','Men\'s Touch','https://json.schedulesdirect.org/20141201/image/assets/p8858314_st_h11_aa.jpg',4,NULL),('SH026088950000','Die Sendung zeigt die neuesten Nachrichten aus dem Südwesten, mit Schwerpunkt Rheinland-Pfalz.',NULL,'DEU','SWR Aktuell Rheinland-Pfalz','https://s3.amazonaws.com/schedulesdirect/assets/p13749524_b_v4_aa.jpg',4,NULL),('SH019988890000','Die Plantagenets war mit über 300 Jahren auch am längsten herrschende königliche Dynastie Englands.',NULL,'DEU','Plantagenets - Kampf der Könige','https://json.schedulesdirect.org/20141201/image/assets/p10608868_i_v4_aa.jpg',4,NULL),('SH020082860000','In dieser Talkshow beantworten der Moderator und unterschiedlichen Experten die Fragen der Anrufer.',NULL,'DEU','Tagesgespräch',NULL,4,NULL),('SH023278020000','Die Dokumentationsreihe beschäftigt sich mit den höchsten und beeindruckendsten Hochhäusern.',NULL,'DEU','Dem Himmel entgegen - Hochhäuser der Welt','https://json.schedulesdirect.org/20141201/image/assets/p12420442_b_h6_aa.jpg',4,NULL),('SH019576780000','Ben L. Matlock ist ein erfolgreicher Anwalt, der auch als Detektiv arbeitet. Unterstützt wird er dabei von dem jungen Privatdetektiv Tyle Hudson und Tochter Charlene. Mit Beobachtungsvermögen lösen sie selbst die aussichtslosesten Fälle.',NULL,'DEU','Matlock','https://s3.amazonaws.com/schedulesdirect/assets/p184228_i_v7_aa.jpg',4,NULL),('SH027109970000','Fünf Frauen erzählen Geschichten über Zwischenfälle und Anekdoten aus ihrem herausfordernden Alltag als Truckerfahrerinnen, der von Zeitdruck, dem Fernfahrerleben und der Familie bestimmt wird.',NULL,'DEU','Trucker Babes - 400 PS in Frauenhand','https://s3.amazonaws.com/schedulesdirect/assets/p14224538_st_h11_aa.jpg',4,NULL),('SH016520760000','Das Dokumentationsformat hat den Anspruch, gesellschaftlich und politisch relevante Themen aufzugreifen. Dabei soll, auch mit investigativen Ansätzen, immer ein direkter Bezug zum Alltag der Zuschauer hergestellt werden.',NULL,'DEU','ZDFzoom','https://json.schedulesdirect.org/20141201/image/assets/p9610305_b_h6_aa.jpg',4,NULL),('SH020303920000','In den kältesten Regionen Nordamerikas gibt es eine der ungewöhnlichsten Transportbranchen der Welt. In diesen Gegenden können einige Orte und Firmen nur innerhalb weniger Monate mit Fahrzeugen erreicht werden - die Stunde der `Ice Road Truckers\'.',NULL,'DEU','Ice Road Truckers - Gefahr auf dem Eis','https://s3.amazonaws.com/schedulesdirect/assets/p185608_i_v7_ab.jpg',4,NULL),('SH017428530000','Dokumentationsreihe, in der die Autoren des Senders jeweils einem konkreten gesellschaftlichen Thema auf den Grund gehen. Die Reihe zeigt dabei `die Rechercheschritte, bietet Lösungen an und unterstützt so die Orientierung in einer komplexeren Welt\'.',NULL,'DEU','45 Min','https://json.schedulesdirect.org/20141201/image/assets/p9987883_b_h11_ab.jpg',4,NULL),('SH020109010000','Marisol Duarte ist eigentlich eine College-Professorin am College in Los Angeles. Als ihr Sohn beschuldigt wird, ein Zimmermädchen ermordet zu haben, startet sie eigene Ermittlungen, da sie an seine Unschuld glaubt. Sie fängt an, als Zimmermädchen bei der Familie Stappord zu arbeiten, um dort undercover nach dem wahren Mörder zu suchen. Schon bald freundet sie sich mit den Bediensteten Rosie Falta, Carmen Luna und Zoila Diaz an und lernt mehr und mehr über das Leben der Schönen und Reichen in Beverly Hills kennen. Schnell wird klar, dass beinahe jeder Bewohner der Siedlung eine Leiche im Keller, eine Affäre am Laufen oder andere schmutzige Geheimnisse hat.',NULL,'DEU','Devious Maids','https://json.schedulesdirect.org/20141201/image/assets/p9493546_l_h6_aa.jpg',4,NULL),('SH019752360000','Die sechs heldenhaften Hunde Chase, Marshall, Rocky, Zuma, Rubble und Skye führen mit Hilfe ihres Trainers Ryder verschiedene Missionen in ihrem Wohnort durch. Von Katzen auf Bäumen bis zu Zügen, die feststecken, ist alles dabei.',NULL,'DEU','PAW Patrol','https://s3.amazonaws.com/schedulesdirect/assets/p10077400_b_v7_ab.jpg',4,NULL),('SH019742880000','Spektakuläre Aufnahmen aus dem Weltall im Nachtprogramm des BR. Die schönste Serie, die es zur Zeit im Fernsehen gibt, befand der Spiegel, als am 1. Juni 1994 im Nachtprogramm des Bayerischen Fernsehens die Space Night das erste Mal auf Sendung ging.',NULL,'DEU','Space Night','https://s3.amazonaws.com/schedulesdirect/assets/p10977813_b_h11_aa.jpg',4,NULL),('SH031111020000','Dokureihe über so liebliche Themen wie Kriegsführung, Evolution der Waffentechnik, megalomanische Maschinen und die generelle Kreativität des Menschen wenn es darum geht, wie man andere am effektivsten töten könnte.',NULL,'DEU','Hightech-Waffen','https://json.schedulesdirect.org/20141201/image/assets/p16313796_i_h11_aa.jpg',4,NULL),('SH023839470000','Die Dokumentationsserie gibt einen Einblick in die Entwicklung berühmt-berüchtigter Führer der Geschichte, die sich von scheinbar normalen Menschen in gewissenlose Monster verwandelten.',NULL,'DEU','Despoten','https://json.schedulesdirect.org/20141201/image/assets/p11850102_b_h6_ae.jpg',4,NULL),('SH027020390000','Der kanadische Chefkoch Roger Mooking reist durch die USA, um alles über das Barbecue zu lernen. Er möchte verstehen, was Amerikaner daran so fasziniert, warum es sich so großer Beliebtheit erfreut und worauf es wirklich ankommt.',NULL,'DEU','Man Fire Food - Barbecue Roadtrip durch die USA','https://json.schedulesdirect.org/20141201/image/assets/p9389343_i_h11_ad.jpg',4,NULL),('SH027538200000','Der Alltag in der Wildnis ist für Tiere von ständigem Kampf geprägt. Um Nahrung zu finden und das Überleben ihrer Jungen zu sichern, wenden Tiere zahlreiche Strategien, Taktiken und Tricks an.',NULL,'DEU','Die Waffen der Tiere','https://json.schedulesdirect.org/20141201/image/assets/p12876863_i_v4_aa.jpg',4,NULL),('SH018661100000','Dr. Temperance `Bones\' Brennan ist eine grandiose forensische Anthropologin am staatlichen Jeffersonian Institute in Washington. Der Umgang mit ihren Mitmenschen fällt ihr allerdings recht schwer. Gemeinsam mit dem Ermittler und ehemaligen Scharfschützen Seeley Booth untersucht sie für das FBI Fälle, die einige Jahrzehnte oder noch weitaus länger zurückliegen. Aus diesem Grund sind die Beteiligten meist schon tot und Knochen sind oft die einzigen Zeugen.',NULL,'DEU','Bones - Die Knochenjägerin','https://json.schedulesdirect.org/20141201/image/assets/p185129_i_h11_ae.jpg',4,NULL),('SH024645230000','Die Sendung berichtet im Wochenrückblick von den wesentlichen Themen und Geschichten aus Hessen.',NULL,'DEU','maintower weekend','https://json.schedulesdirect.org/20141201/image/assets/p13050135_b_h6_aa.jpg',4,NULL),('SH023893950000','Etienne Bell beschäftigt sich in der Nachrichtensendung mit Themen rund um die Gründerszene. In jeder Folge stellt er ein anderes Startup-Unternehmen vor, wirft einen Blick hinter die Kulissen und spricht mit den Gründern.',NULL,'DEU','Startup News','https://s3.amazonaws.com/schedulesdirect/assets/p12708422_st_h11_aa.jpg',4,NULL),('SH025063190000','Ärzte und Pflegepersonal eines Krankenhauses geben Einblick in ihren beruflichen Alltag. Doch neben den professionellen Höhen und Tiefen werden auch persönliche Schicksale dokumentiert. Gelegentlich muss die Polizei zur Unterstützung gerufen werden.',NULL,'DEU','Klinik am Südring','https://s3.amazonaws.com/schedulesdirect/assets/p13254823_st_h11_aa.jpg',4,NULL),('SH034194680000','Flüsse, Kanäle und Seengebiete prägen seit Jahrhunderten die Kultur Europas. Unterwegs auf Wasserwegen entdeckt die Dokumentationsreihe fünf europäische Regionen vom Wasser aus. Es geht von der Camargue bis ins französische Zentralmassiv.',NULL,'DEU','Stromaufwärts! Europas Wasserwege','https://json.schedulesdirect.org/20141201/image/assets/p17833902_st_h11_aa.jpg',4,NULL),('SH029913070000','Olivia ist nach Heartlake City gezogen und versucht sich darin, neue Kontakte zu knüpfen. Ihr erster neuer Freund ist ein Welpen, das sie und den halben Ort zeimlich auf Trab hält. Währenddessen begegnet sie auch vier Mädchen.',NULL,'DEU','Friends - Freundinnen auf Mission','https://s3.amazonaws.com/schedulesdirect/assets/p15596354_b_h11_ac.jpg',4,NULL),('SH019694470000','Magazin für Vorschulkinder, das seine Zuschauer einlädt, zu den Themen einer Sendung zu malen und zu basteln. Für ausgewählte Einsendungen gibt es eine Online-Galerie, in der die Fans die Bilder von Kindern bestaunen können.',NULL,'DEU','ENE MENE BU - und dran bist du','https://json.schedulesdirect.org/20141201/image/assets/p10958956_b_h6_aa.jpg',4,NULL),('SH030923770000','Die kleine Lokomotive Thomas und seine Freunde erleben spannende Abenteuer auf der Insel Sodor.',NULL,'DEU','Thomas & seine Freunde','https://json.schedulesdirect.org/20141201/image/assets/p15865104_i_h11_aa.jpg',4,NULL),('SH019855800000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Bonn.',NULL,'DEU','Lokalzeit aus Bonn','https://s3.amazonaws.com/schedulesdirect/assets/p11024418_b_v7_ab.jpg',4,NULL),('SH019647440000','Der Häusermarkt in Phoenix, Arizona, boomt und ist dementsprechend hart umkämpft. Immobilien-Experten liefern sich bei Auktionen heiße Bietwettkämpfe mit der Konkurrenz, um die besten Objekte zu ergattern - und diese dann mit Gewinn zu verkaufen.',NULL,'DEU','House Hunters - Die Immobilien-Jäger','https://json.schedulesdirect.org/20141201/image/assets/p9290257_i_h6_aa.jpg',4,NULL),('SH019559820000','Der erfolgreiche und angesehene Krimiautor und alleinerziehender Vater Richard Castle stellt schockiert fest, dass zwei Morde tatsächlich nach dem Vorbild seines Romans verübt wurden. Von da an will er nicht nur über erfundene Verbrechen schreiben, sondern der Polizei und insbesondere der Ermittlungsbeamtin Kate Beckett bei der Aufklärung verschiedener Fälle helfen. Die beiden bilden ein ausgesprochen effektives Ermittlerteam, auch wenn Castle eine Auge auf Kate geworfen hat, die gegen seinen Charme immun zu sein scheint.',NULL,'DEU','Castle','https://json.schedulesdirect.org/20141201/image/assets/p188601_i_h6_ac.jpg',4,NULL),('SH019360070000','Im Leben der Familie Simpson ist immer etwas los. Der liebenswerte, aber vom Pech verfolgte, schusselige und ziemlich faule Vater Homer Simpson arbeitet in einem Atomkraftwerk und versucht, seine Familie bestmöglich über Wasser zu halten. Seine Frau Marge ist als Mutter und Hausfrau die gute Seele im Hause Simpson und versucht stets, sowohl in der Familie als auch in der Gesellschaft die moralischen Grundwerte zu verbessern. Die Eltern haben alle Hände voll zu tun mit ihren drei Kindern. Bei dem zehnjährigen Bart weiß man nie, welchen Streich er als nächstes ausheckt. Die achtjährige hochintelligente und ehrgeizige Lisa ist eine Weltverbesserin, die in der Schule oft als Streber gehänselt wird. Vervollständigt werden die Simpsons von Baby Maggie. Das Leben der Familie und der anderen Bewohner der US-Kleinstadt Springfield ist geprägt vom alltäglichen Chaos und ganz normalen Wahnsinn der Gesellschaft.',NULL,'DEU','Die Simpsons','https://s3.amazonaws.com/schedulesdirect/assets/p183872_i_h11_aa.jpg',4,NULL),('SH018558660000','Deutschlands Boulevard-Sendung Nummer eins berichtet informativ, unterhaltsam und ehrlich über die unterschiedlichsten Themenbereiche und ist dabei humorvoll, provokant und investigativ. Dabei berichtet die Moderation stets über aktuelle Themen, wie etwa über Mietnomaden in Mallorca, Behördenpannen in der Justizvollzugsanstalt oder die Knöllchen-Quote bei Politessen und Polizisten. Das Magazin begleitet außerdem Singles bei ihrer Partnersuche, führt Wahrheitstests durch und unterstützt Dorfbewohner beim Abnehmen.',NULL,'DEU','Explosiv - Das Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p10458792_st_h11_ab.jpg',4,NULL),('SH027570840000','Marinette wird von ihrer Mutter aufs Land geschickt, um bei ihren Großeltern und ihrer Tante Susan zu wohnen. Das Mädchen sträubt sich vorerst gegen alles, was das neue Leben mit sich bringt. Doch dann findet sie Gefallen an den täglichen Abenteuern.',NULL,'DEU','Marinette','https://json.schedulesdirect.org/20141201/image/assets/p13614769_i_h11_aa.jpg',4,NULL),('SH028055310000','Die Sendung befasst sich mit den zentralen Fragen und Entwicklungen der Demokratie in einer unruhigen Welt. Sie geht über die Aktualität hinaus und hinterfragt unter anderem Begriffe, die täglich in den Nachrichten vorkommen.',NULL,'DEU','alpha-Demokratie','https://json.schedulesdirect.org/20141201/image/assets/p14717500_st_h11_aa.jpg',4,NULL),('SH031826890000','Es werden Themen rund um Verbraucher, Gesundheit, Ernährung, Reise, Haus und Garten beleuchtet. Die Sendung gibt Ausflugs- sowie Freizeittipps und geht unter anderem der Frage nach, welche Produkte und Dienstleistungen etwas taugen.',NULL,'DEU','Die Ratgeber','https://json.schedulesdirect.org/20141201/image/assets/p16692178_st_h11_ab.jpg',4,NULL),('SH014787790000','Die Experten dieser Sendung präsentieren Tag- und Nachtwäsche von Little Rose.',NULL,'DEU','Little Rose','https://json.schedulesdirect.org/20141201/image/assets/p8858022_st_h11_aa.jpg',4,NULL),('SH024956310000','Die simulierte Echtheit von handgemachten Diamanten und Edelsteinen lässt die Brillanten funkeln.',NULL,'DEU','Diamonique','https://json.schedulesdirect.org/20141201/image/assets/p226935_st_h11_aa.jpg',4,NULL),('SH014872140000','Die Hautpflegeprodukte von Dr. Perricone bekämpfen wirkungsvoll alle Zeichen von Hautalterung.',NULL,'DEU','Dr. Perricone: Das Rezept für gutes Aussehen','https://json.schedulesdirect.org/20141201/image/assets/p8892712_st_h11_ab.jpg',4,NULL),('SH026464760000','Johannes B. Kerner versammelt vier der besten und bekanntesten Köche des Landes bei sich im Studio. Sie kochen wöchentlich jeweils ein Gericht eines viergängigen Menüs und stellen sich der strengsten Jury des Landes: sich selbst.',NULL,'DEU','Kerners Köche','https://s3.amazonaws.com/schedulesdirect/assets/p13945019_st_h11_aa.jpg',4,NULL),('SH019580070000','Tägliches Boulevard-Magazin im hr-Fernsehen.',NULL,'DEU','maintower','https://json.schedulesdirect.org/20141201/image/assets/p10911548_b_h11_aa.jpg',4,NULL),('SH019461870000','Das Mittagsmagazin informiert über Themen aus der Region, Deutschland und der ganzen Welt.',NULL,'DEU','MDR um 2','https://json.schedulesdirect.org/20141201/image/assets/p10869363_b_h11_aa.jpg',4,NULL),('SH018556790000','Verschiedene Sängerinnen und Sänger wollen den Titel des neuen Superstars. Dabei müssen sie mehrere Runden überstehen, bei denen die Jury über ihr Weiterkommen entscheidet. Sobald sie es in die Motto-Shows schaffen, entscheidet das Publikum.',NULL,'DEU','Deutschland sucht den Superstar','https://s3.amazonaws.com/schedulesdirect/assets/p10458032_st_h11_aa.jpg',4,NULL),('SH019650350000','Das investigative Magazin informiert und gibt zahlreiche Tipps, um den Verbraucher zu schützen. Dabei werden Firmen und Betriebe genauer unter die Lupe genommen und die neuesten Produkte getestet. Auch Tricks von Betrügern werden erklärt.',NULL,'DEU','AKTE','https://s3.amazonaws.com/schedulesdirect/assets/p9173590_st_h11_aa.jpg',4,NULL),('SH015442760000','Die Bewohner der Lindenstraße kommen aus allen gesellschaftlichen Schichten. Die bunten Charaktere erzählen ihre Geschichten, die von Liebe, Ehe und Tod sowie von Homosexualität, Drogenmissbrauch und Gewalt geprägt sind.',NULL,'DEU','Lindenstraße','https://json.schedulesdirect.org/20141201/image/assets/p9145197_b_h6_aa.jpg',4,NULL),('SH028765600000','Polizisten und andere Ermittler werfen einen Blick zurück auf Ereignisse in ihrem Berufsleben. Unter anderem erzählen sie von spektakulären Verfolgungsjagden, sprechen über unvorhergesehene Geständnisse und dreiste Betrugsfälle.',NULL,'DEU','Achtung Kontrolle! Wir kümmern uns drum','https://s3.amazonaws.com/schedulesdirect/assets/p3592113_i_h11_ab.jpg',4,NULL),('SH019855810000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Südwestfalen.',NULL,'DEU','Lokalzeit Südwestfalen','https://s3.amazonaws.com/schedulesdirect/assets/p11024424_b_h11_aa.jpg',4,NULL),('SH016391700000','Viele Ereignisse des 20. Jahrhunderts sind nicht bis ins letzte geklärt. Noch immer gibt es spannende Fragen vergangener Jahrzehnte. Das Magazin im ZDF, enthüllt Geheimnisse der Geschichte.',NULL,'DEU','ZDF-History','https://s3.amazonaws.com/schedulesdirect/assets/p9561670_b_h11_af.jpg',4,NULL),('SH022805910000','Die Krankenschwester Anna rettet im Januar 1945 einen in Dresden abgestürzten Piloten, ohne zu wissen, wer er ist. Sie glaubt, er sei ein Deserteur und versteckt ihn sogar vor der Gestapo. Irgendwann bemerkt sie, dass sie Gefühle für ihn entwickelt.',NULL,'DEU','Dresden','https://json.schedulesdirect.org/20141201/image/assets/p370752_b_h6_aa.jpg',4,NULL),('SH033280480000',NULL,NULL,'DEU','Der Zweite Weltkrieg in Zahlen','https://s3.amazonaws.com/schedulesdirect/assets/p17221985_i_h11_aa.jpg',4,NULL),('SH019750050000','Unglaubliche Geschichten, die sich hinter den Kulissen des scheinbar Alltäglichen ereignen.',NULL,'DEU','MENSCH LEUTE','https://json.schedulesdirect.org/20141201/image/assets/p10980370_b_h11_aa.jpg',4,NULL),('SH019764290000','Dramatische Liebesgeschichten vor den schönen Kulissen der norwegischen Fjorden.',NULL,'DEU','Liebe am Fjord','https://json.schedulesdirect.org/20141201/image/assets/p9477774_i_h6_aa.jpg',4,NULL),('SH034195700000','Eine historische Entdeckungsreise durch die Städte Deutschlands erzählt deren Geschichten. Jedes Bauwerk, die Art und Weise, wie Straßen und Parks angelegt sind, und jeder große Platz ist beladen mit einer geschichtsträchtigen Vergangenheit.',NULL,'DEU','1945 - Unsere Städte','https://json.schedulesdirect.org/20141201/image/assets/p17834416_st_h11_aa.jpg',4,NULL),('SH019462120000','Die MDR-Wetterfrösche werfen einen Blick auf das aktuelle Wetter und die Aussichten.',NULL,'DEU','Wetter für 3','https://json.schedulesdirect.org/20141201/image/assets/p10869451_b_h11_ab.jpg',4,NULL),('SH028382600000','Eine Investmentbankerin arbeitet nach Empfehlung ihrer Ex-Chefin bei einer Bank in Frankfurt. Der Druck auf Jana nimmt rasant zu: Ein Geschäft muss rechtzeitig abgeschlossen werden, während einzelne Teammitglieder sich gegen sie wenden.',NULL,'DEU','Bad Banks','https://s3.amazonaws.com/schedulesdirect/assets/p14910379_st_h11_aa.jpg',4,NULL),('SH017030430000','Das Leben in einer Berliner WG bringt viel Drama mit sich. Liebe, Eifersucht, und Partys stehen für die Bewohner an erster Stelle. Die Charaktere, die zusammentreffen, können unterschiedlicher nicht sein und dennoch leben sie unter einer Decke.',NULL,'DEU','Berlin - Tag & Nacht','https://s3.amazonaws.com/schedulesdirect/assets/p9805853_st_h11_aa.jpg',4,NULL),('SH018486130000','Dr. Kleist, seine Kinder aus erster Ehe und seine neue Frau erleben die Höhen und Tiefen des Lebens. Ihr Familienalltag ist mit Problemen, Sorgen, aber auch Emotionen und Freude gespickt. Dabei sorgen vor allem die Kinder für Aufregung.',NULL,'DEU','Familie Dr. Kleist','https://s3.amazonaws.com/schedulesdirect/assets/p10432439_i_v7_aa.jpg',4,NULL),('SH019749920000','Menschen berichten, was ihnen ihr Glaube bedeutet und wie sie zu Gott gefunden haben. Diese Menschen leben ihren Glauben oft durch ihre Taten und sind in christlichen Einrichtungen tätig oder betreuen Projekte. Davon erzählen sie in der Talksendung.',NULL,'DEU','Hautnah - Gott mitten im Leben',NULL,4,NULL),('SH016398190000','Die wöchentliche Nachrichtensendung wirft einem Blick auf das aktuelle Geschehen in Europa mit Meldungen von Politik, Wirtschaft, Sport und Kultur.',NULL,'DEU','heute - in Europa','https://json.schedulesdirect.org/20141201/image/assets/p9563644_i_h6_aa.jpg',4,NULL),('SH017844120000','Der Astrophysiker Harald Lesch widmet sich komplexen wissenschaftlichen Fragen, um die Antworten möglichst verständlich und humorvoll wiederzugeben. Dabei geht er auch auf Bemerkungen seines Kameramannes ein, der manchmal nachhaken muss.',NULL,'DEU','Frag den Lesch','https://json.schedulesdirect.org/20141201/image/assets/p10158783_i_h6_aa.jpg',4,NULL),('SH034320830000','Eine Gruppe von jungen Teenagern entdeckt die Wildnis. Doch