rgt die Zuschauer mit Nachrichten und Berichten aus Köln.',NULL,'DEU','Lokalzeit aus Köln','https://json.schedulesdirect.org/20141201/image/assets/p11024414_b_h11_ab.jpg',4,NULL),('SH022087220000','Jeweils von einem prominenten Gast unterstützt, stellen sich die Teamkapitäne Bernhard Hoëcker und Elton den Fragen von Moderator Kai Pflaume. Es gilt, Fragen aus Wissenschaft, Tierwelt und dem täglichen Leben zu beantworten, um Geld zu erspielen.',NULL,'DEU','Wer weiß denn sowas?','https://json.schedulesdirect.org/20141201/image/assets/p11873328_b_h11_aa.jpg',4,NULL),('SH003331930000','In der Kölner Schillerallee 10, einem Wohn- und Geschäftshaus im Stadtteil Ehrenfeld, findet das ereignisreiche Alltagsleben mehrerer Generationen statt. Ausgehend von der Bäckerei und Konditorei der Familie Weigel nehmen die Geschichten um Freundschaft, Liebe, Intrigen und geplatzte Träume ihren Lauf. Dabei steht die Familie Weigel, die eine Konditorei im Erdgeschoss betreibt und mit drei Generationen im Haus lebt, im Mittelpunkt. Unterschiedliche Familien ziehen in das Haus in der Schillerallee ein und aus, vor allem die jungen Bewohner des Dachgeschosses wechseln oft.',NULL,'DEU','Unter uns','https://json.schedulesdirect.org/20141201/image/assets/p522053_b_h11_ac.jpg',4,NULL),('SH018438330000','Die Folgen behandeln jeweils einen Beitrag, in dem einer kindlichen Frage auf den Grund gegangen wird, und zeigen kurze Zeichentrick-Clips. Groß und Klein erfreuen sich an den Lach- und Sachgeschichten.',NULL,'DEU','Die Sendung mit der Maus','https://s3.amazonaws.com/schedulesdirect/assets/p10415641_i_v4_aa.jpg',4,NULL),('SH026828440000','Die Sendung hilft, Französisch zu lernen und das Wissen wieder aufzufrischen.',NULL,'DEU','Alors parle!','https://json.schedulesdirect.org/20141201/image/assets/p13178635_st_h11_aa.jpg',4,NULL),('SH019560670000','Alexander Hold ist Richter am Amtsgericht in Kempten. Täglich muss er Entscheidungen treffen, die das Leben verschiedener Menschen beeinflussen und verändern. Dabei ist er für das ganze Spektrum der Strafbarkeit zuständig.',NULL,'DEU','Richter Alexander Hold','https://json.schedulesdirect.org/20141201/image/assets/p881803_st_h11_aa.jpg',4,NULL),('SH017295140000','Die Design-Reihe stellt außergewöhnliche Architektur und Design-Klassiker vor. Alles dreht sich um starke Formen, die in Sammlungen, Ausstellungen, Museumsbauten oder bei alltäglichen Gebrauchsgegenständen zu finden sind.',NULL,'DEU','zdf.formstark','https://s3.amazonaws.com/schedulesdirect/assets/p9935498_st_h11_aa.jpg',4,NULL),('SH030672130000','Die achtjährigen Freunde Mats und Malika kommen jeden Tag zu spät zur Schule. Dafür erleben sie auf ihrem Schulweg witzige Abenteuer. Fraglich ist, ob ihre Lehrer ihnen die Begegnungen mit Monstern, Geheimagenten und wilden Tieren abnehmen?',NULL,'DEU','Voll zu spät!','https://json.schedulesdirect.org/20141201/image/assets/p15427924_i_h11_aa.jpg',4,NULL),('SH006839480000','`Um Himmels Willen\' spielt im fiktiven niederbayerischen Städtchen Kaltenthal. Hier dreht sich alles um die Dauerfehde zwischen Oberbürgermeister Wolfgang Wöller und der Nonne Schwester Lotte aus dem örtlichen Kloster.',NULL,'DEU','Um Himmels Willen','https://json.schedulesdirect.org/20141201/image/assets/p520236_i_h11_ab.jpg',4,NULL),('SH026720130000','Die drei Komikerinnen Annett Fleischer, Isabell Polak und Manuela Wisbeck nehmen die typischen Verhaltensweisen von Männern aufs Korn. Sie spielen ahnungslosen Männern Streiche, die von versteckten Kameras aufgenommen werden.',NULL,'DEU','Böse Mädchen','https://json.schedulesdirect.org/20141201/image/assets/p14050287_st_h11_aa.jpg',4,NULL),('SH032527360000','Die 90er-Jahre sind geprägt von einer Neuordnung der Welt nach dem Ende des Kalten Krieges.',NULL,'DEU','Die 90er - Jahrzehnt der Chancen','https://s3.amazonaws.com/schedulesdirect/assets/p17052794_st_h11_aa.jpg',4,NULL),('SH020127430000','Polit-Talk, bei dem jeweils zwei prominente Gäste zum politischen Schlagabtausch zu Gast sind. Die Zuschauer können sich per Mail an der Sendung beteiligen und den Gästen ihre Fragen stellen.',NULL,'DEU','Unter den Linden','https://json.schedulesdirect.org/20141201/image/assets/p11113219_b_h11_aa.jpg',4,NULL),('SH019729600000','In den Reportagen werden Orte in Berlin und Brandenburg erkundet, die spannende, bisher weitgehend unbekannte Zeitgeschichte aufzeigen.',NULL,'DEU','Geheimnisvolle Orte','https://json.schedulesdirect.org/20141201/image/assets/p10972870_i_h6_aa.jpg',4,NULL),('SH031672740000','Die Sendung beschäftigt sich mit den Themen der Promis und der Reichen und Schönen. Annemarie Warnkross nimmt die verschiedensten Ereignisse genauer unter die Lupe und scheut auch nicht davor, den Promis persönliche Fragen zu stellen.',NULL,'DEU','red. Spezial','https://s3.amazonaws.com/schedulesdirect/assets/p10938653_st_h11_ab.jpg',4,NULL),('SH019580550000','Die Rundschau informiert täglich über Nachrichten, Wetter, Sport, Verkehr und Regionales für Bayern und Umgebung und fasst die wichtigsten und aktuellsten Nachrichten zusammen.',NULL,'DEU','Rundschau','https://json.schedulesdirect.org/20141201/image/assets/p10911702_i_h11_aa.jpg',4,NULL),('SH019001930000','Zusammen mit Woozle, einem zotteligen Beuteltier, geht Benedikt Weber sämtlichen Alltagsfragen auf den Grund. Während er versucht, seine Antworten wissenschaftlich zu begründen, bevorzugt Woozle kreativere Lösungsansätze.',NULL,'DEU','Woozle Goozle','https://json.schedulesdirect.org/20141201/image/assets/p10672039_st_h11_aa.jpg',4,NULL),('SH028289630000','Diese Sendung berichtet über die aktuellsten und wichtigsten Nachrichten der Bundesrepublik.',NULL,'DEU','Tagesschau','https://json.schedulesdirect.org/20141201/image/assets/p10414016_b_v4_aa.jpg',4,NULL),('SH019562930000','Um 1870 in Walnut Grove, einem kleinen Städtchen im Norden Amerikas: Die Ingalls - das sind Vater Charles, Mutter Caroline und die drei Kinder Mary, Laura und Carrie - bewirtschaften eine kleine Farm, die die Familie mal recht, mal schlecht ernährt. Doch auch wenn es wirtschaftlich nicht so gut läuft, die Ingalls lassen sich davon nicht unterkriegen. Auch nicht durch Rückschläge im Privatleben, denn sie wissen: Solange die Familie zusammenhält, kann nicht wirklich etwas schiefgehen.',NULL,'DEU','Unsere kleine Farm','https://json.schedulesdirect.org/20141201/image/assets/p184223_b_h6_ah.jpg',4,NULL),('SH019765930000','Der Schüler Yu-Gi erhält von seinem Großvater das magische Spiel der Schatten, das seither ein großes Rätsel umgibt. Yu-Gi und seine Freunde machen sich an die Lösung des Rätsels und ahnen nicht, dass sie das Schicksal der Welt in den Händen halten.',NULL,'DEU','Yu-Gi-Oh!','https://s3.amazonaws.com/schedulesdirect/assets/p534172_b_v7_aa.jpg',4,NULL),('SH034161930000','Die Moderatoren diskutieren mit ihrem Gast über die ungeschriebenen Regeln des Alltags. Gemeinsam soll herausgefunden werden, wie man sich in so mancher kniffliger Situation verhalten sollte, und was gänzlich unpassend wäre.',NULL,'DEU','Nicht dein Ernst!','https://json.schedulesdirect.org/20141201/image/assets/p17818224_st_h11_aa.jpg',4,NULL),('SH031008440000','Die Dokumentation berichtet über Nazi-Führer wie Joseph Goebbels, Albert Speer und Konsorten.',NULL,'DEU','Hitlers Komplizen','https://s3.amazonaws.com/schedulesdirect/assets/p16264035_st_h11_ad.jpg',4,NULL),('SH019766850000','Das bayerische Allroundtalent widmet sich mit großer Verwandlungsfreude politischen Ereignissen.',NULL,'DEU','SchleichFernsehen','https://json.schedulesdirect.org/20141201/image/assets/p10987582_b_h11_aa.jpg',4,NULL),('SH019985010000','Berlin Live ist ein musikalisches Happening, veranstaltet im TRAFO, der beeindruckenden Beton-Kathedrale, die auch den legendären Club Tresor beherbergt. Drei Bands kommen zusammen und spielen abwechselnd.',NULL,'DEU','Berlin Live','https://s3.amazonaws.com/schedulesdirect/assets/p11069640_b_h6_aa.jpg',4,NULL),('SH016388730000','Das `Mittagsmagazin\' ist eine Nachrichtensendung, die über aktuelle Themen berichtet. Die Beiträge handeln von Themenbereichen wie Sport, Wissen und Kultur.',NULL,'DEU','ARD-Mittagsmagazin','https://json.schedulesdirect.org/20141201/image/assets/p9560150_b_h11_ab.jpg',4,NULL),('SH019576340000','Die Jagd nach Verbrechern aus zwei Perspektiven - der der Polizei und der Staatsanwaltschaft. Abwechselnde Ermittlerteams sind in und um New York im Einsatz, um Verbrecher hinter Gitter zu bringen.',NULL,'DEU','Law & Order','https://s3.amazonaws.com/schedulesdirect/assets/p183983_b_h6_aa.jpg',4,NULL),('SH018581030000','Die zwölfjährige Sally sieht ihren Vater Harry, ein Meisterdetektiv, als Superhelden an. Sie möchte in seine Fußstapfen treten und ein Detektivbüro eröffnen. Spezialisiert hat sich Sally zusammen mit ihrem Freund Dowee auf die Aufträge von Kindern.',NULL,'DEU','Sally Bollywood','https://json.schedulesdirect.org/20141201/image/assets/p8355561_i_h6_aa.jpg',4,NULL),('SH019563250000','Chefinspektor Alan Banks stößt auf einen Serienmörder, der vier junge Frauen getötet hat.',NULL,'DEU','Inspector Banks','https://json.schedulesdirect.org/20141201/image/assets/p8829244_i_h11_ae.jpg',4,NULL),('SH025374390000','Die Food-Bloggerin Felicitas Then vermittelt praktisches Wissen rund ums Thema Lebensmittel. Dabei berücksichtigt sie allerlei Faktoren wie beispielsweise Herstellung, Geschmack, Nachhaltigkeit und Zubereitung. Experten geben dazu hilfreiche Tipps.',NULL,'DEU','Die Foodtruckerin','https://s3.amazonaws.com/schedulesdirect/assets/p13412980_st_h11_aa.jpg',4,NULL),('SH018573510000','Ausführliche Wettervorhersage für Deutschland in den kommenden Tagen.',NULL,'DEU','RTL Nachtjournal - Das Wetter','https://s3.amazonaws.com/schedulesdirect/assets/p10463864_i_h11_aa.jpg',4,NULL),('SH020358260000','Beiträge zu Lerninhalten unterschiedlicher Unterrichtsfächer für alle Schulstufen.',NULL,'DEU','Schulfernsehen','https://s3.amazonaws.com/schedulesdirect/assets/p11197088_b_h11_aa.jpg',4,NULL),('SH034226300000','Almke Oncken ist eigentlich kein Online-Mensch. Ihre beste Freundin Mareike wohnt nur zwei Türen weiter, die beiden sehen sich in ihrem Haus im Leipziger Osten fast täglich. Kennengelernt haben sich die beiden mithilfe der Plattform Couchsurfing.',NULL,'DEU','Verbunden - Von Fremden zu Freunden?','https://json.schedulesdirect.org/20141201/image/assets/p17849414_st_h11_aa.jpg',4,NULL),('SH019396240000','Das Magazin von ARTE wirft einen etwas anderen Blick auf das Weltgeschehen.',NULL,'DEU','ARTE reportage','https://s3.amazonaws.com/schedulesdirect/assets/p8286447_i_v7_aa.jpg',4,NULL),('SH029326570000','Molly lebt mit ihrer Familie in einer Sozialwohnung in London. In der Hoffnung auf ein besseres Leben, absolviert sie nach ihrem 18. Geburtstag eine Ausbildung beim Militär. Anschließend wird sie als Sanitäterin nach Afghanistan gesendet.',NULL,'DEU','Lost in Oz','https://json.schedulesdirect.org/20141201/image/assets/p11877840_b_s3_aa.jpg',4,NULL),('SH019657090000','Comedy-Quiz rund um Menschenkenntnis zum Mitraten.',NULL,'DEU','strassen stars','https://json.schedulesdirect.org/20141201/image/assets/p10944295_i_h11_aa.jpg',4,NULL),('SH032863170000','Die Reihe beschäftigt sich mit dem Atlantik, seinen Bewohnern und seiner Bedeutung für die Erde.',NULL,'DEU','Wilder Atlantik - Ozean der Extreme','https://json.schedulesdirect.org/20141201/image/assets/p11960681_i_h6_aa.jpg',4,NULL),('SH023656340000','Brautprofis unterstützen zukünftige Bräute dabei, das perfekte Brautkleid zu finden. Sie beantworten Typfragen und suchen im Hochzeitsmoden-Discounter, in exklusiven Nobel-Boutiquen und Nischen-Brautläden nach dem passenden Traummodell.',NULL,'DEU','Zwischen Tüll und Tränen','https://s3.amazonaws.com/schedulesdirect/assets/p12597643_st_h11_aa.jpg',4,NULL),('SH031441160000','In Bangladesch ist Bambus der Baustoff der Armen. Mit atemberaubenden Aufnahmen von den Bambuswäldern des Landes beginnt der Dokumentarfilmer Shaheen Dill-Riaz seine Einführung in die raue Welt der Männer, die den Bambus aus dem Wald holen.',NULL,'DEU','Die Bambusflößer von Bangladesch','https://s3.amazonaws.com/schedulesdirect/assets/p16473754_i_h11_aa.jpg',4,NULL),('SH020070080000','Gibt es Außerirdische? Wie dünn war die Ursuppe? Und wie sieht eigentlich die Zukunft des Universums aus? Manchmal wissen nur Experten wie der Astrophysiker Harald Lesch weiter.',NULL,'DEU','alpha-Centauri','https://json.schedulesdirect.org/20141201/image/assets/p11093581_i_h6_ac.jpg',4,NULL),('SH019733300000','In dieser bayerischen Familienserie ranken sich liebevolle Geschichten `wia ausm richtigen Lebn\' rund um das fiktive Dorf Lansing und seine Bewohner.',NULL,'DEU','Dahoam is Dahoam','https://json.schedulesdirect.org/20141201/image/assets/p10974424_b_h11_ab.jpg',4,NULL),('SH025069640000','Fünf Teenager haben einen großen Traum: sie alle wollen Profis werden, manche als Tänzer, andere als Sänger, wieder andere als Schauspieler, Comedians oder Musiker. Doch auch sie sind normale Teenager, die die erste Liebe und Freundschaften erleben.',NULL,'DEU','Spotlight','https://json.schedulesdirect.org/20141201/image/assets/p13260407_st_h11_aa.jpg',4,NULL),('SH030477540000','In dieser Sendung unterhält sich Jörg Thadeusz mit Menschen, die den Tag mitgeprägt oder in der Woche für Gesprächsstoff gesorgt haben. Dies können beispielsweise Forscher, Politiker, Stars, Musiker oder Schriftsteller sein.',NULL,'DEU','Talk aus Berlin','https://json.schedulesdirect.org/20141201/image/assets/p15916579_b_h11_aa.jpg',4,NULL),('SH020985130000','Dr. Niklas Ahrend lässt sein Leben in Leipzig hinter sich und wagt einen Neustart als Oberarzt in Erfurt - mit ungeahnten Herausforderungen, neuen Kollegen und alten Freunden, und jeder von ihnen hat seine ganz eigene Geschichte.',NULL,'DEU','In aller Freundschaft - Die jungen Ärzte','https://s3.amazonaws.com/schedulesdirect/assets/p11390058_i_h11_aa.jpg',4,NULL),('SH019370400000','Im Jahr 2030 entscheidet Ted Mosby sich, seinen Kindern Penny und Luke in allen Details zu erzählen, wie er ihre Mutter kennengelernt hat. Sein Rückblick beginnt im Jahr 2005, als er als 27-Jähriger gerade sein Architekturstudium abgeschlossen hat. Er lebt zusammen mit seinem besten Freund Marshall, der seit neun Jahren mit der Kindergärtnerin Lily liiert ist. Die Drei sind außerdem mit dem notorischen aber liebenswerten Frauenheld und Anzugträger Barney Stinson befreundet, der Ted dabei helfen soll, die Frau seines Lebens zu finden. Durch Barney lernen die Freunde Robin Scherbatsky kennenlernen, in die Ted sich sofort verliebt. Aber das Schicksal scheint es nicht gut mit ihm zu meinen, denn Robin will keine feste Beziehung.',NULL,'DEU','How I Met Your Mother','https://json.schedulesdirect.org/20141201/image/assets/p185124_i_h11_aa.jpg',4,NULL),('SH031588790000','Das Filmteam begleitet die australischen Polizisten bei ihrer täglichen Arbeit. Für die Sicherheit in der Stadt kommen sie mit Drogendealern, Diebstählen oder auch Terroristen in Kontakt. Dabei riskieren sie oft ihr Leben.',NULL,'DEU','Police Force - Einsatz Down Under','https://json.schedulesdirect.org/20141201/image/assets/p8204385_i_h11_aa.jpg',4,NULL),('SH024083840000','Elena Uhlig bereist die Regionen Deutschlands und sucht nach lokalen Küchenchefs, die sich ein Duell mit Johann Lafer oder Nelson Müller liefern. Dabei müssen die Promiköche Spezialitäten erschmecken und nachkochen.',NULL,'DEU','Stadt, Land, Lecker','https://json.schedulesdirect.org/20141201/image/assets/p12794756_b_h11_aa.jpg',4,NULL),('SH019138540000','Der kleine Angelo ist gerne mit seinen Freunden unterwegs. Sie treffen sich und kreieren die besten Strategien, um gegen ihre Rivalen antreten zu können. Nicht immer klappt es, doch die Kids haben dennoch jede Menge Spaß.',NULL,'DEU','Angelo!','https://json.schedulesdirect.org/20141201/image/assets/p8180581_i_h11_aa.jpg',4,NULL),('SH019383930000','Eric Miller erkrankt auf einmal und wird ins Krankenhaus eingeliefert, wo er kurz darauf stirbt. Die Ursache lautet Gift; Megan fährt nach einer Feier mit dem Auto nach Hause, als auf ihren Wagen geschossen wird. Seit dem fehlt von Megan jede Spur.',NULL,'DEU','Medical Detectives - Geheimnisse der Gerichtsmedizin','https://s3.amazonaws.com/schedulesdirect/assets/p439881_b_h6_ag.jpg',4,NULL),('SH015933320000','Geschichten aus dem Arbeitsalltag des 21. Hamburger Polizeikommissariats unter der Leitung von Polizeioberrat Martin Berger und des mit diesem eng kooperierenden Elbkrankenhauses, in welchem Bergers Nichte Jasmin Jonas sich um die Patienten kümmert.',NULL,'DEU','Notruf Hafenkante','https://s3.amazonaws.com/schedulesdirect/assets/p9370356_i_v7_aa.jpg',4,NULL),('SH016398180000','Nachrichten aus den Bundesländern mit Themen aus der Politik, Wirtschaft und Gesellschaft.',NULL,'DEU','heute - in deutschland','https://s3.amazonaws.com/schedulesdirect/assets/p9563640_b_h6_ab.jpg',4,NULL),('SH019577120000','Die New Yorker Journalistin Carrie Bradshaw und ihre drei Freundinnen, Samantha, Charlotte und Miranda, sind auf der Suche nach der großen Liebe. Dabei schlagen sie sich durch den Dating-Dschungel der Stadt, bringen ihre Freunde an den Rand der Verzweiflung und experimentieren gerne. Beruflich geht jede ihren eigenen Weg, von der erfolgreichen PR-Agentin Samantha über die Anwältin Miranda bis zur Sexkolumnistin Carrie. Galeristin Charlotte strebt währenddessen nach ihrer persönlichen Erfüllung als Hausfrau und Mutter. Gemeinsam überstehen sie gescheiterte Beziehungen, komplizierte Lebenssituationen und überraschende Vorkommnisse, die ihre Leben durcheinanderbringen.',NULL,'DEU','Sex and the City','https://s3.amazonaws.com/schedulesdirect/assets/p184689_l_h6_aa.jpg',4,NULL),('SH019569760000','Jake und seine Freunde Izzy, Cubby und der Papagei Skully leben auf einer Insel nahe bei Nimmerland. Die Kinder sind dem berüchtigten Captain Hook ein Dorn im Auge und er versucht alles, um ihnen das Leben so schwer wie möglich zu machen, wie etwa ihre Sachen zu stehlen. Um ein Abenteuer abzuschließen, müssen Jake und seine Freunde stets drei Aufgaben lösen, nach deren Erfüllung sie Golddublonen bekommen, die sie am Ende in ihre Teamschatztruhe legen.',NULL,'DEU','Jake und die Nimmerland Piraten','https://json.schedulesdirect.org/20141201/image/assets/p8492050_b_h6_aa.jpg',4,NULL),('SH030218130000','Die Therapeuten und Sozialarbeiter der Klinik am Südring unterstützen Patienten, die Verhaltensauffälligkeiten zeigen oder sonstige emotionale Herausforderungen zu bewältigen haben. Außerdem stehen sie den betroffenen Familien zur Seite.',NULL,'DEU','Klinik am Südring - Die Familienhelfer','https://json.schedulesdirect.org/20141201/image/assets/p15791050_i_s3_aa.jpg',4,NULL),('SH016982900000','Die toughe und sehr selbstbewusste Max arbeitet in einem schmierigen Diner in New York. Durch Zufall lernt sie Caroline kennen, deren Vater seine Millionen verloren hat, nimmt sie bei sich auf und lernt sie im Diner ein, damit diese wenigstens die Miete bezahlen kann. Zwischen den beiden entwickelt sich eine ungewöhnliche Freundschaft und die Hoffnung, zusammen ein eigenes Cupcake-Unternehmen aufzubauen - wenn sie das nötige Geld dafür aufbringen können. So wird am Ende jeder Folge der gesparte Betrag eingeblendet.',NULL,'DEU','2 Broke Girls','https://s3.amazonaws.com/schedulesdirect/assets/p8680648_l_h6_aa.jpg',4,NULL),('SH019790530000','Rainer Sass stellt in einer mobilen Küche regionale Spezialitäten im Norden Deutschlands vor.',NULL,'DEU','Sass: So isst der Norden!','https://json.schedulesdirect.org/20141201/image/assets/p10998206_b_h11_aa.jpg',4,NULL),('SH015402360000','Die Reportage- und Dokumentationsreihe zeigt unerforschte Gebiete, reist zu unentdeckten Traumzielen auf der ganzen Welt, und besucht fremde Völker, um über ihre Kultur und ihre Bräuche zu berichten.',NULL,'DEU','Länder - Menschen - Abenteuer','https://json.schedulesdirect.org/20141201/image/assets/p9125881_i_h11_aa.jpg',4,NULL),('SH003332650000','Das Nachtjournal zeigt zu später Stunde noch umfassende Nachrichten des Tages aus Deutschland und der Welt. Mit den aktuellsten Ereignissen aus der Politik, Wirtschaft und Kultur können sich die Zuschauer nachts noch auf dem Laufenden halten. Das Markenzeichen des Magazins umfasst Fakten, Hintergrundberichterstattungen sowie Meinungen zu den aktuellen globalen sowie regionalen Themen. Mit der Rubrik `100 Tage danach\' greift die Sendung schlagzeilenträchtige Ereignisse aus der Vergangenheit auf, zeigt deren Folgen und Entwicklungen und fragt nach den Konsequenzen.',NULL,'DEU','RTL-Nachtjournal','https://json.schedulesdirect.org/20141201/image/assets/p472490_b_h11_aa.jpg',4,NULL),('SH019461950000','Magazin mit Schlagzeilen aus der Region, interessanten Gästen im Studio und Verbrauchertipps. Die Moderatoren berichten über alles, was in Sachsen, Sachsen-Anhalt und Thüringen für Schlagzeilen sorgt und informieren über Aktuelles.',NULL,'DEU','MDR um 4: Neues von hier','https://json.schedulesdirect.org/20141201/image/assets/p10869377_i_h11_aa.jpg',4,NULL),('SH022939820000','Drei Bärenbrüdern Grizz, Panda und Eisbär versuchen, in der menschlichen Gesellschaft Anschluss zu finden und Freunde zu gewinnen. Immer wieder wird das Trio mit den Herausforderungen der digitalen Welt und der modernen Gesellschaft konfrontiert.',NULL,'DEU','We Bare Bears - Bären wie wir','https://json.schedulesdirect.org/20141201/image/assets/p11921875_i_h11_aa.jpg',4,NULL),('SH031760630000',NULL,NULL,'DEU','Arthur und die Freunde der Tafelrunde','https://json.schedulesdirect.org/20141201/image/assets/p15847422_i_h11_aa.jpg',4,NULL),('SH019721720000','Wöchentliche Reihe mit Tierdokumentationen aus aller Welt.',NULL,'DEU','Welt der Tiere','https://json.schedulesdirect.org/20141201/image/assets/p10969990_b_h11_aa.jpg',4,NULL),('SH019559880000','Alpenpanorama zeigt Livebilder aus ausgewählten Urlaubsorten.',NULL,'DEU','Alpenpanorama',NULL,4,NULL),('SH015330760000','Kennen Sie das: Damit Sie sich im Haus richtig wohlfühlen können, muss auch der Garten auf Vordermann sein. Innovative Lösungen zur Pflege und Dekoration des Außenbereichs Ihre Zuhauses finden Sie in dieser Show.',NULL,'DEU','Haus & Garten','https://json.schedulesdirect.org/20141201/image/assets/p9092498_st_h11_aa.jpg',4,NULL),('SH027600150000','Im regionalen Nachrichtenmagazin steht der Alltag von Menschen in NRW im Mittelpunkt. Neben aktuellen Berichten aus der Region gibt es auch Zeitreisen in die Vergangenheit und für Zuschauer die Möglichkeit, mit Studiogästen in Kontakt zu treten.',NULL,'DEU','Hier und heute','https://json.schedulesdirect.org/20141201/image/assets/p14462037_st_h11_aa.jpg',4,NULL),('SH028582930000','Während der Nazizeit werden Tausende deutsche Jugendliche rekrutiert - vorzugsweise gute Sportler.',NULL,'DEU','Hitlerjugend - Vom Sportplatz an die Front','https://s3.amazonaws.com/schedulesdirect/assets/p14272641_st_h11_aa.jpg',4,NULL),('SH034195550000','Die Moderatorin begibt sich in Berlin und Brandenburg auf die Jagd nach Rekorden. Sie geht den kuriosesten und erstaunlichsten Dingen, sowie den verrücktesten und einzigartigen menschlichen und tierischen Leistungen auf die Spur.',NULL,'DEU','Heimat der Rekorde','https://json.schedulesdirect.org/20141201/image/assets/p17834353_st_h11_aa.jpg',4,NULL),('SH019667660000','Das Politik-Magazin mit Susanne Stichler geht Missständen nach und dokumentiert die Folgen - hintergründig, engagiert und pointiert.',NULL,'DEU','Panorama 3','https://json.schedulesdirect.org/20141201/image/assets/p10948892_b_h11_aa.jpg',4,NULL),('SH019559740000','Melinda wird von den Geistern verstorbener Menschen heimgesucht, da nur sie diese sehen und ihnen helfen kann. Doch ihre Gabe empfindet die junge Frau als Segen und als Fluch, denn ihre Beziehung zu dem Rettungssanitäter Jim Clancy leidet darunter.',NULL,'DEU','Ghost Whisperer - Stimmen aus dem Jenseits','https://s3.amazonaws.com/schedulesdirect/assets/p185120_i_v4_aa.jpg',4,NULL),('SH019766590000','Drei Kandidaten behaupten, dieselbe Person zu sein. Das Rateteam muss herausfinden, wer von den Dreien die gesuchte Person ist und wer sich nur als solche ausgibt. Dies stellt sich als Herausforderung dar, denn oft klingt die Wahrheit unglaubwürdig.',NULL,'DEU','Sag die Wahrheit','https://json.schedulesdirect.org/20141201/image/assets/p10987517_b_h11_aa.jpg',4,NULL),('SH019758630000','Calimero ist ein niedliches, schwarzes Küken aus Palermo mit einer Eierschale auf dem Kopf. Mit seinen Freunden Priscilla, Peter und Alexander erlebt er allerlei Abenteuer. Miteinander kämpfen sie für die Gerechtigkeit in ihrer kleinen Welt.',NULL,'DEU','Calimero','https://json.schedulesdirect.org/20141201/image/assets/p10744788_i_h11_ab.jpg',4,NULL),('SH019664380000','Wie sah die Welt vor 20 Jahren aus? Die Sendung bietet einen Einblick in die jüngere Zeitgeschichte.',NULL,'DEU','Tagesschau - Vor 20 Jahren','https://s3.amazonaws.com/schedulesdirect/assets/p10947186_b_v4_aa.jpg',4,NULL),('SH019864620000','Mit einer Trambahn fährt Andreas Bönte durch das nächtliche München. Seine Gäste: Persönlichkeiten, die etwas zu sagen haben, die aus ihrem bewegten und bewegenden Leben erzählen.',NULL,'DEU','Nachtlinie','https://json.schedulesdirect.org/20141201/image/assets/p11026844_b_h11_aa.jpg',4,NULL),('SH018557200000','Der Kriminalbeamte Adrian Monk wurde aufgrund seiner besonderen Fähigkeiten in seinem Beruf schnell eine kleine Berühmtheit. Er hat ein fotografisches Gedächtnis und kann selbst aus kleinsten Hinweisen eine Spur basteln. Seit dem Tod seiner geliebten Frau Trudy durch einen mysteriösen Anschlag leidet er jedoch unter starken Ängsten und Zwangsstörungen, was zu seiner Suspendierung vom Dienst beim San Fransisco Police Department führt. Nachdem er sich daraufhin drei Jahre lang in seiner Wohnung eingesperrt hat, macht er sich schließlich als Privatdetektiv selbstständig und wird von der Polizei immer wieder um Unterstützung gebeten. Mit der Hilfe seines ehemaligen Chefs Captain Leland Stottlemeyer sowie seiner persönlicher Assistentin Sharona Fleming löst Monk seitdem die Kriminalfälle, die sonst niemand lösen kann.',NULL,'DEU','Monk','https://s3.amazonaws.com/schedulesdirect/assets/p184807_i_h6_aa.jpg',4,NULL),('SH034195830000','Wenn die Sonne untergegangen ist kämpfen nachtaktive Tiere auf aller Welt ums Überleben.',NULL,'DEU','Nachtaktiv','https://json.schedulesdirect.org/20141201/image/assets/p16330299_i_h11_aa.jpg',4,NULL),('SH019828440000','Zwei Prominente verbringen einen Abend miteinander, plaudern und tun Dinge, die sie im Fernsehen gewöhnlich nicht tun. Dabei werden sie von einem Kamerateam begleitet. Einer der Prominenten ist der Gastgeber, der Ort und Programm bestimmt.',NULL,'DEU','Durch die Nacht mit...','https://json.schedulesdirect.org/20141201/image/assets/p11013227_b_h6_af.jpg',4,NULL),('SH032903410000','Eine geheim operiernde Agentur kombiniert eine neu entdeckte Substanz namens Morph-X mit tierischer DNA, um das Power Rangers Beast Morphers Team zu bilden. Die Ranger müssen einen bösen Computervirus bekämpfen, der nach Macht aus ist.',NULL,'DEU','Power Rangers: Beast Morphers','https://json.schedulesdirect.org/20141201/image/assets/p16595885_b_v4_ab.jpg',4,NULL),('SH019384430000','Fünf Kandidaten laden sich gegenseitig nacheinander zu sich nach Hause zum Essen ein. Am Ende jeder Sendung wird der Gastgeber von den restlichen Kandidaten mit 0 bis 10 Punkten bewertet und so der Gewinner des perfekten Dinners ermittelt.',NULL,'DEU','Das perfekte Dinner','https://s3.amazonaws.com/schedulesdirect/assets/p10842374_st_h11_aa.jpg',4,NULL),('SH019655700000','Die Hessenreporter begleiten Menschen aus dem Sendegebiet im Alltag. Dabei berichten sie über ihre Geschichten, ihre besonderen Herausforderungen, denen sie oft gegenüberstehen, aber auch über ihre Schicksale und Erfolgserlebnisse.',NULL,'DEU','Hessenreporter','https://s3.amazonaws.com/schedulesdirect/assets/p10943926_i_h11_aa.jpg',4,NULL),('SH019563180000','Die Schweizer Nachrichtensendung informiert in Berichten, Reportagen, Porträts und Live-Gesprächen.',NULL,'DEU','10vor10','https://json.schedulesdirect.org/20141201/image/assets/p10905661_i_h11_aa.jpg',4,NULL),('SH019560010000','Das Wissensmagazin behandelt die verschiedensten Themen aus den Bereichen Wirtschaft, Wissenschaft und Technik. Außerdem werden zahlreiche Berichte aus aller Welt präsentiert, die verständliche Antworten zu aktuellen Fragen liefern.',NULL,'DEU','Abenteuer Leben','https://s3.amazonaws.com/schedulesdirect/assets/p555552_st_h11_aa.jpg',4,NULL),('SH018439280000','Yoyo und Doc Croc erleben die bekanntesten Märchen mit Hilfe eines sprechenden Märchenbuchs mit.',NULL,'DEU','SimsalaGrimm','https://json.schedulesdirect.org/20141201/image/assets/p10415916_b_h11_aa.jpg',4,NULL),('SH033629390000','Die Baubranche in Deutschland boomt. Überall im Land werden Fachkräfte gesucht, denn auf den Baustellen wartet viel Arbeit. Gezeigt werden Arbeiter und Ingenieure, die bei Großprojekten die Ärmel hochkrempeln, um Aufträge fristgerecht zu erledigen.',NULL,'DEU','Helden der Baustelle','https://json.schedulesdirect.org/20141201/image/assets/p17606427_st_h11_aa.jpg',4,NULL),('SH016397950000','Kritisch, investigativ und unerschrocken - das Politmagazin bietet Reportagen, Analysen und Hintergründe zu aktuellen Themen aus Politik, Wirtschaft und Gesellschaft. Die Reporter decken Missstände auf und liefern Fakten.',NULL,'DEU','Frontal 21','https://json.schedulesdirect.org/20141201/image/assets/p9563561_b_h11_ab.jpg',4,NULL),('SH028586800000','Immer wenn ihr Besitzer Bob das Haus verlässt, haben die Welpen Bingo und Rolly jede Menge Spaß. Bingo bestimmt dabei immer, wohin es geht. Ihre Katzenschwester Hissy leistet den beiden Gesellschaft auf ihren Abenteuern.',NULL,'DEU','Welpen Freunde','https://json.schedulesdirect.org/20141201/image/assets/p13949191_i_h11_aa.jpg',4,NULL),('SH029400720000','Der Australier Todd Sampson, Abenteurer und menschliches Versuchskaninchen, nimmt einige der größten Herausforderungen seines Lebens auf sich, um die außergewöhnlichsten Menschen der Welt zu erforschen. Die Dokumentationsreihe zeigt seine Ausflüge.',NULL,'DEU','Die Fremdenlegion - Training mit den harten Jungs','https://json.schedulesdirect.org/20141201/image/assets/p13365563_i_h11_aa.jpg',4,NULL),('SH031379590000','Die Sendung präsentiert anschaulich und möglichst unterhaltsam medizinische Themen.',NULL,'DEU','rundum gesund','https://json.schedulesdirect.org/20141201/image/assets/p16433653_b_h6_aa.jpg',4,NULL),('SH019576480000','Das Magazin ist für Frauen ausgerichtet, die sich für Lifestyle interessieren. Hier präsentieren die Moderatoren die Highlights der Wochen aus den Bereichen Mode, Reisen, Dating und Stars.',NULL,'DEU','Sixx Quickie','https://json.schedulesdirect.org/20141201/image/assets/p10910263_st_h11_aa.jpg',4,NULL),('SH026941360000','Die Body Fixers kümmern sich um jeden, der im Bereich Body, Beauty und Styling einen Fehlgriff gemacht hat. Junge Profis in Sachen Mode, Hairstyling und Kosmetik helfen den Kunden bei Notfällen und zudem sich in der eigenen Haut wohler zu fühlen.',NULL,'DEU','Body Fixers - Die Beauty Profis','https://json.schedulesdirect.org/20141201/image/assets/p13246352_i_h11_aa.jpg',4,NULL),('SH028822320000','Zusammen mit der Archäologin Dr. Sarah Parcak macht sich der Historiker Dan Snow auf die Suche nach Überresten längst vergessener Siedlungen der Wikinger. Sie versuchen, ein neues Licht auf das Wissen über das Leben der Wikinger werfen zu können.',NULL,'DEU','Legende und Wahrheit - Die Wikinger','https://s3.amazonaws.com/schedulesdirect/assets/p15081687_st_h11_aa.jpg',4,NULL),('SH019952950000','In einem geheimen US-Militärkomplex unter der Leitung von Hammond ist das Stargate aufgebaut, ein Relikt einer jahrtausendealten Zivilisation. Auf anderen Planeten stehen Stargates, mit deren Hilfe man von einem Planeten zum anderen reisen kann.',NULL,'DEU','Stargate','https://s3.amazonaws.com/schedulesdirect/assets/p184337_b_h6_ac.jpg',4,NULL),('SH025581220000','In der Serie empfängt der Kabarettist, Musiker und Schauspieler Hannes Ringlstetter wöchentlich zwei illustre Gäste. Es geht um Themen der Woche, Politik, das Leben und um das, was die Gesellschaft bewegt. Die Musik kommt von der Band Ringlstetter.',NULL,'DEU','Ringlstetter','https://s3.amazonaws.com/schedulesdirect/assets/p13514504_i_v7_aa.jpg',4,NULL),('SH019395240000','Das Wissensmagazin befasst sich werktäglich mit Themen aus dem Alltag und der Naturwissenschaft.',NULL,'DEU','Xenius','https://s3.amazonaws.com/schedulesdirect/assets/p10838421_i_v7_aa.jpg',4,NULL),('SH015402140000','Die Fahrten der einzelnen Folgen gehen durch Wälder und Felder, über Viadukte die Flüsse und Täler überspannen, bis in die Wüste, oder dem hohen Norden, in den Schnee. Auch Modellbahnen und Modellbahnausstellungen kommen vor.',NULL,'DEU','Eisenbahn-Romantik','https://json.schedulesdirect.org/20141201/image/assets/p9125780_i_h11_aa.jpg',4,NULL),('SH018778360000','Als Mr. McGregers Neffe das Haus seines Onkels übernimmt, werden Peter Hase, seine Schwestern und sein Cousin aus dem Garten vertrieben. Peter aber ist einfallsreich und erweist sich als würdiger und schlauer Gegner.',NULL,'DEU','Peter Hase','https://json.schedulesdirect.org/20141201/image/assets/p9628545_i_h6_ab.jpg',4,NULL),('SH019757910000','Kulinarische Entdeckungsreise mit Susanne Nett.',NULL,'DEU','Die Rezeptsucherin','https://json.schedulesdirect.org/20141201/image/assets/p10984177_b_h11_aa.jpg',4,NULL),('SH018558850000','Quizsendung mit Günther Jauch, in der die Kandidaten bis zu eine Million Euro gewinnen können. 15 Fragen mit vier vorgegebenen Antwortmöglichkeiten gilt es zu beantworten. Dafür werden dem Teilnehmer drei Joker zur Seite gestellt.',NULL,'DEU','Wer wird Millionär?','https://json.schedulesdirect.org/20141201/image/assets/p10458840_i_h6_aa.jpg',4,NULL),('SH021456810000','Wenn Sie nicht gerade Süßigkeiten futtern, zeigen vier Schüler, die sich eine Musikkarriere erhoffen, als Mitglieder des Light Music Club ihr Talent.',NULL,'DEU','K-On!','https://json.schedulesdirect.org/20141201/image/assets/p9393828_b_h11_ab.jpg',4,NULL),('SH019424280000','Zwei Frauen, meist aus gegensätzlichen Verhältnissen, tauschen für zehn Tage die Familien. Sie kümmern sich um die jeweiligen Familien der anderen - alles unter Begleitung der Kamera. Anschließend tauschen sie ihre Erfahrungen miteinander aus.',NULL,'DEU','Frauentausch','https://s3.amazonaws.com/schedulesdirect/assets/p10855873_st_h11_aa.jpg',4,NULL),('SH015443980000','Wöchentliches Kulturmagazin im Programm des Norddeutschen Rundfunks.',NULL,'DEU','Kulturjournal','https://json.schedulesdirect.org/20141201/image/assets/p9145512_b_h11_aa.jpg',4,NULL),('SH026431980000','Im Schaltraum des Kraftwerks Berlin trifft der Journalist Louis Klamroth verschiedene Gäste aus Politik, Wirtschaft oder Gesellschaft. Er fühlt den Gästen auf den Zahn und stellt mit seiner intelligten Art provokative Fragen.',NULL,'DEU','Klamroths Konter','https://json.schedulesdirect.org/20141201/image/assets/p13928464_st_h11_aa.jpg',4,NULL),('SH019613380000','Die Sendung beschäftigt sich mit einer bunten Mischung aus historischen, politischen und aktuellen Themen und präsentiert diese in Form von wöchentlichen Reportagen. Diese werden sorgfältig recherchiert und ausgearbeitet.',NULL,'DEU','Spiegel TV - Reportage','https://s3.amazonaws.com/schedulesdirect/assets/p10925017_st_h11_aa.jpg',4,NULL),('SH019559950000','Die Nachrichtensendung informiert über die Geschehnisse des Tages und andere wichtige Themen.',NULL,'DEU','kabel eins news','https://json.schedulesdirect.org/20141201/image/assets/p10903601_b_h11_ab.jpg',4,NULL),('SH024158380000','Der Atombombenabwurf über Hiroshima ist Beweis für die ungeheure Energie und Zerstörungskraft von angereichertem Uran. Die Dokumentation beleuchtet die Geschichte des Urans und fragt, ob es möglich ist, Uran als Energiequelle gefahrlos zu nutzen.',NULL,'DEU','Uran - Das unheimliche Element','https://json.schedulesdirect.org/20141201/image/assets/p12825339_b_h6_aa.jpg',4,NULL),('SH023090100000','Das Nachrichtenmagazin informiert über aktuelle Meldungen aus Deutschland und der Welt.',NULL,'DEU','heute','https://json.schedulesdirect.org/20141201/image/assets/p12339826_b_h11_az.jpg',4,NULL),('SH019462190000','Das Sandmännchen bringt die Kinder mit einer Gute-Nacht-Geschichte ins Bett und sorgt für angenehme Träume. Mit Fabelfiguren wie Schnatterinchen, Herr Fuchs oder Frau Elster werden Geschichten aus Fantasie-Welten erzählt.',NULL,'DEU','Unser Sandmännchen','https://json.schedulesdirect.org/20141201/image/assets/p10869475_i_h11_aa.jpg',4,NULL),('SH019587410000','Das Magazin für Gartenfreunde in Berlin und Brandenburg, mit praktischen Tipps und Hinweisen.',NULL,'DEU','rbb Gartenzeit','https://json.schedulesdirect.org/20141201/image/assets/p10914954_b_h11_aa.jpg',4,NULL),('SH029163420000','Diese Sendung widmet sich, gemeinsam mit Experten aus dem jeweiligen Bereich, einem spezifischen Schwerpunktthema aus der Gründerszene und beleuchtet es von vielen verschiedenen Seiten.',NULL,'DEU','Startup Magazin','https://json.schedulesdirect.org/20141201/image/assets/p15247922_st_h11_aa.jpg',4,NULL),('SH029003150000','Der Moderator macht Spitzenforschung in Deutschland erlebbar. Dazu begibt er sich in jeder Staffel zu einem anderen Forschungsort in der Republik. Dort trifft er auf Menschen, die die Wissenschaft mit ihrer Arbeit und ihren Visionen voranbringen.',NULL,'DEU','SMS - Schwanke meets Science','https://json.schedulesdirect.org/20141201/image/assets/p15166101_st_h11_aa.jpg',4,NULL),('SH027713660000','Zusammenfassungen, Highlights und mehr aus der Welt des Reitsports werden gezeigt.',NULL,'DEU','Springreiten','https://s3.amazonaws.com/schedulesdirect/assets/p8199266_i_h11_aa.jpg',4,NULL),('SH020611350000','Aus der Region für die Region: Von der harten Politik bis hin zu unterhaltsamen Heimatgeschichten - wir sind stets nah dran an den Menschen und ihren Themen.',NULL,'DEU','Niedersachsen 18.00 Uhr','https://json.schedulesdirect.org/20141201/image/assets/p11282815_i_h11_aa.jpg',4,NULL),('SH019656860000','Aktueller Sport vom Tage.',NULL,'DEU','Sport im Osten','https://json.schedulesdirect.org/20141201/image/assets/p10944220_i_h11_aa.jpg',4,NULL),('SH028128090000','Die Aufklärungsquote von Kapitalverbrechen in Deutschland liegt bei über 96 Prozent. Ein Großteil dieser hohen Quote ist den verschiedenen Bereichen der Forensik zu verdanken. Die Sendung beschäftigt sich deshalb mit deren Alltag.',NULL,'DEU','Auf der Spur des Verbrechens - Forensiker im Einsatz','https://s3.amazonaws.com/schedulesdirect/assets/p14758655_st_h11_aa.jpg',4,NULL),('SH019578550000','`DAS!\' informiert täglich über das, was im Norden Gesprächsthema ist. Zeitgleich begrüßen die Moderatoren einen prominenten Gast auf dem Roten Sofa.',NULL,'DEU','DAS!','https://json.schedulesdirect.org/20141201/image/assets/p10910973_i_h11_aa.jpg',4,NULL);
